INSERT INTO `services` VALUES (1,535682979248589,'Services for Older Adults',NULL,899425619619906,'St. Vincent\'s offers services focusing on the mental health needs of individuals age 60 and older. All treatment services are provided by a multidisciplinary treatment team including psychiatrists, a clinical psychologist, social workers, nursing staff, and activity therapists, all with expertise and experience in treating older adults. \n\n-Geriatric ambulatory program\n-Outpatient geriatric program\n-Inpatient geriatric unit\n-Senior social club\n-ECT\n\nPosted 11/19','788929514513952','www.stvincentswestchester.org',NULL,NULL,NULL,'738473770520078',NULL,NULL,NULL,NULL,NULL,'928975964159543',NULL,NULL,NULL,'942584417752565',NULL,NULL,NULL),(2,538505964955515,'Memory Minyan',NULL,577622941794896,'From their website: \"The world’s first dementia-friendly Shabbat prayer and Shabbat meal experience in a synagogue. Caregivers can invite old friends to worship and share a meal in a space they have shared for years.\" (914) 419-7219','1121803768506081','https://beyondmemory.org/memory-minyan/',NULL,NULL,NULL,'1253061813300180,1106914314143204,1285075174713673,919422912164535',NULL,NULL,NULL,NULL,NULL,'1235801167970102',NULL,NULL,NULL,'837398020781190',NULL,NULL,NULL),(3,549048984660878,'24/7 Evaluation and Referral Service',NULL,899425619619906,'Mental health and chemical dependency evaluation and referral services for children, adolescents, and adults. Services available by appointment or on walk-in basis. \n\nPosted 11/19','788929514513952','www.stvincentswestchester.org/outpatient-programs/evaluation-and-referral-service',NULL,NULL,NULL,'738473770520078',NULL,NULL,NULL,NULL,NULL,'1229369060485443,1160136482813300',NULL,NULL,NULL,'942584417752565',NULL,NULL,NULL),(4,561027665564708,'Lighthouse Guild-Volunteer Reading Services',NULL,NULL,'Volunteer readers make home visits to seniors in the 5 boroughs to read to them for two hours, once a week. Call for intake. ','591225778904059','https://www.lighthouseguild.org/',NULL,NULL,NULL,'1291763496785325,1177309407177568',NULL,NULL,NULL,NULL,NULL,'645861347245736',NULL,NULL,NULL,'1106438661805623',NULL,NULL,NULL),(5,568312753285074,'Broadway Chemists',NULL,NULL,'Free delivery, has prescription services, hygiene products, and cosmetics; Monday-Friday: 9 am - 7 pm, Saturday: 10 am -5 pm, Sunday: closed.','631352058738431','http://broadwaychemists.com/home/383515',NULL,'bchemists@gmail.com',NULL,'890627628532068',NULL,NULL,NULL,NULL,NULL,'1320951424186281',NULL,NULL,NULL,'675276146694278',NULL,NULL,NULL),(6,578403399173032,'Paws & Reflect',NULL,757664453121327,'ONLY FOR CLIENTS OF ENCORE COMMUNITY SERVICES; \"Volunteers take our puppies to visit homebound elderly senior citizens in Manhattan. Visits occur on weekends, Saturday mornings or Sunday afternoons (once a week for 45 minutes, a commitment of 1 year). To participate in this program, you must live in Manhattan (the West Side, from Chelsea up to the 80\'s, depending on whether volunteer has a car).\"','686682455890039','www.puppiesbehindbars.com',NULL,NULL,NULL,'998681432266511',NULL,NULL,NULL,NULL,NULL,'543113728043543',NULL,NULL,NULL,'590507001886660',NULL,NULL,NULL),(7,573042556490246,'Crisis Prevention and Response Team',NULL,899425619619906,'Serves Westchester County residents of all ages who are having, or at risk of, mental health problems. The CPRT is an interdisciplinary mobile team of mental health professionals (social workers, a child and family specialist and a psychiatrist). The Team responds to people in the community, usually visiting them at home, although they can be seen elsewhere as well. The team also has offices at Saint Joseph’s Medical Center in Yonkers and at St. Vincent’s Hospital in Harrison. 24/7 phone coverage. \n\nPosted 11/19','788929514513952','www.stvincentswestchester.org/outpatient-programs/crisis-prevention-and-response-team',NULL,NULL,NULL,'738473770520078',NULL,NULL,NULL,NULL,NULL,'1173981131290767',NULL,NULL,NULL,'942584417752565',NULL,NULL,NULL),(8,588918566885363,'HomeBase Program to Prevent Homelessness',NULL,591336967347293,'From their website: \"Homelessness prevention program administered by Community-Based Organizations (CBOs) in high-need neighborhoods. The CBOs provide casework services and also help individuals and families locate existing community-based resources such as job training, child care, and anti-eviction legal services.\nYou are strongly encouraged to call your nearest HomeBase location before visiting. Depending on your address and situation, you may be advised to go to a different HomeBase office in your borough.\"','759572047570775','https://www1.nyc.gov/site/hra/help/homebase.page',NULL,NULL,NULL,'958412510535349',NULL,NULL,NULL,NULL,NULL,'1326189552461198',NULL,NULL,NULL,'1014326083250530',NULL,NULL,NULL),(9,597095425907055,'ComForCare',NULL,NULL,'ComForCare NYC offers a unique home care service by hiring and training “non-traditional” caregivers.  Our caregivers are artists and performing artists, healthcare professionals, nursing and graduate students, and individuals who desire a rewarding \"encore\" or second career.  Our mission is to create meaningful connections between our client and caregivers, along with providing the necessary basic support.  For clients living with dementia or cognitive impairment, we offer free in-home assessments and ongoing support through our partner, Inspired Memory Care (IMC).  IMC is an expert consulting and education company specializing in memory care.  Our only minimum requirement for services is a 4-hour visit, once per week.  As of 2019, our rates are $28-35 per hour.  Our service includes all of Manhattan, northern Brooklyn, Riverdale, and much of Queens. ','777089940744581','www.ComForCareNYC.com ',NULL,'nyc@comforcare.com',NULL,'687567198750084,1119801442928622',NULL,NULL,NULL,NULL,NULL,'663067304949311',NULL,NULL,NULL,'555271766673538',NULL,NULL,NULL),(10,597445276591735,'Escort Assistance Services',NULL,895690887235428,'\"Serving those who live, work, or go to school in Chelsea, with a focus on those in need, adult services for older adults age 55+,  staff speaks many languages including Spanish, Cantonese and Mandarin in addition to English. Must be a member of Penn South or live at the Hudson Guild NORC, Elliott-Chelsea Houses. Call for intake over the phone or in person.\"','609269880961062','https://hudsonguild.org/programs/adult-services/',NULL,NULL,NULL,'1119801442928622',NULL,NULL,NULL,NULL,NULL,'1307839956187600',NULL,NULL,NULL,'657516659707090',NULL,NULL,NULL),(11,564033382403516,'The Livable Communities Caregivers Coaching Program',NULL,1273704954905898,'Coaches are volunteers trained by professionals to help family caregivers better care for an older or disabled person. The one-on-one support coaches provide enables caregivers to make more informed decisions to meet the many challenges and responsibilities they face. \n\nPosted 10/19',NULL,NULL,NULL,'cap2@westchestergov.com',NULL,'1124686729166068',NULL,NULL,NULL,NULL,NULL,'1169749810887397',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(12,577322070735769,'Elderly Project',NULL,578716971059898,'\"The Elderly Project staff and pro-bono attorneys provide free legal advice, information, document drafting, and other brief services to low-income ($25,000/year and under) Manhattan residents aged 60 and over, and to the social workers and advocates who assist them. These services include direct counseling on critical issues involving housing, government benefits, and consumer debt, and the drafting and execution of wills, powers of attorney, and other essential life-planning documents. Discuss your legal question with one of our attorney referral counselors or submit it online. All information you provide will be kept confidential to the fullest extent possible under the law. Get referred to a screened and qualified lawyer or the right resource. Initial consultations are $35 or free, depending on the type of case, and last up to 30 minutes. We conduct 12 monthly walk-in legal advice and brief service clinics at Manhattan senior centers. At the clinics, seniors can discuss their legal problems with an attorney in confidence, receive advice and brief services, and, if appropriate, obtain a referral to a volunteer lawyer for representation. Seniors receive advice on legal matters in the areas of housing, consumer debt, public benefits, and life-planning documents.  Referrals are also provided to organizations that can provide representation in these and other types of legal matters.\"','985066684836990','http://www.volsprobono.org/projects/elderly-project',NULL,NULL,NULL,'1107228321502442',NULL,NULL,NULL,NULL,NULL,'1139481046774619',NULL,NULL,NULL,'613017381757593',NULL,NULL,NULL),(13,601390723366199,'Project Time-Out',NULL,1272098259280185,'Respite services for caregivers of seniors: companion and escort services, free needs assessment, outside referrals.\n\nPosted 10/19','833718283035993',NULL,NULL,'ckobroff@wjcs.com',NULL,'1124686729166068',NULL,NULL,'Sliding Scale',NULL,NULL,'1185642520976377',NULL,NULL,NULL,'1300165556123162',NULL,NULL,NULL),(14,620224791679818,'Caregiver Support Program',NULL,549012609186850,'Center provides a space for respite, contact with experienced volunteers, computer usage, and a resource library.\n\nPosted 11/19','828358922271639',NULL,NULL,NULL,NULL,'1124686729166068',NULL,NULL,NULL,NULL,NULL,'1075236187218707',NULL,NULL,NULL,'769483428819246',NULL,NULL,NULL),(15,564760337317731,'Memory Center Caregiver Support Group',NULL,844903847651421,'From their website: \"In conjunction with Caring Kind, an evening group is held at the New York Memory Center. The group meets twice a month on the first and third Wednesdays, and sessions are free but you must pre-register.\"','776030591004985','www.nymemorycenter.org',NULL,'mchrist@nymemorycenter.org',NULL,'673898301722674',NULL,NULL,NULL,NULL,NULL,'800211077624777,1318904254156917',NULL,NULL,NULL,'1292197970730746',NULL,NULL,NULL),(16,575287829593020,'Antonio Olivieri Drop-In Center for the Homeless',NULL,751774904383008,'Drop-In center for the poor and/or homeless. Soup kitchen, showers, and other services available to members of the program. Clients may drop-in during business hours, see intake, and may join the program if they qualify (cannot be part of another program for at least the past year). Open Monday-Sunday, 7:30 am-8:30 pm.','627953357271087','http://www.urbanpathways.org',NULL,'outreachteam@urbanpathways.org',NULL,'958412510535349',NULL,NULL,NULL,NULL,NULL,'960519419627091',NULL,NULL,NULL,'902749126614220',NULL,NULL,NULL),(17,600470950137477,'UJC Cemetery Visit Program',NULL,1146332029502995,'Hosts a program in August/September (call in the end of July to find out exact date and which cemeteries they go to), there are no requirements to participate. Fee is $15/$20 (depending on which location). Enrollment is rolling until spaces are filled. ','780506072615648','http://ujceastside.org/ujc-senior-services/',NULL,NULL,NULL,'1137942925140598',NULL,NULL,NULL,NULL,NULL,'726325498600801',NULL,NULL,NULL,'619641711895444',NULL,NULL,NULL),(18,617663215129537,'Addiction Institute',NULL,920174442924566,'From their website: \"Centers that treat people with addictions to alcohol, substances, and behaviors such as compulsive eating or gambling. Multiple locations in Manhattan, at Mount Sinai St. Luke\'s, Mount Sinai West, Mount Sinai Beth Israel, and The Mount Sinai Hospital. Our wide range of treatments relies on research into emerging therapies. We personalize our treatment plans to meet the individual needs of you or your loved ones.\"','1242779942144581','https://www.mountsinai.org/locations/addiction-institute',NULL,NULL,NULL,'1112870426305700',NULL,NULL,NULL,NULL,NULL,'1247621772400170',NULL,NULL,NULL,'880683347691640',NULL,NULL,NULL),(19,614110826947242,'Lions Eyeglass Recycling Center',NULL,936275506302860,'Look up donation drop-off sites online or mail donations to recycling center; reading glasses and sunglasses are donated to people in need and prescription glasses are cataloged so those in need can find a matching prescription to suit them free of charge. ','852030822667031','http://www.njlerc.org/donations.html',NULL,NULL,NULL,'1084050103649570',NULL,NULL,NULL,NULL,NULL,'1052685883168977',NULL,NULL,NULL,'1254512533201976',NULL,NULL,NULL),(20,576627045489309,'Selfhelp-Project Pilot',NULL,911077302205989,'Case management agency, serving zip codes: 10002, 10003, 10005, 10009, 10010, 10012, 10016, 10017, 10021, 10022, 10024, 10025, 10026, 10038, 10044.','837099011829572','www.selfhelp.net',NULL,'info@selfhelp.net',NULL,'819444632829102',NULL,NULL,NULL,NULL,NULL,'1155750971369497',NULL,NULL,NULL,'758370601759800',NULL,NULL,NULL),(21,598279909848188,'Alex Guitelman',NULL,1329707537181468,'While completely automating medical attention and care giving is not possible, it is possible to provide some peace of mind through smart devices and services that ensure prompt response to emergencies. ResponseLINK’s medical emergency monitoring systems provide this through 24 hour monitoring and response.\n\nPosted 10/19',NULL,'https://www.responselink.com',NULL,'Responselinknyc@hotmail.com',NULL,'1240800274587016',NULL,NULL,NULL,NULL,NULL,'1062525962532239,857602241850072',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(22,608115316855943,'Union Settlement Transportation Program',NULL,1331740916278162,'From their website: \"Our Transportation program provides East Harlem seniors with an array of trips for necessities, such as visiting the pharmacy or the bank, and group recreational excursions. The program enhances many aspects of our senior center programming, enabling us to take seniors to activities, employment or volunteer work sites, and computer classes.\"','929831456744199','https://unionsettlement.org/senior-services/',NULL,NULL,NULL,'977021400698839',NULL,NULL,NULL,NULL,NULL,'658797319701688,819686817839207',NULL,NULL,NULL,'1014326083250530',NULL,NULL,NULL),(23,609585134372649,'Encore Community Services-Shop & Escort',NULL,NULL,'**As of May 2019: There is a wait list for this program** The program is run with a small number of volunteers. Requirements: for seniors 60 and up, who are not home-bound, and lack assistance and/or formal support (home health aide or family). The use of a wheelchair, walker, or cane is okay.','1114084783135534','http://encorecommunityservices.org/outreach-programs',NULL,NULL,NULL,'1119801442928622,819444632829102',NULL,NULL,NULL,NULL,NULL,'1234004209938688',NULL,NULL,NULL,'971484030543087',NULL,NULL,NULL),(24,609956463752073,'Housing Assistance Program',NULL,1147382684224778,'Advocacy and referrals for housing resources for people with disabilities. ','885050653586052','www.adaptcommunitynetwork.org',NULL,'projectconnect@adaptcommunitynetwork.org',NULL,'958412510535349,1267306776036445,787470082421161',NULL,NULL,NULL,NULL,NULL,'1098357088666608',NULL,NULL,NULL,'1208664607201611',NULL,NULL,NULL),(25,623741258815903,'Project SenioRepair',NULL,1027449163057187,'From their website: SenioRepair is a free home safety and security program for the elderly and handicapped people throughout all five boroughs of NYC. SenioRepair service technicians are highly-skilled and fully equipped, traveling throughout the City in a retrofitted van to provide clients with necessary repairs.  The goal of the program is to upgrade the soundness of an older person’s residence to improve its structural integrity and safety. HOME REPAIRS PERFORMED INCLUDE:\nInstalling locks, peepholes, doorbells, window guards and other security-related hardware, installing smoke alarms and carbon monoxide alarms, installing bathroom grab bars, fixing washers in leaking faucets, light carpentry work such as fixing broken stairs and some furniture, fixing damaged drywall, replacing or repairing flooring in small areas, painting or plastering of small area.','706307500890092','https://www.metcouncil.org/project-metropair',NULL,NULL,NULL,'1123433776824532',NULL,NULL,NULL,NULL,NULL,'1192649972762773',NULL,NULL,NULL,'787498608599908',NULL,NULL,NULL),(26,629993267149099,'Karen Horney Clinic',NULL,NULL,'From their website: \"Offers low-cost, long-term talk therapy (psychoanalytic and psycho-therapeutic services). Patients without insurance pay $75 for the initial Intake appointment and sliding scale for ongoing therapy, accepts Medicare, Medicaid, and other insurances.\"','1201768948730770','http://www.karenhorneyclinic.org/',NULL,'TheClinic@karenhorneyclinic.org',NULL,'1112870426305700',NULL,NULL,NULL,NULL,NULL,'744593448989688',NULL,NULL,NULL,'630587500521147',NULL,NULL,NULL),(27,629334985786738,'Senior Transportation Program',NULL,813598238487651,'From their website: \"Provides transportation for senior citizens residing in Community Districts 1, 2, 3, 4 & 7 in Queens County (districts include all of Northern Queens, specifically, Astoria, Long Island City, Steinway, Sunnyside, Woodside, Jackson Heights, Elmhurst Corona, Flushing, Whitestone and College Point). Both van and car service is used to accommodate the needs of the clients that utilize the program. Van service provides group transportation for seniors to various senior centers, as well as for group shopping and day trips. Car service provides private transportation to physically handicapped or extremely frail seniors for medical appointments.\"','878692164769425','http://hss.hanac.org/hanac.org/transportation.php',NULL,NULL,NULL,'977021400698839,953560938102102',NULL,NULL,NULL,NULL,NULL,'589885648146922',NULL,NULL,NULL,'1226187280167552',NULL,NULL,NULL),(28,633984930893350,'Upper Manhattan Partnership For Senior Independence-Isabella',NULL,858950316303765,'From their website: \"Provides free case management services to older adults living in Inwood, Washington Heights, Central and West Harlem (Community Boards 9, 10 and 12). If you are 60 years or older and live in the neighborhoods identified above - we can help assess your needs and link you with an array of supports and services such as Home Care, Social Day Care, shopping and chore services, counseling and home delivered meals.\"','1118938994250126','http://www.isabella.org/Isabella/Programs/CaseManagement.aspx',NULL,NULL,NULL,'819444632829102',NULL,NULL,NULL,NULL,NULL,'1001326188914226',NULL,NULL,NULL,'1208700863367720',NULL,NULL,NULL),(29,584398422789628,'Ashley Le Winn, MSN, RN, AGNP-BC, NP-C: Geriatric Nurse Practitioner',NULL,1152807055568395,'Posted 10/19',NULL,NULL,NULL,'alewinn@geriatricmedicalassociates.com',NULL,'772331273438770,596815169700397',NULL,NULL,NULL,NULL,NULL,'1213852644918656',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(30,602743733951660,'BronxWorks Senior Services',NULL,1064833148991402,'Senior centers, senior housing assistance program, minor repair program, elder abuse services, senior mental health programs, seniors homelessness prevention project; also has Single Stop Hotline; offers walk-in and telephone services to help Bronx residents resolve problems. Offices are staffed by skilled, compassionate professionals who are specialists in housing, government benefits, consumer rights, immigration, senior services, and other matters. All walk-in personnel speak both English and Spanish.','637832190546814','http://www.bronxworks.org/',NULL,NULL,NULL,'652340976007902,958412510535349,629629464544122,1123433776824532,1197693117142860,843777382088472,1112870426305700',NULL,NULL,NULL,NULL,NULL,'569823640480746',NULL,NULL,NULL,'1231425990546332',NULL,NULL,NULL),(31,600095867391854,'Senior Law-Goldfarb Abrandt Salzman & Kutzin, LLP',NULL,NULL,'A resource site for seniors, caregivers, and professionals that provides info. on: elder law, Medicare, Medicaid, Medicaid planning, guardianship, estate planning, trusts, and the rights of the elderly and disabled. ','922489615301409','www.seniorlaw.com',NULL,NULL,NULL,'1107228321502442',NULL,NULL,NULL,NULL,NULL,'1092962818501018',NULL,NULL,NULL,'1341861553660117',NULL,NULL,NULL),(32,613454685448330,'Falk Surgical',NULL,NULL,'Assistive devices for rent or sale, other medical supplies.','1177298161182036','www.falksurgical.com',NULL,NULL,NULL,'1293277534665673,650194788641739',NULL,NULL,NULL,NULL,NULL,'1115999700397262',NULL,NULL,NULL,'912264230832936',NULL,NULL,NULL),(33,620690373734275,'New Rochelle Cares Aging in Place',NULL,883015274283468,'New Rochelle Cares Aging in Place is a not-for-profit organization providing support to New Rochelle residents to live independently at home. \n\nPosted 11/19',NULL,'https://newrochellecares.org/',NULL,'info@newrochellecares.org',NULL,'1233481324906768,1186683016797740',NULL,NULL,'Full membership $180/year for single and $300',NULL,NULL,'650376869679194',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(34,619582368851776,'Legal Services NYC Access Line',NULL,NULL,'From their website: \"Hotline for general legal info & advice: Legal Services NYC Access Line serves low income residents of NYC and is open Monday through Friday from 10am to 4pm. (Please note that Bronx Legal Services, Brooklyn Legal Services, Manhattan Legal Services, Queens Legal Services and Staten Island Legal Services are programs of Legal Services NYC.) Open Monday through Friday from 10 am to 4 pm. Our neighborhood-based offices and outreach sites across all five boroughs.\" ','1285020855329210','http://www.legalservicesnyc.org/',NULL,NULL,NULL,'1107228321502442,958412510535349',NULL,NULL,NULL,NULL,NULL,'1187447589912028',NULL,NULL,NULL,'1122913756846010',NULL,NULL,NULL),(35,617342572318212,'6 Square Feet-Affordable Living Lotteries Directory',NULL,NULL,'Updated directory of current NYC housing lotteries in the five boroughs. ',NULL,'https://www.6sqft.com/category/affordable-housing/housing-lotteries-affordable-housing/',NULL,NULL,NULL,'958412510535349',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(36,621868520570452,'Community Hearing Services',NULL,NULL,'Hearing loss assessment and hearing aid fitting.\n\nPosted 11/19','821707355796582','www.communityhearingservices.com/',NULL,NULL,NULL,'923317357274480,1240800274587016',NULL,NULL,NULL,NULL,NULL,'926161153630137,589776551119401',NULL,NULL,NULL,'895069829315381,1154069265833653',NULL,NULL,NULL),(37,627967187993671,'New Lifestyles Area Guide to Senior Residences and Care Options',NULL,NULL,'An online and print resource for information about independent living facilities in New York City.','1314783901788814','https://www.newlifestyles.com/senior-living-and-care-options/independent-living/new-york-city-ny',NULL,NULL,NULL,'924951065612317,973172406940749',NULL,NULL,NULL,NULL,NULL,'1268503226823568',NULL,NULL,NULL,'1014326083250530',NULL,NULL,NULL),(38,645296352943315,'International Low Vision Support Group\n\n',NULL,NULL,'From their website: \"Free low-vision telephone support group, year-round program of monthly group support sessions held over the telephone. It is designed for low vision seniors in the United States who have no access to the Internet or cannot attend a live support group. A session typically includes a brief update on recent research and developments, followed by listening to and discussing the current month’s recorded ILVSG presentation. See the Schedule of Presentations. Each session will include the moderator and an average of 8-12 registered members. Members who wish to do so may share their phone numbers with others in the group for personal communication outside of the scheduled sessions. This aspect of the program is optional, with phone numbers otherwise remaining totally private.\"','982966126345790','http://www.mdsupport.org/support/telesupport/',NULL,NULL,NULL,'1291763496785325,1275784767796871',NULL,NULL,NULL,NULL,NULL,'1081963400559344',NULL,NULL,NULL,'839666236357292',NULL,NULL,NULL),(39,623181776850388,'Dementia Care Coach Program',NULL,576935766925878,'Coaches or \"ReServists\" go through an intensive training process and have an online certification. They come from all walks of professional life, including: Anthropologists, Artists, Art Therapists, Engineers, Attorneys, Corporate Executives, Educators, HR Directors, Journalists, Nurses and Social Workers. The Dementia Care Coach program provides caregivers and family members support so they can deal with the progression of the senior’s condition. Serves all 5 boroughs, charge of $25/hour (send a monthly invoice to caregiver or designated person), no minimum requirement for number of days or hours, a caregiver or social worker can make direct referrals to them. A social worker from ReServe does a phone intake or in-person intake with caregiver. The person making the referral will get a list of coach resumes and they will select who they want from the list. They will meet with the chosen person or speak on the phone with them. The caregiver can be re-matched with a new coach if necessary. Telephone coaching is also available. Some respite care is available. ','1099067423819327,964719380626077','www.reserveinc.org',NULL,'info@reserveinc.org',NULL,'1253061813300180,1106914314143204,1285075174713673,673898301722674,919422912164535',NULL,NULL,NULL,NULL,NULL,'996946449389014',NULL,NULL,NULL,'1014326083250530,1014326083250530',NULL,NULL,NULL),(40,632044731493538,'Marlena Books',NULL,NULL,'From their website: \"Meaningful leisure and cognitive stimulation in the form of reading, features mature content at an appropriate reading level in order for individuals to continue their love of reading while maintaining their dignity.\"','1230155399654763','www.marlenabooks.com',NULL,'info@marlenabooks.com',NULL,'1253061813300180,1106914314143204,1285075174713673',NULL,NULL,NULL,NULL,NULL,'1177931873752968',NULL,NULL,NULL,'1014326083250530',NULL,NULL,NULL),(41,635251908156359,'PEARLS (Program to Encourage Active Rewarding Lives)',NULL,613407436114821,'Free program that helps seniors with depression, short-term (approximately 6 visits); for seniors living in Queens and Manhattan.','875358829531470','https://www.vnsny.org/how-we-can-help/community-programs/community-mental-health-services/pearls-program-encourage-active-rewarding-lives/',NULL,NULL,NULL,'1112870426305700',NULL,NULL,NULL,NULL,NULL,'985649835819054',NULL,NULL,NULL,'1014326083250530',NULL,NULL,NULL),(42,637223360115025,'Pick Up Please',NULL,868407464886686,'From their website: \"Pickup Please offers free donation pickup service in New York. Get started by scheduling a pickup online. We will send a truck to your house — often within 24 hours if you like. We accept almost any type of item (clothing, toys, shoes, books, electronics, small furniture, and small household items). Donations benefit Veterans by supporting the Vietnam Veterans of America. *Please note – As a general rule, we only accept items that are small and light enough for one person to easily lift and carry.\"','943700786016099','https://pickupplease.org/donate-clothing-in-new-york/',NULL,'info@pickupplease.org',NULL,'1084050103649570',NULL,NULL,NULL,NULL,NULL,'1059669697911851',NULL,NULL,NULL,'1014326083250530',NULL,NULL,NULL),(43,651515047921999,'Memory Tree',NULL,NULL,'For seniors with mild memory loss; all participants must schedule an interview prior to attending the program since the program is not equipped to handle “drop-ins.” If you would like to schedule an appointment please contact Elizabeth Fine.','1242044848402426,791971416713612','http://thememorytree.org',NULL,' info@thememorytree.org',NULL,'1253061813300180,1106914314143204,1285075174713673',NULL,NULL,NULL,NULL,NULL,'1158151045074969',NULL,NULL,NULL,'750348996086948,967252529008278',NULL,NULL,NULL),(44,654998496962294,'JM Journeys at The Jewish Museum ',NULL,653928728044130,'Visitors with early-stage dementia and their care partners are invited to explore exhibits through a gallery tour and art workshop. All Access Programs are free of charge and require advance reservation. Call to check schedule and current exhibition. ','623635609222852','https://thejewishmuseum.org/programs/visitors-with-disabilities#memory-loss',NULL,'access@thejm.org',NULL,'1106914314143204,1253061813300180,1285075174713673,1269324491810499',NULL,NULL,NULL,NULL,NULL,'660553247597245',NULL,NULL,NULL,'641650014179653',NULL,NULL,NULL),(45,662639429679011,'Home Assessment Program',NULL,1174073203440745,'Geared towards seniors and others to ensure their home environment is as safe as possible. Conducted by a licensed occupational therapist, the program was developed to determine the accessibility and safety of the homes of residents. By finding and removing obstacles, and checking for potential dangers like tripping hazards residents can stay safe in their homes for longer periods of time—especially those who live alone.\n\nPosted 11/19',NULL,'www.burke.org/outpatient/services/occupational-therapy/home-safety-assessment',NULL,NULL,NULL,'1186683016797740',NULL,NULL,NULL,NULL,NULL,'586330401757258',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(46,672892855027563,'Shira Ruskay Center-Holiday Programs in the Presence of Loss',NULL,732679688850212,'From their website: The holidays can be a difficult time when experiencing the loss of a loved one. The Shira Ruskay Center offers three programs annually — Coping with the Empty Chair, Gathering the Generations in the Sukkah, and Lights in the Darkness — to provide assistance and comfort during those times.\nAll programs are facilitated by a Rabbi and a Social Worker, and are open to the public at no cost. These programs are offered at the JCC in Manhattan and can also be organized in your community (contact us for more information at (212) 632-4608).','942646370393141','https://jewishboard.org/about-us/programs-services/jewish-community-services/shira-ruskay-center/',NULL,NULL,NULL,'929538948830045',NULL,NULL,NULL,NULL,NULL,'981464445231953',NULL,NULL,NULL,'873818423822151',NULL,NULL,NULL),(47,610811374021996,'Catholic Guild for the Blind',NULL,789022028516981,'\"Travel/orientation and mobility, low-vision services and devices, case management, special services for seniors aged 55+ who are legally blind including: techniques for safe meal preparation, equipment specially designed to help people with low vision manage everyday chores, home organization assistance to make it easier to access belongings, tips for banking and paying bills, special labeling of clothes for easier identification, mobility training to safely access homes and neighborhoods, help with personal and health care needs, access to community resources.\"','816282644815025','https://catholiccharitiesny.org/blog/free-services-visually-impaired',NULL,NULL,NULL,'1291763496785325',NULL,NULL,NULL,NULL,NULL,'1215733560327150',NULL,NULL,NULL,'988983663682670',NULL,NULL,NULL),(48,615943866885675,'CaptionCall',NULL,NULL,'Phone captioning service','1164235597218399','https://captioncall.com/',NULL,NULL,NULL,'673030812970350',NULL,NULL,NULL,NULL,NULL,'961271994696097',NULL,NULL,NULL,'1014326083250530',NULL,NULL,NULL),(49,637039044245130,'Disposophobia',NULL,938988071113048,'\"Contents restoration management firm,\" Assists with de-cluttering or with extreme hoarding cases.','950758333744926','disp.theplan.com',NULL,NULL,NULL,'796847632116140,941628219469820',NULL,NULL,NULL,NULL,NULL,'1272931722141317',NULL,NULL,NULL,'1014326083250530',NULL,NULL,NULL),(50,640203880194694,'VillageCare at 46 and Ten',NULL,NULL,'From their website: \"Supportive living environment for seniors 62 or older. Apartments have a complete kitchen, which includes a refrigerator and stove. Air conditioners are provided in each apartment. Available services: weekly housekeeping and linen change, three meals a day, served restaurant-style, case management services, medication management, personal care/home health aide services, recreation activities, 24-hour security, 24-hour concierge and security service, personal emergency response call systems in each apartment.\" ','578828441433069','http://www.46and10village.org/',NULL,NULL,NULL,'924951065612317,973172406940749',NULL,NULL,NULL,NULL,