ULL,NULL),(55,664390395388298,'Health Insurance Information, Counseling and Assistance - HIICAP',NULL,1266739036051769,'\"HIICAP provides free, accurate and objective information, counseling, assistance and advocacy on Medicare, private health insurance, and related health coverage plans. HIICAP helps people with Medicare, their representatives, or persons soon to be eligible for Medicare.\"','1099830782498527','https://aging.ny.gov/healthbenefits/index.cfm',NULL,NULL,NULL,'629629464544122,1267306776036445',NULL,NULL,NULL,NULL,NULL,'1249215487736961',NULL,NULL,NULL,'1080607873311324',NULL,NULL,NULL),(56,676064279658089,'Search & Care Volunteer Program',NULL,1072887075663062,'From their website: \"Companionship, visiting, and conversation, shopping, prescription pickups, and errands—particularly for the homebound, strolls through the neighborhood, technology tutorials (internet, email, e-books), socialization and entertainment activities (e.g. playing board games)\" for seniors residing in Manhattan’s Yorkville, Carnegie Hill, and East Harlem communities (catchment area is E. 86th to E.138th Streets, East River to 5th Avenue). Seniors must receive a home assessment by one of their social workers and not have involvement with other agencies to use this service.','928811788301846','https://www.searchandcare.org/volunteers/',NULL,'SandC@searchandcare.org',NULL,'1177309407177568,960167769062265,1119801442928622',NULL,NULL,NULL,NULL,NULL,'880934289187573',NULL,NULL,NULL,'841739048661639',NULL,NULL,NULL),(57,677039879382475,'Harry & Jeanette Weinberg Center for Elder Justice',NULL,NULL,'Accepts professional referrals. ','780082828511115','www.weinberg-center.org',NULL,NULL,NULL,'1197693117142860',NULL,NULL,NULL,NULL,NULL,'1096048361644202',NULL,NULL,NULL,'756690322602699',NULL,NULL,NULL),(58,678643443791128,'Hospital Patient Library',NULL,1255452373737990,'Accepts donations of books and magazines for patients, drop-off at volunteer office. Call New York Presbyterian at 212-746-5454 or Lenox Hill at (212) 434-2000 for more information. ','1040379856597574','https://www.northwell.edu/find-care/locations/lenox-hill-hospital/volunteer-services',NULL,NULL,NULL,'1084050103649570',NULL,NULL,NULL,NULL,NULL,'825295256350556,1149916542746887',NULL,NULL,NULL,'1217188568944706',NULL,NULL,NULL),(59,676949644382515,'80th Street Residence Assisted Living',NULL,NULL,'Assisted living facility with staff specially trained in dementia care, nurses onsite and available 24/7, leadership Team onsite 7 days a week including holidays, medication ordering, supervision & assistance 24/7, coordination & transportation for medical appointments with Care Manager escort, onsite Physician visits available, personal Care, supervision, encouragement & assistance as needed 24/7.','1213159844177548','www.80thstreetresidence.com',NULL,NULL,NULL,'924951065612317,973172406940749,1253061813300180,1106914314143204,1285075174713673',NULL,NULL,NULL,NULL,NULL,'1184958594634768',NULL,NULL,NULL,'804968862508387',NULL,NULL,NULL),(60,621976476364710,'Sage Center Bronx',NULL,976650048750374,'From their website: \"Sage Bronx serves LGBT older adults from across the borough and throughout the City with a diverse array of social events and support groups, daily hot nutritional lunches, a cyber center, health and wellness programs, arts and cultural events.\"','1195114345005810','https://sagenyc.org/nyc/centers/bronx.cfm',NULL,NULL,NULL,'1047568246255855',NULL,NULL,NULL,NULL,NULL,'1328436630626581',NULL,NULL,NULL,'1305549304774677',NULL,NULL,NULL),(61,622175633002842,'A Friend For Rachel',NULL,615173006867945,'Ongoing companionship/friendly visitor for early-stage Dementia clients with Junior and Senior Columbia pre-med student volunteers. Students are recruited for the program in September, so the best time to make referrals is between August and the end of September.\nA Friend for Rachel’s requirements: \n-for seniors with mild dementia\n-must be mobile, not use a walker or cane, has to be able to get out of the house on their own\n-must be cognizant of their memory problem, must remember the student they are matched with\n-the catchment area is Manhattan','912484991185269','https://www.mailman.columbia.edu/public-health-now/events/friend-rachel',NULL,'jg2673@cumc.columbia.edu',NULL,'1253061813300180,1106914314143204,1285075174713673',NULL,NULL,NULL,NULL,NULL,'1315284718474512',NULL,NULL,NULL,'850654438165937',NULL,NULL,NULL),(62,642545453046380,'Lincoln Square Neighborhood Center',NULL,NULL,'Provides community members aged 60+ with programming and services such as painting classes, yoga sessions, computer workshops, and a hot lunch.','682279321807205','http://www.lsncny.org/',NULL,NULL,NULL,'843777382088472',NULL,NULL,NULL,NULL,NULL,'763057949281298',NULL,NULL,NULL,'680518533607564',NULL,NULL,NULL),(63,645279899827675,'Picture This! Workshops',NULL,953729224266092,'From their website: \"Programs are free; reservations are required. For visitors who are blind or partially sighted. Enjoy works of art through detailed descriptions, touch, and other activities.\"','1277661337114709','https://www.metmuseum.org/events/programs/met-tours/met-tours-disabilities/picture-this',NULL,NULL,NULL,'1291763496785325',NULL,NULL,NULL,NULL,NULL,'647704932631281',NULL,NULL,NULL,'1069953270797011',NULL,NULL,NULL),(64,651144280331567,'Canaan Transportation Service',NULL,860645222041282,'Open Monday-Friday 9:00 am – 5:00 pm; transportation by van from home to appointment and back ($1 each way/$2 round-trip), schedule appointment in advance, for seniors living in central Harlem who are frail or handicapped (also provides transportation to and from senior center).','992809355343777','http://www.cbccnyc.org/seniors.html',NULL,NULL,NULL,'977021400698839',NULL,NULL,NULL,NULL,NULL,'575620791355257',NULL,NULL,NULL,'735393733744086',NULL,NULL,NULL),(65,659252601113573,'Door to Door',NULL,1155578608136431,'Travel companions escort seniors to and from medical appointments and go shopping for seniors or with seniors in Manhattan.','1216774939834028','www.dorotusa.org',NULL,NULL,NULL,'1119801442928622',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'942885369302412','967252529008278',NULL,NULL,NULL),(66,656412938928273,'Adult Day Health Care Program-New Jewish Home',NULL,1235710085929711,'Open 6 days a week in Manhattan and the Bronx. The program is for people who have chronic health conditions. Day program runs from  9:30 am-2:30 pm. Evening program runs from 2:30 pm-7:00 pm. Healthcare supervision by skilled nurses, Certified Nursing Assistant for help with personal needs, Physical, occupational and speech therapists on staff, Specialized health and wellness programs for those with chronic medical needs, medication management, telehealth, nutritional counseling, SW services, care management, counseling, therapeutic recreational activities (art, escorted field trips).','632123042293178,849146756054710','https://jewishhome.org/our-services/adult-day-health-care-2/',NULL,NULL,NULL,'1154569847221125',NULL,NULL,NULL,NULL,NULL,'1102169065786107,1281373473332406,1314931962793811',NULL,NULL,NULL,'888413272201820,1239836356019216',NULL,NULL,NULL),(67,666706338606558,'Sunnyside Community Services-Senior Programs',NULL,864426170652608,'Provides case management, home care, benefits counseling, friendly visiting, pet pals program, onsite activities for active seniors, and a day program for older adults with cognitive impairments, such as Alzheimer’s disease for seniors 60 and up. ','1068105398445743','https://www.scsny.org/programs/senior-programs',NULL,'info@scsny.org',NULL,'819444632829102,843777382088472,953560938102102,998681432266511',NULL,NULL,NULL,NULL,NULL,'845197766680330',NULL,NULL,NULL,'888813507140439',NULL,NULL,NULL),(68,672622115895527,'Adult Day Health Care Program-Amsterdam Nursing Home',NULL,1253597375994344,'From their website: For older adults who are able to live in the community. We operate seven days a week and provide many of the same services that are offered to residents of the facility; skilled nursing care, medication management, recreation, social services, and rehabilitation.  Open 7 days a week, 8:00 am to 3:30 pm. Round trip, door to door transportation is available (including to medical appointments). Each registrant has an individualized care plan tailored to his/her needs and abilities; a continental breakfast on arrival each day, a midday lunch, and snacks to take home. There are social group activities; day trips, arts and crafts, theater, movies, music, readings, exercise sessions, and holiday celebrations. Our registered nurses and social workers coordinate care with physicians and others in the registrant’s community. Medicaid and private payment are accepted. Some long-term managed care Medicaid programs are accepted (call for more details).','737319468834077','www.amsterdamcares.org',NULL,NULL,NULL,'1154569847221125',NULL,NULL,NULL,NULL,NULL,'1336263389473598',NULL,NULL,NULL,'1312897756863467',NULL,NULL,NULL),(69,680611870625074,'Elder Abuse Prevention Program',NULL,1241915161188721,'This program works with adults age 60 and older who are abused or at risk of abuse. The program provides information and referrals regarding home care, medical, financial, legal, housing counseling, advocacy, safety planning, and family interventions. \n\nPosted 11/19',NULL,'www.fsw.org/our-programs/older-adults/elder-abuse-prevention-program',NULL,'KTavzel@fsw.org',NULL,'1108954480265575',NULL,NULL,NULL,NULL,NULL,'1104840364163778',NULL,'1241012524106547',NULL,NULL,NULL,NULL,NULL),(70,687360327218312,'Yorkville Thrift Shop',NULL,921537895769274,'From their website: \"Accepts clothing, shoes, books, furniture, and household items: Furniture in excellent condition, Clean apparel (in plastic garbage bags only), Accessories / shoes (boxed or bagged), Antiques, Art, Decorative items, Clean housewares (properly packed in boxes only), Jewelry, Lighting, Unusual finds, Clean rugs (up to 6\' x 9\' with occasional exceptions), Up to 4 boxes of books (24\" x 24\" box max), pick-up available for furniture, drop-off other items.\"','1345175596183068','https://www.housingworks.org/locations/yorkville-thrift-shop-second-avenue-90th-street',NULL,NULL,NULL,'1084050103649570',NULL,NULL,NULL,NULL,NULL,'964162901091742',NULL,NULL,NULL,'860416992551277',NULL,NULL,NULL),(71,687581531346532,'Debra Lang',NULL,1127639898181861,'From Website: Our in-home care services brighten the lives of seniors who can benefit from a helping hand and a friendly smile. Our caregivers, who are seniors themselves, make your life easier by providing compassionate care in the comfort of your home. \n\nSeniors Helping Seniors provides a free assessment and home care at a minimum of four hours per week. Private pay and long-term care insurance are accepted. \n\nPosted 10/19',NULL,'https://seniorcarenorthwestchester.com/',NULL,'shs.debralang@gmail.com',NULL,'1201096778076050',NULL,NULL,NULL,NULL,NULL,'986608144259125',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(72,689161888016456,'Transitions',NULL,NULL,'Private geriatric care management and bereavement counseling. Telephone and skype consults available. \n\nPosted 11/19',NULL,NULL,NULL,'iddunner@yahoo.com',NULL,'922137071025167,1328687994347219',NULL,NULL,NULL,NULL,NULL,'1239283435098379',NULL,'956312446672331',NULL,NULL,NULL,NULL,NULL),(73,693767890986418,'Gatekeeper Program',NULL,1241915161188721,'The Gatekeeper Program was created to help recognize, identify, and refer older adults who may be experiencing or at risk of depression, anxiety, and other related symptoms. The Gatekeepers are trained individuals in the community who come into contact with older adults in the course of their everyday jobs or normal activities. These community members are often in a unique position to observe vulnerable seniors who may be experiencing difficulties that place them at risk of losing their ability to live independently in the community. \n\nPosted 11/19',NULL,'www.fsw.org/our-programs/older-adults/geriatric-mental-health',NULL,'tmonti@fsw.org',NULL,'738473770520078',NULL,NULL,NULL,NULL,NULL,'822957750254606',NULL,'1227845469229095',NULL,NULL,NULL,NULL,NULL),(74,631107323509361,'MedicAlert + Safe Return',NULL,1241984388362131,'ID bracelet or pendant worn by an individual with Alzheimer\'s or dementia with an 800 number (24-hour emergency response line) which will alert caregivers and first responders to their status so they can be returned home. Cost: $55.00 + $7.00 shipping and handling. Includes: member\'s ID jewelry with personalized information and MedicAlert + Safe Return\'s 24-hour emergency toll-free number, personalized emergency wallet card, 24-hour emergency response service, personal health record (PHR), six Steps to a safe return magnet. Optional cost of additional $35.00 for a caregiver ID jewelry and membership. An annual fee of $35.00 will be due after the first year for each membership. ','632726526556651','https://alz.org/help-support/caregiving/safety/medicalert-safe-return',NULL,NULL,NULL,'1253061813300180,1285075174713673,1106914314143204,633482549261197',NULL,NULL,NULL,NULL,NULL,'911637151400279',NULL,NULL,NULL,'669776241657471',NULL,NULL,NULL),(75,637748554756270,'Diana Morris',NULL,839838037990372,'Privatus provides private nursing services (HHAs and RNs) all managed by seasoned registered nurses and senior managers. Oversight performed by RNs every 10-14 days. Services also include a lifestyle concierge for personal preferences. \n\nPosted 10/19',NULL,'https://www.privatuscare.com/',NULL,NULL,NULL,'1201096778076050',NULL,NULL,NULL,NULL,NULL,'611794036812828',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(76,656294061151137,'Social Call Telephone Visits',NULL,769870125601660,'Sister program of Well Connected, has volunteers who will call you for a weekly phone visit. For seniors who are 60 and up.\nFrom their website: Covia matches volunteers with seniors on a one-to-one basis, bringing compassionate conversation and care into their lives and giving volunteers an opportunity to listen and learn. We are always looking for friendly, caring volunteers to provide support and friendship. All volunteers must pass a background check and attend an initial two-hour training program. ','1268584293664706','https://covia.org/services/social-call/',NULL,'coviaconnections@covia.org ',NULL,'1275784767796871,1177309407177568',NULL,NULL,NULL,NULL,NULL,'802059530473971',NULL,NULL,NULL,'1189960226230371',NULL,NULL,NULL),(77,651228078288406,'Visions',NULL,NULL,'Services are free of charge. An individualized plan is created to help each senior become or remain as independent as possible at home or in the community. There is a multi-lingual full-time staff and part-time interpreters. Serves all five boroughs and Long Island. Also at VCB in Rockland County and Selis Manor in Manhattan.','803133550044656','www.visionsvcb.org/visions/?',NULL,'info@visionsvcb.org',NULL,'1291763496785325',NULL,NULL,NULL,NULL,NULL,'937060355184632',NULL,NULL,NULL,'978154628865261',NULL,NULL,NULL),(78,653123413827330,'Sue Groppe',NULL,828378174895143,'From website: Geriatric Care Manager Sue Groppe provides individualized professional services to families dealing with the challenges of providing care to elderly loved ones, especially when it is over long distance. Geriatric Care Management is a service that helps to solve the problems of elderly people. We provide solutions to meet their needs while helping them maintain the highest quality of independence. \n\nPosted 10/19',NULL,'http://www.elderservicesny.com/',NULL,'ssgotr@aol.com',NULL,'922137071025167',NULL,NULL,NULL,NULL,NULL,'619327885634528',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(79,655418465654815,'Computer Tutors',NULL,1155578608136431,'\"For seniors who want to become computer– and web–savvy, DOROT volunteers visit at mutually convenient times to teach basic computer skills and Internet navigation. DOROT works with both seniors and volunteers to determine the number of sessions and duration of instruction.\" **As of June 2019, this program is on hiatus (see UWW for Connect Through Tech tech coaching program).** ','1216774939834028','www.dorotusa.org',NULL,NULL,NULL,'960167769062265',NULL,NULL,NULL,NULL,NULL,'1250724514805056',NULL,NULL,'942885369302412','967252529008278',NULL,NULL,NULL),(80,686979092099886,'Talking Books and Braille Library',NULL,995490616087586,'Eligible residents of New York State who have a visual impairment, are blind, have a physical condition that makes holding a book or turning pages difficult, and those with a medically diagnosed reading disability can receive a digital player, audio books, and braille materials for free. \n\nPosted 11/19',NULL,'nysl.nysed.gov/tbbl/apply.htm',NULL,NULL,NULL,'923317357274480',NULL,NULL,NULL,NULL,NULL,'1268212978789516',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(81,686404548025821,'The Hebrew Free Loan Society',NULL,NULL,'From their website: \"Fosters financial self-sufficiency and stability among New Yorkers in need through interest-free lending. HFLS loans make an immediate, concrete difference in the lives of our borrowers, enabling them to invest in their education, start a business, meet emergency expenses, and more. The General Needs Loan Program provides interest-free loans of up to $7,500 to low-and moderate-income residents of New York City’s five boroughs, Westchester, or Long Island to help fund significant expenses that borrowers cannot meet with their own resources or to help bridge a period of unexpected income loss. The Mitchell Lama Housing Loan Program provides interest-free loans of up to $30,000 to low-and moderate-income residents of New York City’s five boroughs, Westchester, or Long Island to help purchase a Mitchell Lama apartment.\"','783415982312320','https://hfls.org/ ',NULL,'info@hfls.org',NULL,'787387982275890',NULL,NULL,NULL,NULL,NULL,'826640378994389',NULL,NULL,NULL,'1111750812924657',NULL,NULL,NULL),(82,689865193459107,'Eden Gourmet',NULL,NULL,'\"Every order is delivered FREE of charge in Manhattan, regular items must be ordered at least 24 hours before the delivery time. Order online.\"','978016713074150','http://edengourmet.com',NULL,NULL,NULL,'576332581803815',NULL,NULL,NULL,NULL,NULL,'1240575896859266',NULL,NULL,NULL,'820248626400701',NULL,NULL,NULL),(83,709279716393862,'Senior Health House Call Program',NULL,842552767672147,'From their website: \"Provides an in-home comprehensive management, interdisciplinary team approach and individualized care to the citizens of lower and midtown Manhattan with chronic illnesses and disabilities that are unable to leave their homes. Comprehensive geriatrics care by a geriatrician or specially trained nurse practitioner (NP). Social workers help seniors find the right home care service, and also offer emotional support to them and their caregivers. Arrange for in-home lab and X-ray services if needed. Coordinate care with other specialists and community-based agencies. Help senior manage chronic illness, so seniors can remain in their own home. Also collaborate closely with hospital staff if hospitalized.\" For seniors 65+ who are homebound and live in lower and midtown Manhattan. Call for availability.','619456822619165','www.mountsinai.org/care/primary-care/upper-east-side/visiting-doctors/about',NULL,NULL,NULL,'640572958670163,1180772910179038',NULL,NULL,NULL,NULL,NULL,'1252569775727378',NULL,NULL,NULL,'796928679589803',NULL,NULL,NULL),(84,714839740464337,'The Pocketalker',NULL,894634253108236,'From their website: \"Personal amplifier that amplifies sounds closest to the listener while reducing background noise. Ideal for one-on-one conversation, small group and TV listening, or conversing in the car. This device does not support wireless headphones.\"','832698854090272','https://www.williamssound.com/pocketalker',NULL,'mikeh@williamssound.com',NULL,'673030812970350',NULL,NULL,NULL,NULL,NULL,'1013513531792745',NULL,NULL,NULL,'1014326083250530',NULL,NULL,NULL),(85,735156954970895,'DRIE Clinics',NULL,631176636895026,'Disability Rent Increase Exemption - (DRIE) Clinic\nDo you have a disability and need help with rent?\n-ARE YOU 18 YEARS OR OLDER?\n-ARE YOU RECEIVING DISABILITY-RELATED BENEFITS?\n-DO YOU PAY MORE THAN 1/3 OF YOUR INCOME TOWARDS RENT?\n-IS YOUR ANNUAL HOUSEHOLD INCOME $50,000 OR LESS?\nFIND OUT IF YOU ARE ELIGIBLE FOR DRIE, GET ASSISTANCE APPLYING OR RECERTIFYING; For an appointment or information, contact us.\nPlease let us know if you need a reasonable accommodation; necessary transportation will be provided.','763644124277369','http://www.lenoxhill.org/legaladvocacy/',NULL,'DRIE@lenoxhill.org',NULL,'629629464544122,1267306776036445',NULL,NULL,NULL,NULL,NULL,'1236564916232831',NULL,NULL,NULL,'885741754788620',NULL,NULL,NULL),(86,733865118416221,'Council Lifetime Learning Bereavement Groups',NULL,1072206441861633,'\"Our staff social worker leads two Bereavement Groups each week, helping members cope with the loss of a spouse or partner.\" ','771430514605072','https://www.ncjwny.org/programs/council-lifetime-learning/',NULL,'lmaun@ncjwny.org',NULL,'929538948830045',NULL,NULL,NULL,NULL,NULL,'1225044162087660',NULL,NULL,NULL,'610198700266791',NULL,NULL,NULL),(87,762152455924638,'The Clinton Street Center',NULL,1282345668813842,'Programs and services designed to meet the needs of Pleasantville Residents that are 55+. It also serves the general community by providing social and cultural events. Programs are open to residents of the Village of Pleasantville and the school district first. Those outside of the district are invited to sign up, as space permits. Open 8-4 Monday-Friday. \nPosted 11/19','1141829018188216',NULL,NULL,'clintonstreetcenter@gmail.com',NULL,'1235050525416771',NULL,NULL,NULL,NULL,NULL,'1213785911666900','1307528293680433',NULL,NULL,'810800049293357',NULL,NULL,NULL),(88,758462623549290,'Goddard Riverside Senior Center',NULL,NULL,'On-site classes, bingo, group trips, breakfast, lunch, Broadway shows, baseball games, movies, etc.; show ID for short intake process in person, pick up monthly schedules at center, printed at the end of each month.','880262766151810','https://www.goddard.org/grcc/programs/olderadults/seniorcenter/',NULL,NULL,NULL,'960167769062265,843777382088472,1275784767796871',NULL,NULL,NULL,NULL,NULL,'996322558778810',NULL,NULL,NULL,'842205390104753',NULL,NULL,NULL),(89,763837505075935,'Jennifer Fisher, JD, LCSW',NULL,NULL,'Licensed Psychotherapist\n\nPosted 10/19','1241247015802050',NULL,NULL,NULL,NULL,'1199809410500971',NULL,NULL,NULL,NULL,NULL,'1241471841642796',NULL,NULL,NULL,'1272414022943778',NULL,NULL,NULL),(90,760228367563909,'The Weinberg Center for Elder Justice',NULL,587450716406054,'Provides emergency short-term housing, healthcare services, legal advocacy, financial maintenance and support services to victims of elder abuse. \n\nPosted 11/19','1171697720000829','www.theweinbergcenter.org',NULL,NULL,NULL,'1108954480265575',NULL,NULL,NULL,NULL,NULL,'1227191966558194',NULL,NULL,NULL,'564197246632215',NULL,NULL,NULL),(91,761133936656133,'The ElderServe Mid-Westchester Caregiver Resource Center',NULL,587450716406054,'The ElderServe Mid-Westchester Caregiver Resource Center is a one-stop center and clearinghouse for information and assistance to family and other primary caregivers of older adults and cognitively imapired adults. \nPosted 10/19','1130440787220952','www.hebrewhome.org',NULL,NULL,NULL,'1124686729166068',NULL,NULL,'Voluntary Contributions Accepted',NULL,NULL,'976330731282878',NULL,NULL,NULL,'1235848317561433',NULL,NULL,NULL),(92,763001067287359,'Cash Assistance',NULL,1178157683868500,'\"Your family can get cash if you are in need. The funds come on a debit card that you can use at any ATM or store where EBT cards are accepted.\"','1283787695452830','https://access.nyc.gov/programs/cash-assistance/',NULL,NULL,NULL,'787387982275890',NULL,NULL,NULL,NULL,NULL,'961801456374491',NULL,NULL,NULL,'1014326083250530',NULL,NULL,NULL),(