1143','www.hearingloss.org',NULL,NULL,NULL,'673030812970350,1267306776036445',NULL,NULL,NULL,NULL,NULL,'767901142604976',NULL,NULL,NULL,'1261711915343750',NULL,NULL,NULL),(97,763257685902628,'SilverBills ',NULL,NULL,'From their website: \"SilverBills receives, scrutinizes and ensures that Clients’ bills are paid correctly for a monthly fee. Clients don’t have to open envelopes, write checks or remember due dates. Paper is not innocuous, it can be a portal to fraud and identity theft. SilverBills gets rid of much of clients’ paper, thereby reducing the risk of elder financial fraud.\" They are fully insured. Marci Lobel-Esrig, Founder and General Counsel, mlesrig@silver-bills.com.','780107450765673','www.SilverBills.com ',NULL,'info@silverbills.com',NULL,'787387982275890,933400397911972',NULL,NULL,NULL,NULL,NULL,'862821336657443',NULL,NULL,NULL,'1014326083250530',NULL,NULL,NULL),(98,776377442161009,'Housing Works Bookstore Café',NULL,921537895769274,'Accepts donations of books, DVDs, CDs, LPs, and textbooks (if less than 1 year old) in saleable condition (drop-off)','952762586518291','https://www.housingworks.org/locations/bookstore-café',NULL,NULL,NULL,'1084050103649570',NULL,NULL,NULL,NULL,NULL,'877466687815583',NULL,NULL,NULL,'935308653631088',NULL,NULL,NULL),(99,766270008358214,'Social Adult Day Program',NULL,968441302670944,'8:00-4:00 Monday-Friday\n\nPosted 11/19','1065735789974399','yorktownrnc.com/social-adult-daycare/',NULL,' tblake@YorktownRNC.com',NULL,'1235050525416771',NULL,NULL,NULL,NULL,NULL,'1207310081766080','1307528293680433','1266018287651374',NULL,'1233494811600237',NULL,NULL,NULL),(100,761295545053586,'City Opera Thrift Shop',NULL,NULL,'Accepts clothing, books, furniture, decorative household items, picks up any of these items--call to schedule.','955022736807648','https://cityoperathriftshop.org/donate',NULL,NULL,NULL,'1084050103649570',NULL,NULL,NULL,NULL,NULL,'753328702678770',NULL,NULL,NULL,'1232428131022731',NULL,NULL,NULL),(101,768191785227