bed guard rails, transfer chairs (with push handles), folding tray table, knee walkers, grab rails (under mattress bed assist). Shower grab bars are also available.','1175449155735773','http://www.hafop.org',NULL,NULL,NULL,'1084050103649570,650194788641739,1293277534665673',NULL,NULL,NULL,NULL,NULL,'1230242548959294',NULL,NULL,NULL,'1184688610639908',NULL,NULL,NULL),(105,799222185676078,'Early Stage Alzheimer\'s Service Program For Adults (SPA)',NULL,868849662691362,'Creative writing, Tai Chi, art therapy, dance, live music, movies, and field trips.','1272996147319363,629220063394155','http://steinseniorcenter.org/programs-activities/early-stage-alzheimers/',NULL,NULL,NULL,'1253061813300180,1106914314143204,1285075174713673',NULL,NULL,NULL,NULL,NULL,'1279873132126746',NULL,NULL,NULL,'1232334608351647',NULL,NULL,NULL),(106,807589648627302,'New York City Department for the Aging (DFTA) Elderly Crime Victims Resource Center',NULL,888043339536150,'Helps older victims of crimes committed by strangers. Crimes can be financial, physical, emotional, and include neglect. Call 311 and ask for Elderly Crime Victims Resource Center. Line is open Monday-Friday, 9:00 am-5:00 pm. Leave a message and an intake worker will call back between those hours. Only leave name and phone # on message, do not leave anonymous info. or client info. If calling after 5:00 pm, call Safe Horizon (212) 577-7777 (for victims of crime and abuse).','633936541136673','https://www1.nyc.gov/site/dfta/services/elder-abuse-crime.page',NULL,NULL,NULL,'1197693117142860',NULL,NULL,NULL,NULL,NULL,'754577397413411',NULL,NULL,NULL,'1070330298015311',NULL,NULL,NULL),(107,751818678480907,'The Osborn Pavilion',NULL,1171968806106258,'Short-term and outpatient rehabilitation, long-term skilled nursing, and respite care. \n\nPosted 11/19','647084504900802','www.theosborn.org/rehabilitation',NULL,NULL,NULL,'628102384928895,1132943173487126,1310065103612125',NULL,NULL,NULL,NULL,NULL,'1314102337082909',NULL,NULL,NULL,'821