es, and how to ace a video interview. In addition, they offer a Money Matters class on building smart financial habits and finding resources online. ','940898774412726','https://seniorplanet.org/',NULL,'info@seniorplanet.org',NULL,'960167769062265,910325259072395,787387982275890',NULL,NULL,NULL,NULL,NULL,'969499738136723',NULL,NULL,NULL,'911001286488147',NULL,NULL,NULL),(113,783217686810107,'Hearing Loss Association of America-NYC',NULL,598504858014663,'Monthly meetings with speakers, NYC Walk4Hearing.','815149666932571','http://www.hearinglossnyc.org/',NULL,NULL,NULL,'673030812970350',NULL,NULL,NULL,NULL,NULL,'915331038050681',NULL,NULL,NULL,'614294591109281',NULL,NULL,NULL),(114,815141339288557,'Synergy Homecare of Westchester',NULL,NULL,'Serving Scarsdale, Southern Westchester County including Hastings on Hudson, Irvington, White Plains, Yonkers, Bronxville, Pelham, Rye, Eastchester, Mamaroneck, and Port Chester for personal home care.\n\nPosted 10/19',NULL,'https://www.synergyhomecare.com/agencies/ny/westchester/ny02/',NULL,NULL,NULL,'1201096778076050',NULL,NULL,NULL,NULL,NULL,'902837054820179',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(115,780783198191970,'RideConnect',NULL,1241915161188721,'RideConnect, a not-for-profit program of Family Services of Westchester, is dedicated to finding the fastest and most cost-effective transportation options to meet the needs of older adults, age 60+, in southern Putnam and Westchester Counties.\n\nPosted 10/19',NULL,'http://www.rideconnectwestchester.org',NULL,NULL,NULL,'1233481324906768',NULL,NULL,NULL,NULL,NULL,'1188864233727423',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(116,786113104112475,'Tech Squad',NULL,829089648824054,'From their website: \"A group of neighbors willing and able to help other neighbors with minor household repairs or computer tasks. Because we cannot gauge the volume of requests in advance nor the availability of our Tech Squad volunteers, requests go into a queue. Members are informed whether a volunteer is available to assist. Must be a member to use services. Become a member by calling or filling out registration form online.\" Catchment area: West 96th Street to West 110th Street, between Riverside Drive and Central Park West.','615744816908233','https://www.bloominplace.org/tech-squad.html',NULL,NULL,NULL,'960167769062265,1123433776824532',NULL,NULL,NULL,NULL,NULL,'648118013105960',NULL,NULL,NULL,'777680203932503',NULL,NULL,NULL),(117,789873161692753,'Our Place: Social Senior Program',NULL,1092331194277980,'Social, recreational, and therapeutic programs for seniors who have memory challenges or need help with activities of daily living. 8:30-3:30 Monday-Friday, 9-3 Saturday.\n\nPosted 11/19','753960067774509','www.elderserve.org',NULL,NULL,NULL,'1235050525416771',NULL,NULL,NULL,NULL,NULL,'1100296496773948',NULL,NULL,NULL,'950563532685169',NULL,NULL,NULL),(118,792144907343354,'United Jewish Council of the East Side',NULL,NULL,'Emergency cash assistance','744556778024098','http://ujceastside.org/ujc-social-services',NULL,NULL,NULL,'787387982275890',NULL,NULL,NULL,NULL,NULL,'1120515367085831',NULL,NULL,NULL,'619641711895444',NULL,NULL,NULL),(119,797917139133962,'Bereavement Support Group',NULL,1155578608136431,'\"This group provides a safe, caring environment for those who have suffered the loss of a loved one and are seeking a supportive place to grieve and heal.\"','1173500557493659','http://www.dorotusa.org/site/PageServer?pagename=cc_pgms_D#supportgroups',NULL,NULL,NULL,'929538948830045,673898301722674,633482549261197',NULL,NULL,NULL,NULL,NULL,'1250724514805056',NULL,NULL,'942885369302412','967252529008278',NULL,NULL,NULL),(120,816183545164156,'Cancer Support Team',NULL,NULL,'From Website: \nThe Cancer Support Team (CST) is the only Westchester County-based nonprofit home care program, licensed by the New York State Department of Health, providing:\n\naccess to essential health care services,\nprofessional nursing,\nsocial work counseling,\ncase management and\nother supportive services\n*at not cost and without regard to insurance coverage to our patients and their families at any stage of the illness.\n\nPosted 10/19','769211386634985','https://cancersupportteam.org/',NULL,'cst@cancersupportteam.org',NULL,'1137936067119622',NULL,NULL,NULL,NULL,NULL,'926873586688783',NULL,NULL,NULL,'1263207055380559',NULL,NULL,NULL),(121,814555664343519,'Senior Citizen Transportation',NULL,1164758644753658,'From their website: \"Serves seniors who are 60 or over to help them stay mobile. Depending on a person’s needs, we offer individual car service or ambulette trips to medical and other essential appointments and services, group van shuttle trips to senior centers and group bus trips for educational events, recreation or shopping throughout Brooklyn.\"','589764166882320','www.jccgci.org/our-services/senior-support-systems/senior-transportation-services/',NULL,'SeniorTrips@JCCGCI.org',NULL,'977021400698839,822552305363624',NULL,NULL,NULL,NULL,NULL,'845594640130019',NULL,NULL,NULL,'1209500452547068',NULL,NULL,NULL),(122,783629217979560,'Project C.A.R.T. ',NULL,1307648044870350,'From their website: \"Van service for seniors 60+, provides free specialized transportation for the frail elderly. Operating in Manhattan, from the Battery to 96th Street on the East Side and to 110th Street on the West Side, five vans take seniors to and from medical appointments and hospitals, planned activities at senior centers and entitlements on which they depend. Also provides private car service for seniors who need special transportation within Manhattan (approved for emergencies as well as for medical, social service and entitlement appointments). Also available for visits to relatives and friends in hospitals or nursing homes. Five days a week 9 am-3:45 pm. $1 suggested contribution per ride. Call to register by phone (provide your contact information and emergency contacts).\"','577004616827857,625822848884476','http://www.nyfsc.org/support-services/free-transportation/',NULL,NULL,NULL,'977021400698839',NULL,NULL,NULL,NULL,NULL,'880508158969656',NULL,NULL,NULL,'793938145724771,793938145724771',NULL,NULL,NULL),(123,800471820431097,'Connect2',NULL,1164758644753658,'\"Offers companionship and support to Holocaust survivors living throughout New York City. Men and women volunteer to visit survivors in their homes for one hour each week. Volunteers and survivors are carefully matched to give young people an opportunity to connect with a unique part of our community and build strong and fulfilling friendships. In addition to critical socialization and providing assistance with shopping and personal organizing, the volunteers read to survivors, go with them for walks and accompany them to doctor visits.\"','947167576034432','http://www.connect2ny.org/',NULL,'connect2@jccgci.org',NULL,'1177309407177568,1296742648227889',NULL,NULL,NULL,NULL,NULL,'950695146945157',NULL,NULL,NULL,'1209500452547068',NULL,NULL,NULL),(124,803121982316975,'The Holocaust & Human Rights Education Center',NULL,NULL,'From Website: The Holocaust & Human Rights Education Center is a not-for-profit organization, serving Westchester, Fairfield and Putnam counties. Our Mission is to enhance the teaching and learning of the lessons of the Holocaust and the right of all people to be treated with dignity and respect. We encourage students to speak up and act against all forms of bigotry and prejudice.\n\nOur work with students and teachers helps schools fulfill the New York State mandate that the Holocaust and other human rights abuses be included in their curriculum.\n\nPosted 11/19',NULL,'www.hhrecny.org',NULL,'cadamsky@hhrecny.irg',NULL,'785637333880732',NULL,NULL,NULL,NULL,NULL,'936721181546390',NULL,'1258897424354832',NULL,NULL,NULL,NULL,NULL),(125,805928129246247,'Medicaid Managed Long Term Care',NULL,1254254495717377,'AgeWell New York is an NYS authorized Managed Long Term Care Plan. Program assists disabled persons and those with chronic illnesses with aging in place through care management and collaboration with nurses, care managers, physicians, social workers, and families. AgeWell New York covers many health-based services that are also covered by Medicare and Medicaid. \n\nPosted 11/19',NULL,'agewellnewyork.com',NULL,'info@agewellnewyork.com',NULL,'922137071025167,1186683016797740',NULL,NULL,NULL,NULL,NULL,'1167024101029999',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(126,806611374686342,'Volunteer Income Tax Assistance',NULL,958574525667165,'From their website: \"Offers free tax help to people who generally make $54,000 or less, persons with disabilities, the elderly and limited English speaking taxpayers who need assistance in preparing their own tax returns. IRS-certified volunteers provide free basic income tax return preparation with electronic filing to qualified individuals. No application is needed to use this service. For information on volunteering or for the locations of the tax assistance sites, visit the Free Tax Return Preparation for Qualifying Taxpayers page or call. To locate the nearest VITA or TCE site near you, use the VITA Locator Tool or call 800-906-9887.\"','1211830886378280','https://www.irs.gov/individuals/free-tax-return-preparation-for-you-by-volunteers',NULL,NULL,NULL,'681847053958180',NULL,NULL,NULL,NULL,NULL,'601442719869717',NULL,NULL,NULL,'1014326083250530',NULL,NULL,NULL),(127,809645889828379,'VNSNY Bereavement Services',NULL,830940502172759,'Bereavement support for general loss, loss of a sibling, loss of an adult child, spouse/partner loss, father/mother. Call for schedule and locations.    ','1040597194330657','www.vnsny.org/how-we-can-help/hospice-palliative-care/our-services/grief-support/ ',NULL,'bereavement@vnsny.org',NULL,'929538948830045',NULL,NULL,NULL,NULL,NULL,'611969863462756',NULL,NULL,NULL,'1014326083250530',NULL,NULL,NULL),(128,820254197138917,'Lenox Hill Neighborhood House Case Management',NULL,NULL,'From their website: Geriatric Care Management Program provides comprehensive care management services to frail and homebound older adults each year in Community Districts 6, 8 and 11, covering the East Side of Manhattan from 14th Street to 143rd Street including Roosevelt Island. Geriatric Care Clients must be sixty or older, frail and homebound.','763644124277369','http://www.lenoxhill.org/geriatriccare',NULL,NULL,NULL,'819444632829102',NULL,NULL,NULL,NULL,NULL,'994125565049238',NULL,NULL,NULL,'885741754788620',NULL,NULL,NULL),(129,821854627925796,'Hospice Care of Westchester & Putnam',NULL,745178886601124,'Hospice and coordinated services including hospital care, if needed. Emphasizes continuity of care 24 hours a day, 7 days a week. Palliative care and Healing Arts Program, which utilizes holistic therapies including massage, art, music, and pet therapies. Support for family members. \n\nPosted 11/19',NULL,'www.hospicewestchesterputnam.org/',NULL,'	Hospice@vnahv.org',NULL,'1203572911800812',NULL,NULL,NULL,NULL,NULL,'572671368765501',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(130,827129757848283,'Club 76',NULL,853324273796035,'Social programs, arts and cultural programs, exercise, inter-generational activities, computer literacy and training, health screenings, serve daily kosher and non-kosher meals in a group setting. ','750408677228991','https://www.jasa.org/community/senior-centers#.W3sXwc5KiUk',NULL,NULL,NULL,'843777382088472',NULL,NULL,NULL,NULL,NULL,'1280860605181152',NULL,NULL,NULL,'677112248303806',NULL,NULL,NULL),(131,833173105706695,'Shira Ruskay Center-Bereavement Support Groups',NULL,732679688850212,'From their website: We offer bereavement support groups that are individualized for specific types of loss, and for various Jewish cultural, spiritual, and religious needs. Our groups include participants with similar losses such as individuals who have lost spouses, parents, children, and other loved ones. We attempt to group participants of similar age.\nOur eight-week groups are co-lead by a Social Worker and a Rabbi, and are offered throughout the year. Currently, many of our groups are offered in partnership with the JCC of Manhattan and within individual synagogue congregations. Pre-registration is required and fees apply.\nTo Register for Loss of a Parent or Spouse/Partner, contact Amy Warren, LMSW, at 212.693.4608 or AWarren@jbfcs.org. For all other groups, contact Rabbi Simkha Y. Weintraub, LCSW, at 212.632.4770 or SWeintraub@jbfcs.org.','942646370393141','https://jewishboard.org/about-us/programs-services/jewish-community-services/shira-ruskay-center/',NULL,NULL,NULL,'929538948830045',NULL,NULL,NULL,NULL,NULL,'981464445231953',NULL,NULL,NULL,'873818423822151',NULL,NULL,NULL),(132,831872331141232,'Morningside House Adult Day Health Care Program',NULL,NULL,'Morningside ADHCP\'s mission is to provide a broad spectrum of quality health care services and recreational activities to meet the physiological and psychosocial needs of individuals residing in the community with Alzheimer\'s Disease, related dementias, or other medical or psychological conditions to actively support caregivers to maintain those individuals in the community.\n\nPosted 11/19','1277860615861557','disabled.westchestergov.com/morningside-house-adult-day-health-care',NULL,'lgoldman@cassenacare.com',NULL,'919422912164535,1235050525416771',NULL,NULL,NULL,NULL,NULL,'1252923046990137',NULL,'1237556806533681',NULL,'996824276197812',NULL,NULL,NULL),(133,835169005639738,'Visiting Neighbors-Friendly Visiting',NULL,NULL,'From their website: \"Seniors enjoy a few hours of company each week, offering both the senior and volunteer an opportunity to learn from one another. Each visit is as unique as the two individuals involved.\nSeniors and volunteers share memories and warm conversation; they may listen to music together, watch a favorite movie or enjoy a hobby or a game of cards. Volunteers benefit from learning about an older person\'s life experiences, and seniors enjoy an opportunity to share their views with younger generations and stay connected with the outside world..\" Catchment area: Manhattan, 30th Street and below, river to river.','1096140273343586','http://www.visitingneighbors.org/friendly-visiting.html',NULL,NULL,NULL,'1177309407177568',NULL,NULL,NULL,NULL,NULL,'1346910610541068',NULL,NULL,NULL,'587679286714670',NULL,NULL,NULL),(134,838136735980746,'Columbia College of Dental Medicine',NULL,615173006867945,'Low-cost/sliding scale dental services provided by dental students.','1248488370563350','https://www.dental.columbia.edu/teaching-clinics',NULL,NULL,NULL,'580054623534909,1216469255274749',NULL,NULL,NULL,NULL,NULL,'1267354643335992',NULL,NULL,NULL,'1186956512988855',NULL,NULL,NULL),(135,786750551644948,'Housing Assistance For Veterans',NULL,1117544787317199,'Through public housing authorities, HUD provides rental assistance vouchers for privately owned housing to Veterans who are eligible for VA health care services and are experiencing homelessness. VA case managers may connect these Veterans with support services such as health care, mental health treatment and substance use counseling to help them in their recovery process and with maintaining housing in the community. Among VA homeless continuum of care programs, HUD-VASH enrolls the largest number and largest percentage of Veterans who have experienced long-term or repeated homelessness.\nEnhanced-Use Lease (EUL) Program: VA portfolio management tool that allows certain land and buildings to be leased to eligible private entities for approved supportive housing and related projects for homeless and at-risk Veterans. In addition to supportive housing, VA’s EUL partners often provide Veterans with job training, financial management, haircuts, computer and laundry facilities, fitness centers and other services. Veterans and their families are prioritized for EUL developments, which are also convenient to VA health care facilities.\n\nPosted 11/19','1169437838038555','https://www.va.gov/homeless/housing.asp',NULL,NULL,NULL,'958412510535349,895685198543031',NULL,NULL,NULL,NULL,NULL,'807874318676098',NULL,NULL,NULL,'880683347691640',NULL,NULL,NULL),(136,801543440847300,'Free Counseling Services',NULL,1287292276383073,'From Website: Information, advocacy and support regarding end of life choices and options, the goal of which is to facilitate treatment decisions that reflect the wishes and values of the person living with the disease. \n\nPosted 11/19',NULL,'endoflifechoicesny.org/',NULL,'Judy@endoflifechoicesny.org',NULL,'772331273438770,586051722071435',NULL,NULL,NULL,NULL,NULL,'897823001843810',NULL,'554818269880807',NULL,NULL,NULL,NULL,NULL),(137,803657336823854,'Sara Meyers',NULL,1228270682605315,'This practice works with elderly clients, their adult children and even young families who want to plan now for the future.\n\nPosted 10/19','1113667269119421','https://www.esslawfirm.com/',NULL,'s.meyers@esslawfirm.com',NULL,'1113969124035608',NULL,NULL,NULL,NULL,NULL,'712099748834000',NULL,NULL,NULL,'1309110833366726',NULL,NULL,NULL),(138,808071962583933,'Caring Kind 24-Hour Helpline',NULL,1208496140131985,' Social workers provide in-depth, personalized consultations for individuals and families facing the decisions and challenges associated with Alzheimer’s disease and other dementias. Professional social work staff can assist with: developing a better understanding of the disease,\ncreating a plan to obtain necessary care, discussing options for symptom management, and addressing the emotional impact of the disease. Licensed social workers address each family’s unique concerns to develop a care plan. Social workers can meet by appointment, in person or phone.','1305801150608564','https://caringkindnyc.org/socialwork/',NULL,'helpline@caringkindnyc.org',NULL,'1253061813300180,1106914314143204,1285075174713673,919422912164535',NULL,NULL,NULL,NULL,NULL,'956534176099290',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(139,813002094637663,'Greenwich House Senior Centers',NULL,927555477423975,'Four senior centers: serve breakfast and lunch daily, offering activities such as: poetry and cinematography clubs, exercise classes (yoga and tai chi), language instruction, health lectures, painting and art classes, movies and card playing. Birthday celebrations, day trips to plays, museums, and more on a monthly basis. The staff can assist seniors in obtaining special services, benefits, entitlements, and referrals to remain independent. Call for eligibility and nearest location. ','729690724025147','http://www.greenwichhouse.org/senior_center/index',NULL,'info@greenwichhouse.org',NULL,'843777382088472,629629464544122,1288967124858351,1269324491810499,1129506065918594,972558970458700',NULL,NULL,NULL,NULL,NULL,'1153768366078322',NULL,NULL,NULL,'799349203133143',NULL,NULL,NULL),(140,813968980912237,'Project Open',NULL,1200076185644167,'From their website: \"Only open to residents of Lincoln Towers. One volunteer provides shopping and escorting services part-time Monday through Thursday 10:00-2:00. Advanced notice of a minimum of a few days is recommended.\" ','622566145353213','http://projectopenlincolntowers.org/',NULL,NULL,NULL,'1119801442928622',NULL,NULL,NULL,NULL,NULL,'816825377286965',NULL,NULL,NULL,'949177819591275',NULL,NULL,NULL),(141,814628585636972,'Project Find',NULL,1256781452151189,'Walk-in free tax preparation help (call for days/times).','857604383584946','http://www.projectfind.org/hamilton_center',NULL,NULL,NULL,'681847053958180',NULL,NULL,NULL,NULL,NULL,'657614518850362,896224978655811',NULL,NULL,NULL,'1133652270139560',NULL,NULL,NULL),(142,834997235274681,'Sprint CapTel',NULL,764107790762439,'No cost for phone or service. Requires hearing loss, internet access, and third party Certification Form signed by a doctor or an audiologist. Enables you to follow live captions of your phone calls. Includes choice of four phones, one-touch 24-hour support, no-cost installation and training. Your own phone can also be paired with Sprint Web CapTel on an iPad. Some phone models work without internet. Contact Ladi Dell\'aira at (347) 981-1195 or ladi.dellaira@sprint.com or call the number below. ',NULL,'www.sprintcaptel.com',NULL,'ladi.dellaira@sprint.com',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1264568756524478',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(143,839035051126265,'Sage Friendly Visiting Program',NULL,976650048750374,'\"Helps alleviate isolation and reconnect LGBT elders to their communities across generations; client is assigned a Sage care manager who makes a home visit to assess their needs, including the Friendly Visiting program. If interested and appropriate, they are assigned a Friendly Visiting volunteer. Commit to spend at least one year visiting a friend at home once a week. SAGE clients are LGBT and over 60 (over 50 if they are transgender, a veteran, or living with HIV).\" All boroughs except Staten Island. ','1316417580209628','www.sageusa.org/friendlyvisitorprogram',NULL,NULL,NULL,'1177309407177568',NULL,NULL,NULL,NULL,NULL,'1195213276477954',NULL,NULL,NULL,'817545979807110',NULL,NULL,NULL),(144,845567306190161,'SeniorTech NYC',NULL,1146700479099819,'From their website: \"Teaching those over 50 how to ease into the world of technology, multi-media devices and computers. Register online or on the phone. Classes are held in the Multimedia Room on Level L2 at the JCC unless otherwise specified. All registration is on a first-come, first-served basis. JCC members receive a discount.\" Most classes  are one-day sessions and cost $15-$25.00. ','1177679790414542','https://jccmanhattan.org/programs/seniortech-nyc-one-one-all-devices-1?utm_source=60Plus&utm_medium=11-5-19&utm_campaign=SeniorTechF20',NULL,NULL,NULL,'960167769062265',NULL,NULL,NULL,NULL,NULL,'1160773174257797',NULL,NULL,NULL,'1243406984924490',NULL,NULL,NULL),(145,844787566619180,'Cancer Care',NULL,NULL,'Counseling, support groups, financial assistance.','621582833381488','www.cancercare.org',NULL,'info@cancercare.org      ',NULL,'1231611168158959,1216469255274749,673898301722674',NULL,NULL,NULL,NULL,NULL,'1223749553554182',NULL,NULL,NULL,'803731885874261',NULL,NULL,NULL),(146,786246710888918,'Access to Home',NULL,884372073704271,'WRO works with property owners, both Landlords and Homeowners, to approve proposed work and then contracts with local firms to make substantial home improvements, such as: widening doorways; lowering kitchen cabinets; bathroom modifications; upgrading exterior ramps; lifts and much more – usually at no cost to the consumer, homeowner or landlord.\n\nPosted 10/19',NULL,'https://wroinc.org/access-to-home/',NULL,NULL,NULL,'1240800274587016',NULL,NULL,NULL,NULL,NULL,'945560811308898',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(147,793584986026305,'The Met Council on Jewish Poverty',NULL,NULL,'Benefits access, crisis intervention, family violence services, kosher food, and housing. ','1163757931820150','www.metcouncil.org',NULL,NULL,NULL,'787387982275890,629629464544122,935600275247423,958412510535349',NULL,NULL,NULL,NULL,NULL,'584891762920584',NULL,NULL,NULL,'787498608599908',NULL,NULL,NULL),(148,809833810832330,'Partners in Care',NULL,1003331694487671,'-Personal care and companionship\n-Ambulatory escort service\n-Bathing & dressing service\n-Skilled nursing care\n-Assessment for nursing home eligibility\n-Professional therapy sessions\n-Geriatric care management\n\nPosted 10/19',NULL,'https://www.vnsny.org/how-we-can-help/private-care-services/get-started/',NULL,'clientservices@partnersincareny.org',NULL,'1201096778076050,922137071025167',NULL,NULL,'Private Pay',NULL,NULL,'1051049970920470',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(149,808320620804004,'NAC Kinship Care Program',NULL,1081479148020063,'Services for grandparents caring for grandchildren, serves all five boroughs. From their website: \"The Kinship Care Program at New Alternatives for Children (NAC) will provide a variety of services to kinship and “fictive” kin caregivers in the community. The services provided by the Kinship Care Program includes parent education trainings, support groups and case management services. Case management services consist of education advocacy including navigating the special education system, referrals to community resources, such as mental health services, recreation for children, housing and legal services, as well as advocacy and support with government entitlements. NAC’s Kinship Care Program is open to all kin and fictive kin families and also specializes in serving families who have children with complex medical and behavioral health needs.\"\n','1130155646966999','www.NacKidsCan.org',NULL,' info@NacKidsCan.org',NULL,'1027679554610765,673898301722674,819444632829102',NULL,NULL,NULL,NULL,NULL,'1172499759353138',NULL,NULL,NULL,'936791592940795',NULL,NULL,NULL),(150,813545461828458,'New York State Commission for the Blind-Adaptive Living Program',NULL,NULL,'For people 55+ who are retired: they provide in-home training through their Adaptive Living Program. The program is designed to help the person maintain their independence and part of the training includes technology and smart phones. The senior sets up personal goals with their assigned counselor and when all the goals are met the case is closed. There’s an application process in which the person needs to have proof that they are legally blind (from an eye care professional) and proof of residency. The application is reviewed by a counselor and then the senior is referred to an agency in their area for the program. There is no charge for the program. The application can be done over the phone or if the person has someone who can help them fill out a printed application, it can be mailed in.  ','874799716619737','https://www.nyconnects.ny.gov/providers/new-york-state-commission-for-the-blind-sofanya439266',NULL,NULL,NULL,'1291763496785325',NULL,NULL,NULL,NULL,NULL,'1109679420426078',NULL,NULL,NULL,'1177956880600649',NULL,NULL,NULL),(151,825808899464815,'Sage Vets',NULL,899781732400941,'Helps LGBT older adults who are military service veterans improve their access to VA benefits and their overall health and wellness.','1338832488116650','https://sagenyc.org/nyc/sagevets/index.cfm',NULL,'info@sageusa.org',NULL,'629629464544122,895685198543031',NULL,NULL,NULL,NULL,NULL,'1205876766003709',NULL,NULL,NULL,'817545979807110',NULL,NULL,NULL),(152,839041795104725,'Our Place Memory Cafe',NULL,631643234627759,'The Our Place Memory Café welcomes people and their loved ones into a secure, comfortable, and socially engaging venue (at a local restaurant) where they not only experience an afternoon of fun and entertainment, but also patience, understanding and true camaraderie with friends who are going through the same.  \n\nPeople living with a diagnosis of Dementia or Alzheimer’s disease continue benefitting from seeking and keeping positive social connections. It is also equally important for people caring for a loved one with this diagnosis to have a place where they, too, can relax, socialize, share thoughts, emotions, and find answers to key questions.\n\nPosted 10/19','916691190313105','https://thebristal.com/memory-cafe/',NULL,NULL,NULL,'919422912164535',NULL,NULL,NULL,NULL,NULL,'1051828280520270',NULL,NULL,NULL,'879045899869115',NULL,NULL,NULL),(153,842676171982190,'Gilda\'s Club Westchester',NULL,NULL,'Gilda’s Club Westchester creates communities of emotional and social support for everyone living with cancer – women, men, teens, children and their families, providing support groups, educational lectures, healthy lifestyle workshops and social activities.\n\nPosted 10/19','844830529630228','www.gildasclubwestchester.org ',NULL,'info@gildasclubwestchester.org',NULL,'1137936067119622',NULL,NULL,NULL,NULL,NULL,'947850375157471',NULL,NULL,NULL,'886798014604168',NULL,NULL,NULL),(154,848912028258230,'New York Foundation for Senior Citizens Case Management',NULL,1307648044870350,'They help coordinate home care, home delivered meals and other services for physically and mentally frail residents in Manhattan Districts 1 (TriBeCa, Financial District, Manhattan Civic Center, Battery Park City, South Street Seaport, Battery Park, City Hall Park), 2 (Greenwich Village-West Village, South Village, Washington Square Park, NoHo, SoHo, Little Italy), 3 (Lower East Side, East Village, Alphabet City, Chinatown, Two Bridges), 5 (Times Square, Herald Square, Midtown South, Murray Hill, Gramercy, Union Square), and 6 (Murray Hill, Sutton Place, Beekman Place, Turtle Bay, Tudor City, Gramercy, Kips Bay, Peter Cooper, Stuyvesant Park, Stuyvesant Town). Working to help seniors remain safe, healthy and independent within their own homes, Case Managers meet with seniors at home to determine their eligibility for services, and then arrange and monitor the delivery of services. There is no fee to the seniors who benefit from this program. Funded by DFTA.','1257554801869010','http://www.nyfsc.org/support-services/case-management-program/',NULL,'nyfscinc@aol.com',NULL,'819444632829102',NULL,NULL,NULL,NULL,NULL,'912048857089820',NULL,NULL,NULL,'1278869071563581',NULL,NULL,NULL),(155,854268032556366,'Day/Evening Programs for Memory Impaired Seniors',NULL,830984038249926,'The Day program runs from 9:30 am to 2:30 pm, Monday through Saturday. The Evening program is offered from 2:30 pm to 7:00 pm, Monday through Friday. Six days a week in Manhattan and The Bronx, five days a week in Westchester. The program accepts most insurances, Medicaid (no long term care insurance). Certified Nursing Assistants supervise programs and meals are provided. ','567966904697916,659247073455935','https://jewishhome.org/our-services/adult-day-health-care-2/',NULL,NULL,NULL,'1253061813300180,1106914314143204,1285075174713673,1154569847221125',NULL,NULL,NULL,NULL,NULL,'1102169065786107,1281373473332406,1314931962793811',NULL,NULL,NULL,'1239836356019216,888413272201820',NULL,NULL,NULL),(156,817346061176747,'Philips Lifeline',NULL,NULL,'Philips Lifeline is a medical alert system that lets you summon help any time of the day or night – even if you can’t speak. All you have to do is press your medical alert button, worn on a wristband or pendant, and a trained Personal Response Associate will respond.\n\nPosted 10/19',NULL,'https://www.lifeline.philips.com/medical-alert-systems.html',NULL,NULL,NULL,'1240800274587016',NULL,NULL,NULL,NULL,NULL,'1268088565823182',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(157,828508206192424,'High Holidays & Passover Food Drive',NULL,637831597874251,'Donate nonperishable, kosher foods to make sure no one in our city goes hungry during the High Holidays and Passover. Check in August for information for High Holidays (and in March for Passover) about how to start your own drive! Accepts Kosher nonperishable food.','732672739823207','https://www.cityharvest.org/programs/food-drives/',NULL,NULL,NULL,'1084050103649570,886323941641619',NULL,NULL,NULL,NULL,NULL,'624332088773277',NULL,NULL,NULL,'655678559189627',NULL,NULL,NULL),(158,830083928640563,'Cemetery Visit Program-DOROT',NULL,1155578608136431,'This program makes it possible for seniors to visit the gravesites of loved ones in cemeteries in the New York Metropolitan area. Volunteer escorts accompany seniors from their home via transportation provided by DOROT, offering emotional support and an arm to lean on. Cemetery Visits takes place in July.','1216774939834028','www.dorotusa.org',NULL,NULL,NULL,'1137942925140598',NULL,NULL,NULL,NULL,NULL,'1250724514805056',NULL,NULL,'942885369302412','967252529008278',NULL,NULL,NULL),(159,828464467898217,'CityMeals on Wheels',NULL,1107730117300308,'Home delivered meals to seniors through DFTA case management. Go to www.citymeals.org and enter senior\'s zip code to locate the agency providing meals in their area. ','1070671977502200','www.citymeals.org',NULL,NULL,NULL,'935600275247423',NULL,NULL,NULL,NULL,NULL,'950658606353519',NULL,NULL,NULL,'641740785001896',NULL,NULL,NULL),(160,834267841586701,'Victims Assistance Services of Westchester',NULL,1246973128987993,'Provides free, comprehensive services to crime victims and their families, friends and loved ones. VAS also works to end violence through community action, public policy and cultural change and through prevention education programs in schools and in other community venues.\n\nPosted 11/19','1226464607865465','disabled.westchestergov.com/victims-assistance-services',NULL,'kamaranth@westcop.org',NULL,'1108954480265575',NULL,NULL,NULL,NULL,NULL,'642116599797065',NULL,NULL,NULL,'617254531776026',NULL,NULL,NULL),(161,845446338886287,'Lean on We',NULL,NULL,'From website: LeanOnWe helps you take control of the home care that your loved ones need. We\'ll search our database of...home health aides to identify suitable candidates.\n\nPosted 10/19',NULL,'https://leanonwe.com',NULL,NULL,NULL,'1201096778076050',NULL,NULL,NULL,NULL,NULL,'1230084338755670',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(162,848237456004811,'Westchester Jewish Community Services',NULL,NULL,'From Website: Westchester Jewish Community Services (WJCS) is one of the largest human service agencies in Westchester, providing care to people of all ages and diverse backgrounds who are confronting significant challenges. Agency experts provide mental health, trauma, disabilities, youth, home care and geriatric services. \n\nPosted 11/19','833718283035993','wjcs.com',NULL,'jfink@wjcs.com',NULL,'772331273438770',NULL,NULL,NULL,NULL,NULL,'1174415294724197',NULL,'749497155903201',NULL,'1300165556123162',NULL,NULL,NULL),(163,852121578825112,'IMpact Life Transition Advocates',NULL,NULL,'From their website: \"After an initial consultation, provides assistance with ​document organization, insurance claims, personal advocacy, and referrals to resources such as: financial advisers, elder care attorneys, home care, senior move Managers, etc.\" Ilene Mandell, Founder.','851979068030014','https://impactadvocates.com/',NULL,'ilene@impactadvocates.com',NULL,'941628219469820,933400397911972',NULL,NULL,NULL,NULL,NULL,'811492344649790',NULL,NULL,NULL,'1014326083250530',NULL,NULL,NULL),(164,861706540234318,'Elder Abuse Hotline',NULL,1258591661158200,'\"In an emergency, call 911; if you are a senior who has been the victim of a crime, or you know a senior citizen who has been abused or exploited, please call our Elder Abuse Unit; we can also provide assistance in obtaining an Order of Protection and emergency housing, and social service referrals to agencies that provide a variety of services to seniors.\" ','1134609514400087','https://www.manhattanda.org/victim-resources/elder-abuse/',NULL,NULL,NULL,'1197693117142860',NULL,NULL,NULL,NULL,NULL,'1242908803212971',NULL,NULL,NULL,'666830332951387',NULL,NULL,NULL),(165,858462936010255,'Well Connected Telephone & Online Classes',NULL,769870125601660,'Educational classes, support groups, and social call programs for isolated seniors. Programs are free, in pacific time zone. Classes meet 365 days a year by phone or online. Audio and Braille catalogs are also available to low-vision and blind participants. For seniors who are 60 and up.\nFrom their website: Well Connected members call in via a toll-free number at a set time each week, with some groups also offering the option to connect via computer, tablet, or mobile device. Most groups last 30 minutes to an hour with around 12 participants. Newcomers are always welcome! If you don’t feel like talking at first, you’re welcome to just listen as long as you’ve let the group know you’re there. ','1268584293664706','https://covia.org/services/well-connected/',NULL,'coviaconnections@covia.org',NULL,'972558970458700,1275784767796871,1291763496785325',NULL,NULL,NULL,NULL,NULL,'802059530473971',NULL,NULL,NULL,'1189960226230371',NULL,NULL,NULL),(166,862654161460450,'Jessica Seidel, LCSW',NULL,NULL,'Clinical Social Worker\n\nPosted 10/19','1170339860879903',NULL,NULL,NULL,NULL,'1199809410500971',NULL,NULL,NULL,NULL,NULL,'659907342549387',NULL,NULL,NULL,'1112806517520855',NULL,NULL,NULL),(167,865894552867786,'Sharsheret',NULL,NULL,'From Website: Sharsheret, a national non-profit organization, improves the lives of Jewish women and families living with or at increased genetic risk for breast or ovarian cancer through personalized support and saves lives through educational outreach.\nWhile our expertise is in young women and Jewish families as related to breast cancer and ovarian cancer, Sharsheret programs serve all women and men.\n\nPosted 10/19',NULL,'www.sharsheret.org',NULL,'info@sharsheret.org',NULL,'1137936067119622',NULL,NULL,NULL,NULL,NULL,'1237264706067326',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(168,810802445373575,'Jeanne Ferrando, LCSW-R',NULL,NULL,'Clinical Social Worker/Therapist. Also has a private practice in Tarrytown. Fees are based on a sliding scale. Her specialty is both adult and geriatric psychology. Nights and weekends only.\n\nPosted 10/19','1333587616477868','https://hudson-counseling.com/',NULL,'Jeanne.ferrando@hudson-counseling.com ',NULL,'1199809410500971',NULL,NULL,NULL,NULL,NULL,'898957707307790',NULL,NULL,NULL,'1292021090795585',NULL,NULL,NULL),(169,809778320036767,'Hudson Guild Friendly Visiting',NULL,895690887235428,'From their website: \"Serving those who live, work, or go to school in Chelsea, with a focus on those in need, adult services for older adults age 55+,  staff speaks many languages including Spanish, Cantonese and Mandarin in addition to English. Must be a member of Penn South or live at the Hudson Guild NORC, Elliott-Chelsea Houses. Call for intake over the phone or in person.\"','609269880961062','https://hudsonguild.org/programs/adult-services/',NULL,NULL,NULL,'1177309407177568',NULL,NULL,NULL,NULL,NULL,'1307839956187600',NULL,NULL,NULL,'657516659707090',NULL,NULL,NULL),(170,821085555383435,'R.A.I.N. Inc. Social Services',NULL,560304497188344,'From their website: \"A multi-social service agency offering a myriad of services with a focus on the provision of continuum of care that includes a range of services for seniors and people with disabilities.  R.A.I.N. has eleven Bronx based and one Manhattan based full-service neighborhood senior centers, friendly visiting, home-delivered meals to homebound elderly, transportation services, assistance with benefits and entitlements, case management and elder abuse services, and Cucina Dolores, a community-based mobile meals program for homeless and hungry persons in the South Bronx in collaboration with the Bob and Dolores Hope Foundation. R.A.I.N.’s commitment to the elderly also includes the sponsorship of two residential housing projects providing apartments for low-income seniors. R.A.I.N.’s affiliated Home Health Care Program provides in-home attendant and personal care services for elderly, disabled and homebound individuals of any age. Serves community districts 7-12.\"','854279759198922','https://www.raininc.org',NULL,'info@raininc.org',NULL,'652340976007902,1177309407177568,629629464544122,935600275247423,977021400698839,819444632829102',NULL,NULL,NULL,NULL,NULL,'1086288440536851',NULL,NULL,NULL,'849097901514110',NULL,NULL,NULL),(171,823434668840279,'Thrive Clinic',NULL,853324273796035,'New York State-licensed outpatient mental health clinic and limited in-home services, with 3 satellite clinics in the Bronx.','1274482613493911','https://www.jasa.org/community/mental-health-services#.W3W3k85KiUk',NULL,NULL,NULL,'1112870426305700,652340976007902',NULL,NULL,NULL,NULL,NULL,'974407073614147',NULL,NULL,NULL,'1292276975840090',NULL,NULL,NULL),(172,829938013295002,'Family Services of Westchester',NULL,NULL,' FSW offers a comprehensive Home Health Care service that can provide licensed, professional home health aides and personal care aides to help you care for your loved one right at home.\n\nPosted 10/19',NULL,'http://www.fsw.org/our-programs/older-adults/home-health-care',NULL,NULL,NULL,'1201096778076050',NULL,NULL,NULL,NULL,NULL,'598573933983589',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(173,830892968617019,'Council Lifetime Learning Caregiver Support Group',NULL,1072206441861633,'\"Weekly Caregivers Support Group for people caring for a loved one with Alzheimer’s Disease.\"','771430514605072','https://www.ncjwny.org/programs/council-lifetime-learning/',NULL,'lmaun@ncjwny.org',NULL,'673898301722674,1285075174713673,1253061813300180,1106914314143204',NULL,NULL,NULL,NULL,NULL,'1225044162087660',NULL,NULL,NULL,'610198700266791',NULL,NULL,NULL),(174,838227456919055,'Westchester Center for Independent and Assisted Living',NULL,NULL,'Assisted and independent living that accepts Medicare and Medicaid through the Assisted Living Program (ALP). Offers assistance with personal care as well as housekeeping services and recreation programs. \n\nPosted 11/19','607223389485489','thewcenter.com/',NULL,'info@thewcenter.com',NULL,'584503804670909,1320205185937576',NULL,NULL,NULL,NULL,NULL,'1179844316470429',NULL,NULL,NULL,'1170917492531507',NULL,NULL,NULL),(175,842067572521549,'Helpline for Concerned Persons',NULL,811119813567298,'From their website: \"A NON-EMERGENCY service providing information and support between 9:00 AM to 5:00 PM, Monday through Friday. Calls received evenings, weekends, &  holidays will be responded to the next business day. Not for reporting abuse, a free and confidential Service for concerned persons in the lives of elder abuse victims.\" ','840504953667916','https://nyceac.org/wp-content/uploads/2018/04/HelplineBrochure.pdf',NULL,'helpline@nyceac.org',NULL,'1197693117142860',NULL,NULL,NULL,NULL,NULL,'1214828984391668',NULL,NULL,NULL,'1014326083250530',NULL,NULL,NULL),(176,848527393701365,'Food Bank of New York City-Food Pantries',NULL,NULL,'Online directory of food pantries in the five boroughs, including kosher pantries. ','678360757827925','www.foodbanknyc.org',NULL,NULL,NULL,'886323941641619',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'615069551064872',NULL,NULL,NULL),(177,847906038498802,'William Fishman',NULL,746661164277065,'Posted 10/19','936673543248579',NULL,NULL,'lwf@fishmanlaw.net',NULL,'1113969124035608',NULL,NULL,NULL,NULL,NULL,'780619111940563',NULL,NULL,NULL,'1114854672558577',NULL,NULL,NULL),(178,858972685334988,'HealthFirst Medicare Advantage Plans',NULL,577771041818158,'\"Call 7 days a week, 8am-8pm; Whether you’re new to Medicare or you’re looking to switch health insurance, Healthfirst has a Medicare plan that works for your needs and budget. Our Member Services offers help in six spoken languages other than English, and in many more through telephone language-line services. Plus, we have many community offices conveniently located throughout New York City and on Long Island.\"','830401734081510','https://hfchoice.org/medicare/#btn-touch',NULL,NULL,NULL,'629629464544122',NULL,NULL,NULL,NULL,NULL,'972952959410369',NULL,NULL,NULL,'1014326083250530',NULL,NULL,NULL),(179,854422189078687,'Days of Awe Cemetery Visits',NULL,1146700479099819,'JCC is partnered with Plaza Jewish Community Chapel for the cemetery visit programs. The registration lottery for the Days of Awe Cemetery Visits will be open from July 10-12, 2019 to the Bronx, Long Island, and Queens. 2019\'s visits will take place on Tuesday, September 17 (Cedar Park and Riverside cemeteries) and Wednesday, September 18 (Wellwood, Beth Moses, New Montefiore, Mt. Ararat, Beth David, Mt. Hebron, Mt. Carmel, and Old Montefiore cemeteries). There is no charge to join the lottery. Limited spots available, cannot guarantee seats for each person who enters the lottery. Those selected to participate will be notified the week of July 15. After the lottery, there will be a fee of $10/person to register for the trip itself. Please note that participants must choose one day and one cemetery to visit. A representative from the JCC or from Plaza Jewish Community Chapel will reach out to each participant to assist in locating their loved ones\' plots. This program will occur rain or shine. A light breakfast will be served at Plaza Jewish Community Chapel (630 Amsterdam Ave.) at 9:30 am before transportation departs at 10 am. Seniors can come with walkers, if they have a wheelchair, they must be able to transfer on their own and fold it up on their own. Rachel Kunstadt, 646-505-4441.  ','1177679790414542','www.jccmanhattan.org',NULL,'info@jccmanhattan.org',NULL,'1137942925140598',NULL,NULL,NULL,NULL,NULL,'1106419651246052',NULL,NULL,NULL,'1243406984924490',NULL,NULL,NULL),(180,862575154222992,'Alzheimer\'s Association: Resources, Services, and Support Groups',NULL,844219266774339,'The Alzheimer\'s Association works on a national and local level to provide care and support for all those affected by Alzheimer\'s and other dementias.\n\nPosted 10/19',NULL,'http://www.alzhudsonvalley.org/',NULL,NULL,NULL,'919422912164535',NULL,NULL,NULL,NULL,NULL,'618220623576323',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(181,863672493530958,'Hazel Brooks Center',NULL,607099693381586,'Neighborhood senior center ','841504896480839','http://www.fortgreenecouncil.org/neighbrhood-senior-centers',NULL,NULL,NULL,'822552305363624',NULL,NULL,NULL,NULL,NULL,'1266964813801992',NULL,NULL,NULL,'1183007633221357',NULL,NULL,NULL),(182,871902517142754,'Pathways to Care',NULL,1272098259280185,'Care consultations for Alzheimer’s disease and other related dementias; counseling for those with chronic or life-threatening illnesses. WJCS conducts home visits, provides referrals, coordinates advance care planning, and provides support for families of individuals with dementia. \n\nPosted 10/19',NULL,'http://www.wjcs.com/pathways-to-care/',NULL,'grittmaster@wjcs.com; jslevin@wjcs.com',NULL,'919422912164535,1137936067119622,1328687994347219',NULL,NULL,NULL,NULL,NULL,'1216419122237716',NULL,'777188893833870,1100115401983858',NULL,NULL,NULL,NULL,NULL),(183,870549482319292,'Right at Home: Central & Southern Westchester',NULL,1311930101135354,'Right at Home Westchester offers senior care services in the comfort and familiarity of wherever you and your loved one call home. Our team tailors our care to your unique situation through a Custom Care Plan. Individualized elder care programs change as our clients\' needs change.\n\nPosted 10/19',NULL,'http://westchesterseniorcare.com',NULL,NULL,NULL,'1201096778076050',NULL,NULL,NULL,NULL,NULL,'823875868957775',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(184,818921725628108,'Laguardia Senior Center',NULL,1307648044870350,'Meals and recreational activities.','1153448267806398','http://www.nyfsc.org/support-services/senior-centers/',NULL,NULL,NULL,'843777382088472',NULL,NULL,NULL,NULL,NULL,'748489010291667',NULL,NULL,NULL,'966511392177931',NULL,NULL,NULL),(185,826716133826730,'Elder Care Consulting, Inc. ',NULL,NULL,'Elder Care\'s approach focuses on assisting families with every aspect of care. Specialists consistently assess the health and care of each patient on a weekly basis.\n\nPosted 10/19',NULL,' http://www.eldercarehomecare.com',NULL,NULL,NULL,'1201096778076050',NULL,NULL,NULL,NULL,NULL,'648891047224307',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(186,842111052807343,'Search & Care Notary Public Service',NULL,1072887075663062,'Public notary service for adults 60+. For a $2.00 fee, you can have all your documents that require having your signature witnessed and notarized at Search and Care the first Friday of the month from 9:30 am-1:30 pm. Call to inquire and/or schedule your appointment.','928811788301846','https://www.searchandcare.org/',NULL,'SandC@searchandcare.org',NULL,'1107228321502442',NULL,NULL,NULL,NULL,NULL,'880934289187573',NULL,NULL,NULL,'841739048661639',NULL,NULL,NULL),(187,842903780067828,'Cedar Manor Nursing and Rehabilitation Center',NULL,NULL,'Situated on the Hudson River, Cedar Manor offers rehabilitative services seven days a week, respite stay, and extensive therapeutic recreation programming. \n\nPosted 11/19','1092066899023795','www.cedarmanornursing.com',NULL,'frontdesk@cedarmanornursing.com',NULL,'628102384928895,1310065103612125',NULL,NULL,NULL,NULL,NULL,'562944067349489',NULL,NULL,NULL,'867686547795691',NULL,NULL,NULL),(188,840305636609227,'Andrew\'s Fund',NULL,954473100289340,'ONLY FOR CARTER BURDEN CLIENTS; From their website: \"The Carter Burden Network\'s Andrew Fund was created in 1994 by an anonymous CBN Board Member in honor of her late, beloved Yorkie named Andrew. The Andrew Fund provides assistance to New York seniors who need help caring for their pets by offering one-time or short-term assistance with boarding, veterinary bills, food, spay-neuter, and more.\"','826546256872035','http://www.carterburdennetwork.org/socialserviceunit',NULL,NULL,NULL,'998681432266511',NULL,NULL,NULL,NULL,NULL,'727566126369922',NULL,NULL,NULL,'1237415961455811',NULL,NULL,NULL),(189,840889870738001,'SAGE Long Island',NULL,1249534913976545,'From their website: \"Serving GLBT older adults (age 50+), SAGE-LI provides social and recreational programming; health and wellness events; educational programs; advocacy; supportive and mental health services; and community education. Friendly Visiting program and onsite Older Adult Mingle.\" ','1210105764399667','www.sageli.org',NULL,NULL,NULL,'1047568246255855',NULL,NULL,NULL,NULL,NULL,'843379087229240',NULL,NULL,NULL,'1111579290394915',NULL,NULL,NULL),(190,847667174348320,'Kerri Tavzel, LCSW, P.C.',NULL,624983655528312,'Geriatric Care Management for seniors who may be struggling with aging issues, understanding options and identifying available resources. Providing supportive counseling to the whole family to help ease the stress associated with aging. Working together to find the best care for you and your loved ones.\n\nPosted 10/19','886799153279660','https://positiveagingny.com/',NULL,'tavzellcsw@gmail.com',NULL,'922137071025167',NULL,NULL,NULL,NULL,NULL,'1309118172969461',NULL,NULL,NULL,'934163001698304',NULL,NULL,NULL),(191,858152248189461,'Care Program',NULL,631176636895026,'For seniors who are unable to function independently because of a memory impairment and are in need of support throughout the day. A diagnosis of dementia is required for participation in the program (cost depending on attendance: art/pet therapy, music, poetry, yoga, farm to table lunch).','846978082571709,1170885229962740','http://www.lenoxhill.org/careprogram',NULL,NULL,NULL,'1253061813300180,1106914314143204,1285075174713673,1154569847221125',NULL,NULL,NULL,NULL,NULL,'800130923492591',NULL,NULL,NULL,'886489022858841,885741754788620',NULL,NULL,NULL),(192,855990278933484,'One Shot Deal',NULL,1178157683868500,'From their website: \"A  public assistance program that pays rent arrears if you can prove that you can pay the current and future rent. One-time payment from the Human Resources Administration (HRA) to pay back rent to avoid an eviction. To qualify, you must have a source of income other than public assistance such as employment or SSI. If you receive on-going public assistance or are applying for on-going public assistance and owe back rent you may also qualify for “applicant arrears” or “duplicate shelter allowance.” \"','1041503270808117','https://www1.nyc.gov/nyc-resources/service/1205/one-shot-deal-short-term-emergency-assistance',NULL,NULL,NULL,'958412510535349',NULL,NULL,NULL,NULL,NULL,'772050021931818',NULL,NULL,NULL,'1014326083250530',NULL,NULL,NULL),(193,873949931051421,'Free Home Repairs',NULL,1204861688209676,'HomeFront volunteers are ready to repair homes at no cost to qualified homeowners. \n\nPosted 10/19',NULL,'http://www.homefrontprogram.org/',NULL,NULL,NULL,'637341834651271',NULL,NULL,NULL,NULL,NULL,'1082939744717608',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(194,873732771374546,'Urban Pathways Housing',NULL,751774904383008,'Helps adults move rapidly into housing from the street, public spaces, or temporary shelter. Services include outreach, a drop-in center, safe havens, permanent and temporary supportive housing, a medical wellness program, an employment assistance program, and a Moving On Initiative. Urban Pathways has programs across four of the five boroughs in New York City and at Newark Liberty International Airport. If you are homeless and in need of housing, or would like information about eligibility for services, please call and ask to speak with the Outreach Team.',NULL,'http://www.urbanpathways.org',NULL,'outreachteam@urbanpathways.org',NULL,'958412510535349',NULL,NULL,NULL,NULL,NULL,'621469000317608',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(195,885146636913548,'Benefits Outreach Program',NULL,950026462460426,'From their website: Will screen you for eligibility and assist you throughout the entire application process. We can assist you with Supplemental Nutrition Assistance Program (SNAP - the new name for Food Stamps), Medicare Savings Program & Low Income Subsidy, Medicaid, Home Energy Assistance Program (HEAP), and the Senior Citizen Rent Increase Exemption (SCRIE/DRIE).','1295249833741731','https://www.liveon-ny.org/',NULL,NULL,NULL,'629629464544122',NULL,NULL,NULL,NULL,NULL,'1150406180568781',NULL,NULL,NULL,'1230085793293701',NULL,NULL,NULL),(196,883661799275818,'Anne B. Pagano, LCSW, ACSW, BCD, C-ASWCM',NULL,1259072200760818,'Aging in Place initial evaluation and identification of care needs and optimum home care hours.  Assessment of eligibility factors for independent, assisted living or nursing home admission.  Options and eligible entitlements are reviewed to promote consumer education and choice. Connection with medical, legal, home care, community, and other services, as needed. \n \nInformation regarding the Consumer Directed Personal Attendant Program option under Medicaid.  this program gives clients the option of hiring and overseeing their own aides instead of working with a licensed homecare agency (within program guidelines and regulations).\n \nEducation and review of the nursing home application process, including how to evaluate nursing homes based on Department of Health surveys, walk through tours; Adjustment support related to relocation.\n \nAssistance in identifying skilled nursing facilities that can best meet client and family needs, including faith based and cultural preferences.\n \nAssistance in identifying additional community resources.\n \nBenefit entitlement assessments.\n \nCollaboration with medical providers, family members, guardians, elder law attorneys, Medicaid caseworkers, and the Managed Long Term Care Homecare organizations.\n \nCompletion and submission of the Medicaid homecare paperwork.\n \nAdvocacy services during the Medicaid pending process, including availability to be present during the home visit assessment by the Intake Assessment nurse through the Managed Long Term Care Organization. \n   \nAssistance with disability certification through the Social Security Administration when a community needs pooled trust is being implemented.\n\nPosted 10/19','1334364811129239','www.paganoseniorcare.com',NULL,'abpagano@yahoo.com',NULL,'922137071025167',NULL,NULL,NULL,NULL,NULL,'814749382877602',NULL,NULL,NULL,'1205362244317357',NULL,NULL,NULL),(197,833306969877865,'Sparkle and Shine-Home Organizing',NULL,NULL,'Kathleen Fiorito, organizer.  Free consultation; $45/hour (or sliding scale), in-home assistance.',NULL,NULL,NULL,'kathleenfiorito@aol.com',NULL,'941628219469820',NULL,NULL,NULL,NULL,NULL,'661572212886100',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(198,856807550462482,'Sinai Free Synagogue',NULL,1272098259280185,'Kosher home-delivered meals for homebound individuals in Mt. Vernon, parts of Yonkers, New Rochelle, Eastchester, Pelham, Bronxville, Hartsdale and White Plains.\n\nPosted 10/19',NULL,'http://www.wjcs.com/senior-programs-in-mt.-vernon/',NULL,NULL,NULL,'1340645838393358',NULL,NULL,NULL,NULL,NULL,'1314394578274560',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(199,857892650329692,'Legal Referral Service',NULL,625802433879182,'From their website: \"Call or request lawyer online to discuss your legal question with one of our attorney referral counselors or submit it online. All information you provide will be kept confidential to the fullest extent possible under the law. Get referred to a screened and qualified lawyer or the right resource. Initial consultations are $35 or free, depending on the type of case, and last up to 30 minutes.\"','1091266148421746','http://www.nycbar.org/get-legal-help/',NULL,NULL,NULL,'1107228321502442',NULL,NULL,NULL,NULL,NULL,'892862349560017',NULL,NULL,NULL,'576836909180419',NULL,NULL,NULL),(200,860902402553704,'Alvita Home Care',NULL,NULL,'Offers in-home personal care, assistance with activities of daily living, companionship, household services (light housekeeping and laundry), respite care, hospice and palliative care, assistance attending appointments, shopping and errands. Serves five boroughs of NYC, Westchester, Long Island and New Jersey. Private pay and Long Term Care Insurance. Contact: Chris Clarke, Community Liaison. ','1216059851397303','www.alvitacare.com',NULL,'chris.clarke@alvitacare.com',NULL,'687567198750084,1119801442928622',NULL,NULL,NULL,NULL,NULL,'869429162494979',NULL,NULL,NULL,'760132613365399',NULL,NULL,NULL),(201,880541242410623,'The Blue Card',NULL,NULL,'From their website: \"Holocaust survivors seeking assistance must be referred to The Blue Card by social service agencies or government agencies in the communities where they live. A case manager at the social service agency performs a financial assessment and reviews the applicant\'s income and expenses to establish need and, when appropriate, helps the senior access any public entitlements for which a the survivor may be eligible. Programs: Claims Conference Emergency Cash Assistance Program – One time grant assistance for emergency needs, Claims Conference In-Home Care Services, Emergency Prevention Programs, Health and Wellbeing Programs, Educational & Outreach Programs.\"','643589672080759','www.bluecardfund.org ',NULL,'info@bluecardfund.org',NULL,'787387982275890,1296742648227889',NULL,NULL,NULL,NULL,NULL,'573942540705327',NULL,NULL,NULL,'1129623236065071',NULL,NULL,NULL),(202,898629780940069,'Adult Day Health Programs and Services',NULL,1200843887896171,'Bethel\'s Adult Day Services program is for seniors and adults who might otherwise be left alone during the day while their caregivers are at work. Designed to provide an entertaining and interactive day for those who attend. 8am-4pm, Monday through Friday. Transportation available for those living within 10 miles. \n\nPosted 11/19','1192458337156708','www.bethelwell.org',NULL,NULL,NULL,'1235050525416771',NULL,NULL,NULL,NULL,NULL,'625287586096053',NULL,NULL,NULL,'610409293804816',NULL,NULL,NULL),(203,841760538349605,'Crossing Guard Positions',NULL,596807495757981,'As of 7/22/19: The NYPD position of school crossing guard is part-time employment that comes with a personal sense of job satisfaction as you safeguard school children walking across busy intersections on their way to and from school. School crossing guards oversee and control traffic flow around schools in the morning, at lunch time, and at the end of the school day. Entrusted with the safety of the city\'s schoolchildren, candidates for this position are asked to meet certain physical and medical requirements, and complete six days of training at the NYC Police Academy once appointed. In return, school crossing guards are rewarded with an exceptional opportunity to serve their community, while earning a competitive salary with family health insurance benefits. Pay and Benefits: $15.00/hour, health insurance with 20-plus hours worked per week, work close to home, summer work also available. Requirements: There are no formal education or experience requirements for this job, but all candidates must be able to understand English and speak English well enough to be understood.\nPrior to appointment, prospective candidates must pass a qualifying medical examination, which includes drug screening, and a character/background investigation. Once appointed, candidates must complete six days of training at the Police Academy. Apply online at the link below or contact your local police precinct.','793546343850775','https://www1.nyc.gov/site/nypd/careers/civilians/school-crossing-guard.page',NULL,NULL,NULL,'910325259072395',NULL,NULL,NULL,NULL,NULL,'1314098915699970',NULL,NULL,NULL,'1014326083250530',NULL,NULL,NULL),(204,843695218391806,'NYC Housing Connect Lottery',NULL,885762417871212,'Create an online account, search & select housing, enter housing information, and apply to lottery online. Housing in all 5 boroughs.','853543877728189','https://a806-housingconnect.nyc.gov/nyclottery/lottery.html',NULL,NULL,NULL,'958412510535349',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1014326083250530',NULL,NULL,NULL),(205,848505725963901,'Outpatient Mental Health Services',NULL,683554445282456,'From their website: \"Provides a variety of community-based outpatient programs for adults who are seeking assistance managing their behavioral health conditions and meeting their healthcare and personal goals. All of The Bridge’s outpatient services are located in one building in the Morningside Heights neighborhood of Manhattan, allowing clients to receive multiple services in one convenient location.\"','1204588464530618','https://www.thebridgeny.org/',NULL,NULL,NULL,'1112870426305700',NULL,NULL,NULL,NULL,NULL,'909212270034389',NULL,NULL,NULL,'857963898557554',NULL,NULL,NULL),(206,854957632287008,'Lott Residence',NULL,NULL,'From their website: Assisted living facility that accepts Medicaid, approved by the New York State Department of Health for seniors, aged 65 and older, who require some home care services, medical attention and assistance. Studio apartment with full kitchen, living area, and private bathroom. 24-hour concierge, personal emergency response system, routine monitoring of residents day and night, included in single monthly fee. Assistance with activities of daily living 24-hours, personal care assistants help with individual needs (bathing, dressing, toileting, grooming, laundry and housekeeping). Medication administration managed by registered nurse, case management provided by social work staff, physician specializing in geriatric care available full-time on premise. Dining room serving three meals a day, overlooking Central Park. Beauty Parlor, meditation room, computer-equipped library, activity center, TV lounge, and a garden. Daily activities, spiritual programs, and weekly outings. They accept residents with mild dementia. ','889792747036133','https://lottresidence.org',NULL,NULL,NULL,'924951065612317,973172406940749',NULL,NULL,NULL,NULL,NULL,'1005919561771769',NULL,NULL,NULL,'920307448822049',NULL,NULL,NULL),(207,854208352791295,'Homeless In-Reach',NULL,1016766891399541,'From their website: \"Counseling, Support, and Housing: For homeless elders, Project FIND offers case management and counseling, assistance in obtaining entitlements and benefits, help getting to the doctor and obtaining medications, and more. At our Woodstock Senior Center, seniors can get hot showers and clean clothes. Our social workers try to put homeless seniors on a path toward finding housing. Hours: Tuesday - Saturday 9 am - 5 pm, Sunday 10 am - 2 pm.\"','822785803123015','www.projectfind.org/services_for_the_homeless',NULL,NULL,NULL,'958412510535349',NULL,NULL,NULL,NULL,NULL,'1044000480154283',NULL,NULL,NULL,'689094917277064',NULL,NULL,NULL),(208,855012770625599,'Hunter College Senior Citizen Auditors',NULL,1146302104644001,'College classes for seniors 60 years and older who are New York state residents. The Senior Citizen Auditor program is free, but there are processing fees for each semester/session: $65.00 general fee is due at the time of registration and $15.00 consolidated services fee is due at the time of registration. Auditors are also responsible for the costs of any course materials, such as textbooks. Once you have applied and submitted all of your documents you will be notified of your admission status within 2-3 weeks via email. The Winter session is not available to lifelong learners.','1124919878128991','http://www.hunter.cuny.edu/admissions/admissions-information/senior-learners',NULL,NULL,NULL,'972558970458700',NULL,NULL,NULL,NULL,NULL,'1173761213398460',NULL,NULL,NULL,'823469849479465',NULL,NULL,NULL),(209,859322079983202,'Diana Singer',NULL,1234510163326381,'Diana assists older adults and their families with housing choices in Connecticut. There is no charge for her services--she is paid by facilities to which she refers. \n\nPosted 11/19',NULL,NULL,NULL,'diana@senior-living-choices.net',NULL,'942152466549074',NULL,NULL,NULL,NULL,NULL,'1150193075558879',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(210,864258498837575,'Companion: Dolly Floriano',NULL,NULL,'Meal preparation, light housekeeping, medication reminder, shopping errands, outside trips.\n\nPosted 10/19: Unavailable as of 10/19 due to injury',NULL,NULL,NULL,'hellodolly10@icloud.com',NULL,'1201096778076050,772331273438770',NULL,NULL,NULL,NULL,NULL,'613468656737691',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(211,868727885008927,'Queens Community House Senior Center',NULL,964490714809680,'Queens Community House\'s five senior centers provide culturally-rich environments where older adults can engage with peers, make new friends, enjoy a hot meal, keep physically active, learn new skills and explore new interests, and give back through volunteer opportunities.\nEach center offers a wide variety of physical activities, including yoga, Zumba, ballroom dance, stretching, tai chi, chair aerobics, and ping pong, for older adults looking to maintain their health. We also provide support in managing chronic health conditions through free screenings, health education workshops, and nutritious meals. Drivers provide rides to and from Queens Community House senior centers, as well as to events, shopping, and doctors’ appointments, for older adult participants. Queens locations: Forest Hills, Rego Park, Jackson Heights, Kew Gardens, Pomonok/Flushing.','627611326014794','https://www.qchnyc.org/programs/older-adult-services/transportation',NULL,NULL,NULL,'977021400698839,843777382088472,953560938102102',NULL,NULL,NULL,NULL,NULL,'607143180577139',NULL,NULL,NULL,'1317203100328746',NULL,NULL,NULL),(212,878552062762789,'Alzheimer\'s and Dementia Care, LLC',NULL,NULL,'Service areas are Fairfield and New Haven counties in Connecticut and Westchester, New York.\n\nPosted 10/19',NULL,'http://www.alzdementiacare.com',NULL,NULL,NULL,'919422912164535,1201096778076050',NULL,NULL,NULL,NULL,NULL,'731485786218763',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(213,881100708655245,'Robin Freimann, Esq.',NULL,NULL,'From Website: Welcome to Elder Law and Trusts. My practice is entirely devoted to Elder Law and legal and financial planning for the elderly and disabled. I personally work with families to figure out solutions to the issues that will make sense to them...always with my clients\' best interests at heart.\n\nPosted 10/19','1197649522494871','http://elderlawandtrusts.com/',NULL,NULL,NULL,'1113969124035608',NULL,NULL,NULL,NULL,NULL,'1189178993308991',NULL,NULL,NULL,'869990165255882',NULL,NULL,NULL),(214,898887374898262,'Phyllis and Lee Coffey Geriatrics Practice',NULL,587285817504966,'A primary care practice that specializes in treating the health problems of older adults. We also offer activities, classes, and programs designed to help older adults remain energetic. The social workers at The Martha Stewart Center for Living can offer guidance on needed government and insurance supports and services, as well as on managing stress associated with caring for family members. They can also refer to and coordinate additional support and palliative care services, provided through the Lilian and Benjamin Hertzberg Palliative Care Institute.','925674956853723','https://www.mountsinai.org/locations/martha-stewart-center-living',NULL,NULL,NULL,'1231611168158959,1216469255274749',NULL,NULL,NULL,NULL,NULL,'857329936429963',NULL,NULL,NULL,'955349184482080',NULL,NULL,NULL),(215,866623452141437,'Health for Life Program',NULL,1273704954905898,'From Website: The free Health for Life Program (HeLP) offers you a enhance your quality of life by showing you how to manage your chronic health conditions, such as high blood pressure, pain, depression and diabetes. You’ll learn about managing your medications correctly and improving communication with health care providers and family. The program takes place for two-and-a-half hours a week for six weeks at community-based locations such as houses of worship, senior centers, nonprofit organizations and housing developments throughout Westchester.\n\nPosted 11/19',NULL,'seniorcitizens.westchestergov.com/nutrition-health-safety/health-for-life-program',NULL,'mqcq@westchestergov.com',NULL,'772331273438770',NULL,NULL,NULL,NULL,NULL,'1019285095824247',NULL,'1075810353954390',NULL,NULL,NULL,NULL,NULL),(216,877538325889166,'Food Pantry & Clothing Donations',NULL,1106726852579981,'Accepts healthy, nutritional non-perishable foods. They do not distribute high-salt or high-sugar prepared foods. Also accepts clothing donations of folded, laundered, lightly-used clothing.','1074939969770061','https://www.wscah.org/food-clothing/',NULL,NULL,NULL,'1084050103649570,886323941641619',NULL,NULL,NULL,NULL,NULL,'747897540792358',NULL,NULL,NULL,'1170806548578938',NULL,NULL,NULL),(217,889375579530847,'Down to Earth Funerals ',NULL,NULL,'Burials, cremations, and memorial services in the five boroughs and Westchester. Plans both traditional and alternative-style memorial services. Call for an initial free 20-minute consultation with Caroline Schrank, licensed funeral director.','760894979683091','https://www.dtefunerals.com/',NULL,'Caroline@dtefunerals.com',NULL,'809388330706262',NULL,NULL,NULL,NULL,NULL,'916139201760750',NULL,NULL,NULL,'1053771975332055',NULL,NULL,NULL),(218,899868626497582,'Union County Division on Aging',NULL,NULL,'NJ resource line for seniors.','887521302041691','http://ucnj.org/departments/human-services/aging-directory/',NULL,NULL,NULL,'1050752555762937',NULL,NULL,NULL,NULL,NULL,'781919486201028',NULL,NULL,NULL,'1014326083250530',NULL,NULL,NULL),(219,901551000488928,'Institute for Retired Professionals',NULL,1097393829047023,'A \"post-career peer learning community\" for semi-retired or retired individuals. Students may take 2-3 classes per semester. Tuition is $1,054 for the academic year or $665 for a single semester. Scholarships are available once a student is accepted. ','1089144638825051','https://www.newschool.edu/institute-for-retired-professionals',NULL,'irp@newschool.edu ',NULL,'972558970458700',NULL,NULL,NULL,NULL,NULL,'798567960138007',NULL,NULL,NULL,'978282549281920',NULL,NULL,NULL),(220,864335272048219,'Telephone Support Groups',NULL,1155578608136431,'\"Telephone only; Educational and support network offered in partnership with hospitals, social services agencies, and healthcare professionals. Weekly support groups and workshops give participants the opportunity to speak with experts, learn about resources, and meet others. These support groups and workshops are conducted over the telephone via conference call technology to accommodate busy schedules and eliminate the difficulty of traveling to a meeting site.\"','1173500557493659','http://www.dorotusa.org/site/PageServer?pagename=cc_connections_D#.W2IC4tVKiUk',NULL,NULL,NULL,'673898301722674,1275784767796871,929538948830045,1285075174713673,633482549261197',NULL,NULL,NULL,NULL,NULL,'1250724514805056,617362673503677',NULL,NULL,'942885369302412','967252529008278',NULL,NULL,NULL),(221,885273584051143,'Geriatric House Call Dentistry',NULL,NULL,'Dr. Alisa Kauffman and staff visit home bound seniors in their home for dental procedures, also treat seniors with Alzheimer\'s/dementia.','906663668861500','https://geriatrichousecalldentistry.com',NULL,NULL,NULL,'580054623534909,1216469255274749,1180772910179038',NULL,NULL,NULL,NULL,NULL,'1114416852341347',NULL,NULL,NULL,'1014326083250530',NULL,NULL,NULL),(222,891954059447306,'Care NYC',NULL,864426170652608,'Caregiver support specialist helpline for support to caregivers of older adults living with Alzheimer\'s/Dementia and chronic illness. Program locations are in Manhattan, Brooklyn, Queens, and Staten Island. You can find a current schedule of events here: https://www.scsny.org/care-nyc/events','795896026381904','www.scsny.org/care-nyc',NULL,'carenyc@scsny.org',NULL,'673898301722674,953560938102102,822552305363624',NULL,NULL,NULL,NULL,NULL,'746140436125317',NULL,NULL,NULL,'880683347691640',NULL,NULL,NULL),(223,893223408273048,'William Alanson White Institute ',NULL,NULL,'Individual psychotherapy, one to two times a week, for up to forty weeks. Sessions are available from 8:00 am to 8:45 pm. Fees are adjusted on a sliding scale or applied to the portion of the clinic fees that are not covered by your insurance.  After forty weeks, you may decide with your therapist if you would like to continue in the therapist’s private practice at a modest fee.  Also offer group psychotherapy on Monday evenings from 6:30 to 8:00 pm.','1107641664449439','http://www.wawhite.org/index.php?page=adult-treatment-services',NULL,NULL,NULL,'1112870426305700',NULL,NULL,NULL,NULL,NULL,'618398871220672',NULL,NULL,NULL,'1129628391923902',NULL,NULL,NULL),(224,889023194640701,'Active Retirement Center',NULL,1306747130190115,'From their website: \"Brings the most affordable programs for active adults 55 and older to lower Manhattan. A full-year\'s membership fee entitles you to the Coffee and Culture lecture series; computer assistance; sponsored events including films, tours, and performing arts; use of Pace\'s library, computer labs and dining facilities; and a calendar of rich events.\"','1080807857173068','https://cps.pace.edu/lifelong-learning/senior-programs-parc/',NULL,'cps@pace.edu',NULL,'972558970458700',NULL,NULL,NULL,NULL,NULL,'913219307952149',NULL,NULL,NULL,'721666740867302',NULL,NULL,NULL),(225,896313169700560,'Arts & Minds Museum Experiences',NULL,1096616231661984,'From their website: \"Museum based experiences for people with dementia and their caregivers.\"','1156903380578361','https://artsandminds.org/',NULL,NULL,NULL,'1253061813300180,1106914314143204,1285075174713673,1269324491810499',NULL,NULL,NULL,NULL,NULL,'802096858354782',NULL,NULL,NULL,'880683347691640',NULL,NULL,NULL),(226,904282257428840,'Night Care',NULL,830984038249926,'From their website: \"A safe, compassionate place for people with Alzheimer’s disease and related dementias to spend the night, so family members can have much-needed overnight relief.\" ','938628875747834','https://jewishhome.org/our-services/adult-day-health-care-2/',NULL,NULL,NULL,'1253061813300180,1106914314143204,1285075174713673',NULL,NULL,NULL,NULL,NULL,'692087775950155',NULL,NULL,NULL,'770686109942059',NULL,NULL,NULL),(227,923347820254590,'Touching Hearts at Home',NULL,NULL,'From their website: \"We provide non-medical home care services for older adults, seniors, and people with medical conditions and/or disabilities.\" ','1218286004175252','https://www.touchinghearts.com/nyc/',NULL,NULL,NULL,'687567198750084',NULL,NULL,NULL,NULL,NULL,'799707403596370',NULL,NULL,NULL,'870520879009475',NULL,NULL,NULL),(228,926069886368291,'Seniors Helping Seniors Northern Westchester/Putnam',NULL,NULL,'In-home services that match seniors who want to help with seniors who are looking for help.\n\nPosted 10/19',NULL,'https://seniorcarenorthwestchester.com/',NULL,'SHS.DebraLang@gmail.com',NULL,'1201096778076050,1241148404540765',NULL,NULL,NULL,NULL,NULL,'1178049063862039',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(229,893692250713946,'Home Modifications Program',NULL,1147382684224778,'Call I&R to do an intake in order to use their free service to provide and install grab bars, stair lifts, ramps, etc. for families caring for disabled individuals.','885050653586052','www.adaptcommunitynetwork.org',NULL,NULL,NULL,'1293277534665673,650194788641739,787470082421161',NULL,NULL,NULL,NULL,NULL,'1098357088666608',NULL,NULL,NULL,'1208664607201611',NULL,NULL,NULL),(230,898070362683420,'Andrew Heiskell Braille & Talking Books Library',NULL,723174585810467,'From their website: \"More than 80,000 narrated talking books and 14,000 braille and digital braille books and magazines. Monday, Wednesday, Friday, and Saturday, 10 am-5 pm, Tuesday, Thursday, 12 pm-7 pm, Sunday-closed.\"','846050654951667','www.nypl.org/talkingbooks',NULL,NULL,NULL,'1291763496785325',NULL,NULL,NULL,NULL,NULL,'1173504437290313',NULL,NULL,NULL,'1106562640393347',NULL,NULL,NULL),(231,898337577101239,'ReServe',NULL,NULL,'ReServe matches 55+ volunteers with part-time service opportunities at non-profits. They provide a stipend for volunteers along with the opportunity to positively impact their community. ReServe provides opportunities for seniors to utilize their professional skills. \n\nPosted 11/19',NULL,'www.reserveinc.org',NULL,'lgold@reserveinc.org',NULL,'1241148404540765',NULL,NULL,NULL,NULL,NULL,'789762149366713',NULL,'651528528166880',NULL,NULL,NULL,NULL,NULL),(232,899115512914613,'Bayberry Care Center',NULL,NULL,'Bayberry Care Center offers rehabilitation services as well as a Skilled Nursing facility. Every resident has a customized care plan that emphasizes individual freedom and agency in one\'s own care. Bayberry houses 60 residents. \n\nPosted 11/19','1242698189712560','http://www.bayberrycarecenter.com',NULL,'info@bayberrycarecenter.com',NULL,'628102384928895,1132943173487126',NULL,NULL,NULL,NULL,NULL,'895406766667252',NULL,NULL,NULL,'608582552706589',NULL,NULL,NULL),(233,902766670469490,'Project Ezra',NULL,NULL,'For Jewish seniors 60+ who live in catchment area (Lower East Side/E. 19th Street and below). Seniors need a home assessment before using their escort program.','1107021073392360','www.projectezra.org',NULL,'info@projectezra.org',NULL,'1119801442928622',NULL,NULL,NULL,NULL,NULL,'601240361468452',NULL,NULL,NULL,'793404199109942',NULL,NULL,NULL),(234,910751050263937,'Hospice Program of Calvary Hospital',NULL,595059685028289,'Hospice Services are: Nursing care; as needed to maintain the patient at home, 24 hours a day, 7 days a week on-call nurse, Physician services, Medical social services, Pastoral care, Counseling services, Nutritional counseling , Short-term inpatient and respite care, Medical supplies and equipment related to the terminal illness, Personal care provided by Certified Home Health Aides, Therapies (e.g., physical, occupational and speech), Medications for symptom management and pain control related to the terminal illness, Bereavement counseling for family members and significant others, Volunteer services\nCalvary@Home partners with patients’ families to promote the quality of life, address pain management and other symptoms, and help prepare both the patient and their loved ones for what to expect in the final days of life. \nHow to Make a Referral:\nAnyone can make a referral to Calvary Hospital Hospice. After a referral is made to Calvary Hospital Hospice, the nurse contacts the patient and/or family to schedule a time to meet. The ultimate decision regarding the acceptance of hospice care is made by the patient and family/caregiver.','883014600166922','https://www.calvaryhospital.org/calvary-care/hospice-care/',NULL,NULL,NULL,'1273907163486188',NULL,NULL,NULL,NULL,NULL,'1238092236044839',NULL,NULL,NULL,'977474965624902',NULL,NULL,NULL),(235,916526261260854,'Greenwich House-Case Management',NULL,927555477423975,'Caseworkers (fluent in English and Spanish) provide assistance with questions about SCRIE, maintain an extensive file of resources and information on legal aid, meals-on-wheels, affordable dental care, mental health providers, and a host of other services. They also provide referrals to Money Management or Senior Health and Consultation services through Greenwich House, where necessary.','880992511992713','http://www.greenwichhouse.org/cc_senior_centers/case-management',NULL,NULL,NULL,'819444632829102',NULL,NULL,NULL,NULL,NULL,'1232980662156316',NULL,NULL,NULL,'956078451072176',NULL,NULL,NULL),(236,921013058861142,'Jennifer Colby, JD, LCSW, CCM, C-ASWCM',NULL,NULL,'Geriatric Psychotherapy and Care Management. Accepts Medicare Part B. Also performs psychiatric evaluations as private pay consultations. Operates primarily south of 287. \n\nPosted 10/19',NULL,NULL,NULL,'jcolbylcswccm@gmail.com ',NULL,'1199809410500971',NULL,NULL,NULL,NULL,NULL,'641524297543024',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(237,920942915543245,'ClearCaptions',NULL,NULL,'From Website: If you are experiencing hearing loss that inhibits your phone use, you may qualify to receive a ClearCaptions phone at no cost to you! ClearCaptions offers real-time phone captioning that allows you to see every word said on the call.\n\nPosted 11/19',NULL,'clearcaptions.com/',NULL,NULL,NULL,'923317357274480',NULL,NULL,NULL,NULL,NULL,'1091185508071238',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(238,927836662885374,'Respite Care Program',NULL,1307648044870350,'From their website: \"Provides temporary relief to caregivers of frail elderly individuals over age 60 who reside throughout New York City and are not Medicaid eligible.\"','1257554801869010','http://www.nyfsc.org/support-services/respite-care-program/',NULL,NULL,NULL,'673898301722674',NULL,NULL,NULL,NULL,NULL,'601033511673332',NULL,NULL,NULL,'1278869071563581',NULL,NULL,NULL),(239,922899433744992,'Mayor\'s Alliance for NYC\'s Animals',NULL,NULL,'Resources for low-cost veterinary care, free and low-cost spay/neuter programs and clinics, low-cost microchipping clinics, free and low-cost pet food, litter, and supplies. The Mayor\'s Alliance for NYC\'s Animals is NOT a shelter. They cannot accept relinquished pets. ','637716967566715','http://www.animalalliancenyc.org/',NULL,'info@AnimalAllianceNYC.org',NULL,'998681432266511',NULL,NULL,NULL,NULL,NULL,'975760126129092',NULL,NULL,NULL,'1156570465487443',NULL,NULL,NULL),(240,928312640156376,'Center for Hearing & Communication',NULL,NULL,'Offers services in audiology (hearing test, hearing aids, custom ear plugs), speech-language therapy, counseling, and more. While most hearing center services in our NYC office require an appointment, walk-in services are available on a limited basis for CHC clients in need of hearing aid repairs, ear molds and other technology needs that arise on short notice. Call for appointments. Walk-in service is available: Monday 9:00 am-12:30 pm,Tuesday 12:00 pm-4:30 pm, Wednesday 9:00 am-12:30 pm, Thursday 9:00 am-12:00 pm and 2:00 pm-4:30 pm, Friday 12:00 pm-4:30 pm.','1121525123649927','http://chchearing.org/nyc/',NULL,NULL,NULL,'673030812970350',NULL,NULL,NULL,NULL,NULL,'1069852545559686,1094048384615027',NULL,NULL,NULL,'822657436553381',NULL,NULL,NULL),(241,928175786725153,'Lewy Body Dementia Association (Westchester County)',NULL,657947815981072,'Caregiver’s support group once per month on the second Tuesday from 11:00 am - 12:30 pm.\n\nPosted 10/19',NULL,'https://lewybodyresourcecenter.org/',NULL,'norma@lbdny.org',NULL,'919422912164535',NULL,NULL,NULL,NULL,NULL,'1295763741314922',NULL,'1241841416351041',NULL,NULL,NULL,NULL,NULL),(242,881374166540572,'Goddard Riverside Law Project',NULL,869274193579262,'From their website: \"Free legal representation in nonpayment, holdover and Housing Part proceedings in the New York City Housing Court for: SRO tenants living on the west side of Manhattan, from 14th Street north; and apartment tenants living in the area from 100th to 116th Streets, from 5th Avenue to Riverside Drive. Tenant organizing and legal advocacy for individuals and groups of tenants concerning their rights developing tenant leadership and providing support to individuals and groups of tenants, including tenant associations, advocating before elected officials, administrative agencies and legislative bodies helping tenants identify and obtain housing-related benefits conducting know-your-right trainings, workshops and legal clinics for tenants in the community, screening tenants for consumer debt–related issues and providing referrals as needed. Walk-in hours: Thursdays, 4-6 pm.','1143386259889042','https://www.goddard.org/grcc/programs/goddardlawproject/',NULL,NULL,NULL,'1107228321502442,1267306776036445',NULL,NULL,NULL,NULL,NULL,'1175098415197571',NULL,NULL,NULL,'1079981454870671',NULL,NULL,NULL),(243,883507159127468,'Mental Health Program',NULL,1259842440192512,'VNSW employs registered nurses with advanced psychiatric training. The nurses conduct home visits for assessment, evaluation, and development of a treatment plan. \n\nPosted 11/19',NULL,'www.vns.org/home-care-services/mental-health-home-care',NULL,'mentalhealth@vns.org',NULL,'738473770520078',NULL,NULL,NULL,NULL,NULL,'1276621937441254',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(244,886253789349222,'Financial Assistance',NULL,789022028516981,'\"Financial assistance is one of the tools our case managers can use to stabilize families in crisis. We help prioritize needs, create a budget and set realistic financial goals. We also provide financial literacy classes to keep problems from reoccurring.\"','965547213786909','https://catholiccharitiesny.org/our-agencies/catholic-charities-community-services',NULL,NULL,NULL,'787387982275890',NULL,NULL,NULL,NULL,NULL,'951006825225060',NULL,NULL,NULL,'988983663682670',NULL,NULL,NULL),(245,884085981836620,'ALZConnected® Online Community',NULL,1241984388362131,'A free online community powered by the Alzheimer\'s Association for everyone affected by Alzheimer\'s or another dementia, including: people with the disease, caregivers, family members, friends, and individuals who have lost someone to Alzheimer\'s.',NULL,'https://www.alzconnected.org/',NULL,NULL,NULL,'1253061813300180,1106914314143204,1285075174713673,673898301722674,633482549261197',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(246,920707045021974,'The Jewish Board-Supportive Housing',NULL,732679688850212,'From their website: \"We provide both transitional and long-term options for individuals. We provide apartments directly in the community. These apartments, known as “scatter-site” apartments, enable individuals to live independently in the community while still accessing responsive, wraparound care coordination. Specialized populations, such as young adults and the formerly homeless, live in community residences, which are home-like sites that focus on reintegration into the community, psychiatric stability, wellness, and educational and vocational goals. Our staff work with individuals in their homes and communities to support goals, build skills for independence, link to neighborhood resources, and ensure a strong network of treatment and support.\"','942646370393141','https://jewishboard.org/how-we-can-help/supportive-housing/',NULL,NULL,NULL,'958412510535349',NULL,NULL,NULL,NULL,NULL,'1249880844968233',NULL,NULL,NULL,'873818423822151',NULL,NULL,NULL),(247,923288811832955,'Single Stop',NULL,869274193579262,'From their website: \"Housing Court, consumer issues, drafting a will, legal issues involving Social Security or disability. Monday, Wednesday, Thursday & Friday, 9 am – 5 pm, Tuesday 9 am – 6 pm. Call for an appointment or just walk in.\"','871057477895399','www.goddard.org/grcc/programs/singlestop/',NULL,NULL,NULL,'1107228321502442,787387982275890,629629464544122',NULL,NULL,NULL,NULL,NULL,'1107724201292942',NULL,NULL,NULL,'1079981454870671',NULL,NULL,NULL),(248,934306853127435,'Telehealth Intervention Programs for Seniors',NULL,1273704954905898,'Through regular remote monitoring, patients can self-manage chronic conditions, avoid unplanned and emergency medical visits, and reduce medical expenses for themselves and caregivers. \n\nPosted 10/19',NULL,'https://seniorcitizens.westchestergov.com/',NULL,NULL,NULL,'1240800274587016',NULL,NULL,NULL,NULL,NULL,'1232511819157441',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(249,945237438402888,'Office of the State Long Term Care Ombudsman',NULL,NULL,'New York state\'s Long Term Care Ombudsman acts as an advocate and resource for older adults and persons with disabilities who live in nursing homes, assisted living and other licensed adult care homes. Ombudsmen help residents understand and exercise their rights to good care in an environment that promotes and protects their dignity and quality of life. The Ombudsman Program advocates for residents by investigating and resolving complaints made by or on behalf of residents; promoting the development of resident and family councils; and informing government agencies, providers and the general public about issues and concerns impacting residents of long-term care facilities. Claudette Royal is the New York State Ombudsman. **CIDNY-Center for Independence of the Disabled, NY (http://www.cidny.org/) is managing the program for New York City and can be reached at (212) 674-2300.** ','1157080246152242','https://www.ltcombudsman.ny.gov/',NULL,NULL,NULL,'1267306776036445',NULL,NULL,NULL,NULL,NULL,'1297760712858394',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(250,888306027562741,'Westchester County Office for Women Helpline',NULL,1246973128987993,'Posted 11/19','934727780722636','women.westchestergov.com/contact-us',NULL,NULL,NULL,'1108954480265575',NULL,NULL,NULL,NULL,NULL,'915489467277321',NULL,NULL,NULL,'592316067294479',NULL,NULL,NULL),(251,892781673160800,'Flex Physical Therapy',NULL,NULL,'Therapist-owned physical therapy practice offering one-on-one patient care. Rehabilitation for general discomfort, injury, post-surgery or other conditions. Also offers hand and upper extremity physical therapy. Accepts Medicare and most insurances. In home physical therapy (as needed) is out-of-pocket. Staff includes professionals with backgrounds in oncology, women\'s health/pelvic floor health, and sports and fitness. Joel Giffin, PT, DPT, CHT.','944648663724317,934699098589447','https://flexptny.com/',NULL,'uws@flexptny.com',NULL,'1231611168158959,1216469255274749,974772564954177',NULL,NULL,NULL,NULL,NULL,'625293093379414',