sted Accountings, Spousal Rights Proceedings, Kinship Proceedings and Will or Trust Construction Proceedings.  He is also a Certified Public Accountant and does extensive Estate Planning and Asset Protection Planning, estate tax returns, and lifetime tax planning to minimize estate, gift and income taxes.  Mr. Gobes is also experienced in Elder Law issues, including Medicaid Planning to preserve assets from creditors and obtain eligibility for Medicaid.\n\nPosted 10/19','1332079500708106','https://ddw-law.com/',NULL,'FJG@ddw-law.com ',NULL,'1113969124035608',NULL,NULL,NULL,NULL,NULL,'1134227467027004',NULL,NULL,NULL,'577989079245013',NULL,NULL,NULL),(256,943110471144785,'Outreach Rehab',NULL,NULL,'From their website: \"Physical therapy available in home and in clinic; serves at-home patients in Manhattan, Brooklyn, Queens, The Bronx, Staten Island, and sections of Westchester, Long Island, and New Jersey. Specializes in working with older adults and those who are memory impaired (Alzheimer\'s/Dementia). Accepts most private insurance plans, Medicare, and Medicaid. Call to find out if they are providers for your insurance company. As of 2019, they have expanded the insurance companies they accept.\"','610153413804808','https://www.outreach-rehab.com',NULL,NULL,NULL,'1231611168158959,1216469255274749,974772564954177,1180772910179038',NULL,NULL,NULL,NULL,NULL,'1215145454093529',NULL,NULL,NULL,'585932117908090',NULL,NULL,NULL),(257,948367373720465,'Zingone Brothers',NULL,NULL,'Groceries delivered, order by phone. Closes at 8:30 pm; $15 minimum, $3 delivery charge + tip. Call to confirm cost and hours.','1290136263628762',NULL,NULL,NULL,NULL,'576332581803815',NULL,NULL,NULL,NULL,NULL,'1279201818719608',NULL,NULL,NULL,'925876632155711',NULL,NULL,NULL),(258,900945105670007,'City Bar Justice Center',NULL,NULL,'Legal advice and information for low-income people ($30,000-$33,000/year and under), also assists with Wills.','1054009623484835','https://www.citybarjusticecenter.org/',NULL,NULL,NULL,'1107228321502442',NULL,NULL,NULL,NULL,NULL,'615101595981944',NULL,NULL,NULL,'576836909180419',NULL,NULL,NULL),(259,903542893725418,'David Glasser, Esq. ',NULL,837950749684324,'Elder law attorney. No voicemail box. \nPosted 10/19','697792075855911','https://www.kblaw.com/',NULL,NULL,NULL,'1113969124035608',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1125385347700340',NULL,NULL,NULL),(260,920126034768237,'Meals on Wheels',NULL,NULL,'Meals on Wheels America is the leadership organization supporting the more than 5,000 community-based programs across the country that are dedicated to addressing senior isolation and hunger.\n\nPosted 10/19',NULL,'https://www.mealsonwheelsamerica.org',NULL,NULL,NULL,'1340645838393358',NULL,NULL,NULL,NULL,NULL,'1150237501401072,1100778836903343',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(261,931597784049100,'Access-A-Ride Paratransit Service',NULL,1203684249168258,'Fares are the same as full fare on public transit. Show the driver your AAR MetroCard/ID and pay the exact fare as you board the vehicle. Personal Care Attendant (PCA) ride free of charge. Provides service in NYC and within a three-quarter-of-a-mile corridor beyond fixed-route service across the NYC borderline to nearby areas of Nassau and Westchester counties. Application process: It may take up to 21 days to process your application after your in-person assessment. A subscription service is available if you travel to the same places at the same time of day at least once each week. You are eligible for Access-A-Ride if you have a disability that prevents you from using the public buses or subways. We will review your application, any medical documentation you provide, and ask you to undergo an individualized assessment. During the assessment, we will ask you to demonstrate whether you can: go up or down subway stairs; travel to a subway or bus station; get on, ride, and exit a subway or bus; and ride or navigate the bus or subway system independently. Evaluating your ability to do these things will help us determine if you are eligible for conditional or full Access-A-Ride services. We will also evaluate your gait, balance, endurance, strength, range of motion, and, if applicable, assess whether you have any cognitive or psychological conditions that may prevent you from using the bus or subway. The price is the same as full fare on public transportation.','1127417998150498','http://web.mta.info/nyct/paratran/guide.htm',NULL,NULL,NULL,'977021400698839',NULL,NULL,NULL,NULL,NULL,'683380469787237',NULL,NULL,NULL,'880683347691640',NULL,NULL,NULL),(262,945766243299466,'New York Legal Assistance Group (NYLAG) Tenants\' Rights Unit (TRU)',NULL,NULL,'Referrals can be made to TRU for someone facing an eviction proceeding in Housing Court if they have a household income under 200% of federal poverty with predicate notice for a case in Housing Court, an existing case in Housing Court, or a NYCHA Termination of Tenancy proceeding at 250 Broadway and live in the following zip codes: Manhattan-10025, 10026, 10027, 10031, Bronx-all zip codes, Brooklyn-11216, 11221, 11225, 11226, Queens-11433, 11434, 11373, 11385. Use the form in the link below.  \n\n','1111363156492390','https://nylagtru.wufoo.com/forms/z12fb8nc0ojkbok/',NULL,NULL,NULL,'958412510535349,1107228321502442',NULL,NULL,NULL,NULL,NULL,'855994602259755',NULL,NULL,NULL,'1051327225532970',NULL,NULL,NULL),(263,948585532288707,'Benefits for Low Income Older Veterans',NULL,1117544787317199,'From their website: \"For Veterans age 65 or older, or totally and permanently disabled, or a patient in a nursing home receiving skilled nursing care, or receiving Social Security Disability Insurance, or receiving Supplemental Security Income. Veterans can apply for the Veteran Pension by filling out and submitting  the VA’s  “Application for Pension” Form (VA Form 21P-527EZ ) online.\"','1169437838038555','https://www.vets.gov/pension/application/527EZ/introduction',NULL,NULL,NULL,'629629464544