,NULL,'1281053011320920',NULL,NULL,NULL),(279,954023388602377,'The Bridge-Behavioral Health Supportive Housing ',NULL,683554445282456,'Permanent supported housing for the needs of homeless and housing-insecure single adults who are diagnosed with behavioral health disabilities (not available for couples and families). They provide medical and psychiatric care, substance abuse treatment, day programs, social groups, benefits assistance, referrals, and 24/7 emergency on-call coverage. Locations in Brooklyn, Manhattan, and the Bronx. The Bridge also provides shelters and transitional housing. In order to apply for Bridge housing, you must mail a completed HRA 2010E application to their intake office at The Bridge, Attn: Residential Intake, 290 Lenox Avenue, 3rd Floor, New York, NY 10027. Application can be found on their website or by calling their residential intake department at (212) 663-3000 x 2042. ','913636271742890','https://www.thebridgeny.org/permanent-housing',NULL,NULL,NULL,'1112870426305700,958412510535349',NULL,NULL,NULL,NULL,NULL,'695359446743151',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(280,975926084391336,'God\'s Love We Deliver',NULL,NULL,'Home delivered meals for those with a life-altering illness such as HIV/AIDS, cancer or Alzheimer\'s disease who has difficulty shopping or cooking. Individuals must be living with a serious illness, have some restrictions in activities of daily living (such as difficulty standing or walking), and be able to get doctor’s verification of these limitations. They provide services regardless of income. They cannot accommodate soy allergies, or gluten-free, Kosher, Halal, or vegan diets. For more information, see their website for required forms and frequently asked questions. ','1239900630913830','https://www.glwd.org/',NULL,'clientservices@glwd.org',NULL,'935600275247423',NULL,NULL,NULL,NULL,NULL,'893125492502334',NULL,NULL,NULL,'1125333797037324',NULL,NULL,NULL),(281,979417828619065,'Alzheimer\'s Foundation of America Help