transitional support, caregiver support, etc. ','639358112057591','https://www.liveconnectedny.com/',NULL,'Info@LiveConnectedNY.com',NULL,'867375223184816',NULL,NULL,NULL,NULL,NULL,'1155504022654867',NULL,NULL,NULL,'1014326083250530',NULL,NULL,NULL),(285,958378597630637,'NY Presbyterian Allen Hospital-Geriatric Medicine and Aging',NULL,746413696580983,'Provides older adults with medical, functional, cognitive, and psychosocial care, as well as other support services to promote optimum health in later years. Also provide support for the caregivers of older adults.','931582777310299','https://www.nyp.org/allenhospital/clinical-services/geriatric-medicine-and-aging',NULL,NULL,NULL,'1231611168158959,1216469255274749',NULL,NULL,NULL,NULL,NULL,'772475517737224',NULL,NULL,'1279646516246165','847299608162037',NULL,NULL,NULL),(286,968750120031739,'Carnegie East House',NULL,NULL,'\"Independent living facility that provides three meals a day, lunch and dinner are served in a dining room. Daily activity schedule (exercise, music, art, knitting, games, etc.) and a movie every evening. Nurse on staff 7 days/week.\"','657058046178022','www.carnegieeast.org',NULL,NULL,NULL,'924951065612317,973172406940749',NULL,NULL,NULL,NULL,NULL,'902693294493922',NULL,NULL,NULL,'841739048661639',NULL,NULL,NULL),(287,969334564157765,'Caring Kind Support Groups',NULL,1208496140131985,'\"Support groups led by trained facilitators, provide caregivers with the opportunity to discuss the many challenges of caring for a family member with Alzheimer’s disease and related dementias, with others who understand in a safe setting.\"','1305801150608564','www.caringkindnyc.org/',NULL,NULL,NULL,'1253061813300180,1106914314143204,1285075174713673',NULL,NULL,NULL,NULL,NULL,'956534176099290',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(288,972427762093304,'Victoria Home',NULL,NULL,'Victoria Home offers skilled nursing and rehabilitative care, with three floors for distinct populations--those who need medical supervision, those with cognitive and memory impairment, and higher-functioning residents with a need for supervision. Physical, speech, and occupational therapy are available to residents, as well as medical specialty services like psychiatry and ophthalmology. Short term rehab is available. \n\nPosted 11/19','595064597195326','www.victoriahome.org',NULL,NULL,NULL,'628102384928895,1132943173487126,1203572911800812,919422912164535',NULL,NULL,NULL,NULL,NULL,'1076181560621156',NULL,NULL,NULL,'1082260931219609',NULL,NULL,NULL),(289,989465534703814,'SPOP-Bereavement Support',NULL,NULL,'From their website: \"All services are free and require advance registration; specialized groups for adults of all ages, in either spousal/partner loss or non-spousal loss.  The groups are led by peer volunteers and are supervised by a clinical social worker.  All participants receive an initial interview.\"','949267746005326,1103853766303408','www.spop.org/services/bereavement-support',NULL,NULL,NULL,'929538948830045,1112870426305700',NULL,NULL,NULL,NULL,NULL,'676510645754972',NULL,NULL,NULL,'985773791212519,681067203306557',NULL,NULL,NULL),(290,993169000253343,'Integrity First Senior Care',NULL,597271686066226,'From their website: \"Dementia care & behavior management-serve 5 boroughs, Long Island, and Westchester, 24/7 caregiver availability, weekly social worker visits (optional), weekly care coordination staff meetings, client caregiver and family communication coordination.\"','1013220570111211','www.integrityfirstseniorcare.com',NULL,' info@integrityfirstseniorcare.com',NULL,'687567198750084,1285075174713673',NULL,NULL,NULL,NULL,NULL,'883263717367666',NULL,NULL,NULL,'1071300229733977',NULL,NULL,NULL),(291,996610450738423,'Quest',NULL,972885671373948,'Communal learning experience for retired and semi-retired adults, yearly membership fee.','1217681524389715','www.questlifelong.org',NULL,'quest@ccny.cuny.edu',NULL,'972558970458700',NULL,NULL,NULL,NULL,NULL,'1157976166655266',NULL,NULL,NULL,'1218631779189339',NULL,NULL,NULL),(292,996390991012954,'Sprain Brook Manor Rehab',NULL,NULL,'Long-term skilled nursing care entails personal and medical care, as well as financial and appointment-scheduling assistance. Caregiver respite is also offered for several days or weeks at a time. The community has a dedicated floor for dementia care. Rehabilitation services include physical, speech, and occupational therapy as well as wound care, nutrition care, neuro-rehabilitation, amputee rehabilitation, and stroke/traumatic brain injury care. \n\nPosted 11/19','1066868685819547','www.sprainbrookmanor.com',NULL,'Info@sprainbrookmanor.com',NULL,'628102384928895,1132943173487126,1310065103612125,919422912164535',NULL,NULL,NULL,NULL,NULL,'1301264151637551',NULL,NULL,NULL,'1154024784856396',NULL,NULL,NULL),(293,996978647034058,'Daily Administrative Solutions, LLC                         ',NULL,NULL,'Mary Ellen McMahon, PDMM, CSA; Daily money management and organizational services which provides: professional organizational support services, internal control and risk management, financial, medical, insurance and legal paperwork filing, budgeting services, senior support, bill payment. Makes home visits and currently serves Westchester County and New York City (areas on the upper East and West sides from 72nd Street to 97th Street, but will occasionally travel out of that area if needed).','1194742704355343','www.dailyadminsolutions.com ',NULL,'MaryEllen@DailyAdminSolutions.com',NULL,'787387982275890,933400397911972',NULL,NULL,NULL,NULL,NULL,'1046579848633446',NULL,NULL,NULL,'1273408793792622',NULL,NULL,NULL),(294,1002410857742730,'Sephardic Bikur Holim',NULL,NULL,'Case management, home delivered meals, onsite programs, Friendly Visiting, volunteer programs.','1144582006781050','https://sbhonline.org/',NULL,'contactus@sbhonline.org',NULL,'822552305363624,1177309407177568,935600275247423,843777382088472,819444632829102',NULL,NULL,NULL,NULL,NULL,'596667983541781',NULL,NULL,NULL,'757844905415851',NULL,NULL,NULL),(295,1003786558207276,'Homebound Program-Visiting Eye Doctors',NULL,573763280689069,'To refer a senior, call or send a fax to (212) 938-4037, Attention: \"Homebound\" with seniors\' contact information and note if the senior is making the appointment or if a home care aide, family member, or friend will be making it on their behalf. The doctor associated with the senior’s borough will contact them directly to discuss scheduling and insurance. Serves Manhattan (Dr. Brian Wolynski), Queens (Dr. Sander Levine), and the Bronx (Dr. Merola). As of July 2019, there is approximately a one month wait list. \n\n','851910950581372','www.sunyopt.edu/',NULL,NULL,NULL,'1231611168158959,1216469255274749,640572958670163,1291763496785325,1180772910179038',NULL,NULL,NULL,NULL,NULL,'638529849307873',NULL,NULL,NULL,'1104596038483369',NULL,NULL,NULL),(296,1008729707951032,'NYC Free Clinic-NYU Langone',NULL,641039972249743,'The only requirement to receive care at the NYCFC is that you must be an uninsured adult age 18 or older. Comprehensive Free Health Services Provided by the NYCFC: basic primary care, patient education, disease prevention and screening physical exams, women\'s health, including gynecological care, men\'s health, vaccinations, sexually transmitted infection testing (including HIV), laboratory testing, and specialty referrals for: colon cancer screening, optometry appointments (including a free pair of glasses), dental cleaning, screening to help you qualify for Medicaid, Family Health Plus, or similar free public insurance programs. We can also fill out your physical exam forms for employment, college, or special programs. If you need to see a specialist for further care, we will refer you to the appropriate clinic at Bellevue Hospital Center. This will not cost you anything, even if you require such procedures as outpatient surgery or MRI. Unable to provide: pre-natal care, emergency room visits, inpatient hospital stays, and inpatient surgeries. All services provided by the clinic are free of charge to patients. The only fee that may be associated with a patient visit is a small co-pay for prescription medications ($15 for generic medications; $40 for brand-name medications). All new patients must be seen by a social worker at 17th Street to look at their eligibility for the NYC Free Clinic. We are able to make referrals to specialists when appropriate. Be sure to specify with whomever answers the phone that you want to make an appointment at the Free Clinic. ','1175576207766753','http://nycfreeclinic.med.nyu.edu/information-for-patients/health-services',NULL,NULL,NULL,'1216469255274749,580054623534909',NULL,NULL,NULL,NULL,NULL,'1087859967431879',NULL,NULL,NULL,'1087856586655286',NULL,NULL,NULL),(297,947602730181472,'The LOFT',NULL,NULL,'LGBT Community Services Center','790643855631022','http://www.loftgaycenter.org',NULL,NULL,NULL,'772331273438770,843736851227742',NULL,NULL,NULL,NULL,NULL,'827773988341436',NULL,'956382500944486',NULL,'584016107409645',NULL,NULL,NULL),(298,957006601039577,'Tarrytown Hall Care Center',NULL,NULL,'Tarrytown Hall offers short-term, long-term, and post-acute rehabilitative care. Long-term care encompasses hospice, palliative, and comfort care, as well as complex medical care, physician services, wound management, and more. Short-term and post-acute rehabilitation involve speech, occupational, cardiac, and physical therapy. When it is time to return home, Tarrytown Hall conducts a home evaluation and education in health management for both patients and families. \n\nPosted 11/19','951650456709182','tarryhallcc.com/',NULL,'info@tarryhallcc.com',NULL,'628102384928895,1203572911800812',NULL,NULL,NULL,NULL,NULL,'876287907378547',NULL,NULL,NULL,'975880985977704',NULL,NULL,NULL),(299,973449365320986,'Folk Art Reflections',NULL,955622586982489,'This interactive and discussion-based program for individuals with Alzheimer’s and their family members or care partners brings the world of folk art to life through conversation. Museum admission and program are free. Registration is required. Stools are provided. First Thursday of every month, for two hours in the afternoon (call or check website for exact time and to confirm schedule).','798884023152639','https://folkartmuseum.org/visit/community-access/',NULL,'info@folkartmuseum.org',NULL,'1285075174713673,1253061813300180,1106914314143204,1269324491810499',NULL,NULL,NULL,NULL,NULL,'643602752860332',NULL,NULL,'892852317575485','1075021839151446',NULL,NULL,NULL),(300,974287302949940,'The Hunter Helpers Program',NULL,1146302104644001,'From their website: \"Service that helps meet the needs of local community members while also providing Hunter students with productive work opportunities. Currently, Hunter Helpers offers the following services: babysitting, dog walking, party assistance, student tutors, and miscellaneous errands. Hunter Helpers is an efficient and safe way to find a Hunter College student for desired services. Our program provides clients with the opportunity to hire a student who will best meet their needs. We do not share a client’s personal information with anyone. \n1. A client submits a Client Request for Service Application\n2. The Hunter Helpers Program Coordinator sends out a listing to all Hunter students that are registered to the Hunter Helpers Program.\n3. The contact information of the first seven to eight qualified students who respond to the job listing is sent to the client.\n4. At this time, the client may contact individual students for additional information or to schedule interviews.\"','648331108535405','http://www.hunter.cuny.edu/hunterhelpers',NULL,NULL,NULL,'960167769062265,1123433776824532',NULL,NULL,NULL,NULL,NULL,'1303043107416631',NULL,NULL,NULL,'823469849479465',NULL,NULL,NULL),(301,978445788308044,'SCRIE Applications',NULL,1214714975774557,'From their website: \"Helps those eligible stay in affordable housing by freezing their rent. Under this program, a property tax credit covers the difference between the actual rent amount and what you (the tenant) are responsible for paying at the frozen rate.\" ','1288663874713279','www1.nyc.gov/site/rentfreeze/index.page',NULL,NULL,NULL,'629629464544122',NULL,NULL,NULL,NULL,NULL,'1073121644830879',NULL,NULL,NULL,'1233616024213429',NULL,NULL,NULL),(302,973895344752904,'Caregivers\' Support Group',NULL,1155578608136431,'Onsite spousal support group, led by staff social worker. Meets every other Tuesday from 10 am- 11:30 am. In order to participate: a caregiver must be met with and interviewed to determine if this is the right group for them.','1216774939834028','www.dorotusa.org',NULL,NULL,NULL,'673898301722674,633482549261197',NULL,NULL,NULL,NULL,NULL,'1250724514805056,617362673503677',NULL,NULL,'942885369302412','967252529008278',NULL,NULL,NULL),(303,976059090412861,'Patient Advocacy',NULL,NULL,'Helps people with legal, financial matters, and insurance issues.','639102412444286','http://www.patientadvocate.org',NULL,NULL,NULL,'1107228321502442,1267306776036445',NULL,NULL,NULL,NULL,NULL,'901148841807055',NULL,NULL,NULL,'1014326083250530',NULL,NULL,NULL),(304,986841453942316,'NORC at Franklin Plaza Transportation Program',NULL,1331740916278162,'From their website: \"Only for residents of Union Settlement NORC (Naturally Occurring Retirement Community) at Franklin Plaza: provides East Harlem seniors with an array of trips for necessities, such as visiting the pharmacy or the bank, and group recreational excursions. The program enhances many aspects of our senior center programming, enabling us to take seniors to activities, employment or volunteer work sites, and computer classes.\"','907033924866942','https://unionsettlement.org/senior-services-2/',NULL,'mkane@unionsettlement.org',NULL,'1119801442928622',NULL,NULL,NULL,NULL,NULL,'535281932780337',NULL,NULL,NULL,'1335664010716628',NULL,NULL,NULL),(305,1002539410164798,'Project Lifesaver',NULL,1273704954905898,'This free program uses radio-frequency technology to find seniors who wander and safely return them home. It works through bracelets with special batteries the seniors wear on their wrists. Should someone become lost, specially trained and equipped county police officers can locate them by tracking a radio signal the bracelets transmit. \n\nTo be eligible a senior must: live in Westchester County, be dependent upon the person they live with, and have a tendency to wander. \n\nPosted 10/19',NULL,'https://seniorcitizens.westchestergov.com/project-lifesaver-program',NULL,NULL,NULL,'919422912164535,1240800274587016',NULL,NULL,NULL,NULL,NULL,'886259932932849',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(306,1006993435364446,'Call Eric-Senior Living Advisors',NULL,NULL,'From their website: We assist family members in need of the most cost effective and appropriate senior living solutions. We offer peace of mind and comfort for families exploring the daunting task of selecting a senior living community for your loved one!\nEric Leopold is recognized as a compassionate and practical advocate who works tirelessly on behalf of his clients to efficiently navigate senior living options in the greater NYC and Northern NJ area.',NULL,'https://www.callericnyc.com/',NULL,'eric@callericnyc.com',NULL,'924951065612317,973172406940749,958412510535349',NULL,NULL,NULL,NULL,NULL,'752597891007290',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(307,1011356421691750,'Visiting Eyecare Service',NULL,NULL,'Primarily services assisted living communities on a monthly basis. Waiting list available for individuals. ',NULL,'www.visitingeyecareservice.com',NULL,'sfichtenbaum@visitingeyecareservice.com',NULL,'772331273438770,596815169700397',NULL,NULL,NULL,NULL,NULL,'1120919380526368',NULL,'1245397176661153',NULL,NULL,NULL,NULL,NULL),(308,1015248296665509,'Weissman Wellness-Private Geriatric Care Managers',NULL,NULL,'A bio-psychosocial assessment is conducted during the first visit. Which includes an assessment which may include topics of: home safety, personal health, finances, family, health and disability, referrals and resources, and advocacy. Staff of three social workers, serving New York City and surrounding areas.  ','715722795689361','https://weissmanwellness.com/welcome',NULL,'JYWeissman@weissmanwellness.com',NULL,'867375223184816',NULL,NULL,NULL,NULL,NULL,'585948259856560',NULL,NULL,NULL,'634343981221907',NULL,NULL,NULL),(309,958830272820132,'Lenox Hill Neighborhood House Caregiver Program',NULL,631176636895026,'The Neighborhood House’s Caregiver Program offers a variety of services to those providing care for family members and friends in Community Districts 8-12, covering the East Side of Manhattan from 59th Street to 143rd Street, and the West Side from 110th Street through 220th Street. The Caregiver Program provides caregivers of any age with a variety of services to help them in caring for family members and friends. The program is designed to support the “caregiving dyad” – the giver of care and the receiver of care – so that the relationship can thrive amidst changing roles and experiences. Our team provides individualized assistance to caregivers, offering supportive counseling and help accessing government benefits and entitlements. This counseling can take place in person, over the phone or via video conference. We also facilitate educational events, meaningful programming and support groups provided at Lenox Hill Neighborhood House, Saint Peter’s Church, our Casa Mutua residence in East Harlem and other community partnership sites. The Caregiver Program offers respite care through homecare agencies and certain supplemental services, such as referrals and linkages to other service providers. Caregiver Program clients can include:\nAdults 18 and older providing unpaid care for an older adult age 60 or older, Adults 18 and older providing unpaid care for an adult with dementia or a related disorder, Older adults 55 and over caring for a family member of any age with a disability, Older adults 55 and over caring for 1 or more family members who are 18 and younger.','846978082571709','https://www.lenoxhill.org/caregiverprogram',NULL,'caregiver@lenoxhill.org',NULL,'673898301722674',NULL,NULL,NULL,NULL,NULL,'1264021858316678',NULL,NULL,NULL,'886489022858841',NULL,NULL,NULL),(310,973283373638716,'BJCC Social Services',NULL,1012799890178120,'Our social work staff works tirelessly to help Bronx residents to their best of their abilities by offering services that will help them remain independent and enhance their day to day lives. The services we offer include but are not limited to the enrollment and renewal of:\nSCRIE/DRIE, food stamps, Medicare/Medicaid, referral to legal services, domestic violence assistance, Meals on Wheels, etc., Social Security and SSI, Wills, Healthcare proxy, power of attorney, pre-needs burial, eviction prevention, emergency assistance. For more information please call Judy Uman. ','974394276299688','http://www.bjcconline.org/bjcc-social-services/#services',NULL,'info@bjcconline.org',NULL,'629629464544122,652340976007902,809388330706262',NULL,NULL,NULL,NULL,NULL,'1106998623147083',NULL,NULL,NULL,'1001571259127620',NULL,NULL,NULL),(311,978542226224129,'LINC Program',NULL,624181297725741,'Provides people with memory impairment and their paid caregivers with a 3 hour recreation/activities program on Wednesdays and Fridays, from 11:30 am-2:30 pm. Program includes cognitive activities, discussion, music and movement, and a light lunch. Participants are screened by their ability to relate to others, to participate in activities & function in a group. Family members usually visit the program prior to enrolling their family member and discuss its appropriateness with Project Coordinator or NCJW NY’s Licensed social worker. ','1215220468003380','www.ncjwny.org/programs/council-lifetime-learning/',NULL,NULL,NULL,'1253061813300180,1106914314143204,1285075174713673',NULL,NULL,NULL,NULL,NULL,'1265742756878280',NULL,NULL,NULL,'610198700266791',NULL,NULL,NULL),(312,983724775330511,'Judith Moves You, LLC',NULL,NULL,'Assists with senior relocation: seniors who are downsizing and moving within, into or out of New York, aging in place: seniors who are trying to de-clutter, re-organize or remodel their homes, (also assist family or friends who are trying to help a senior do any of the above). Clean outs: family or Estate administrators who are emptying a residence, and de-cluttering and organizing for people of all ages who need assistance in reorganizing and de-cluttering their home. Judith Kahn, owner.','757284011414339','www.judithmovesyou.com',NULL,'judith@judithmovesyou.com ',NULL,'796847632116140,941628219469820,921879558738272,788089004816800',NULL,NULL,NULL,NULL,NULL,'1261932232003907',NULL,'1329195914627408',NULL,'1014326083250530',NULL,NULL,NULL),(313,1009071486136000,'Alix Keast Asian Bodywork Therapy',NULL,NULL,'Alix Keast is a New York state licensed Asian bodywork therapist. Her holistic healing techniques are based on Chinese medicine. She is available to do home visits. Call for rates and details. ','920496643985127',NULL,NULL,'alixk3@gmail.com',NULL,'1216469255274749,1180772910179038',NULL,NULL,NULL,NULL,NULL,'1095269292577030',NULL,NULL,NULL,'1140382000773621',NULL,NULL,NULL),(314,1011564237134068,'Suffolk County Office for the Aging',NULL,NULL,'From their website: The Suffolk County Office for the Aging is the designated Area Agency on Aging under the Older Americans Act. For over 40 years, Suffolk County Office for the Aging has administered federal, state and county programs for persons 60 years of age and older. ','908550270700425','http://suffolkcountyny.gov/aging/Home.aspx',NULL,'aging.office@suffolkcountyny.gov',NULL,'681957604814502',NULL,NULL,NULL,NULL,NULL,'607877624783567',NULL,NULL,NULL,'1095816088989594',NULL,NULL,NULL),(315,1016014367664720,'NJ 211',NULL,NULL,'Resource line for the state of NJ.','1015664270793156','www.nj211.org/',NULL,NULL,NULL,'1050752555762937',NULL,NULL,NULL,NULL,NULL,'810123228985916,629922880313428',NULL,NULL,NULL,'1014326083250530',NULL,NULL,NULL),(316,1019271628141270,'Fairway Market',NULL,NULL,'\"The delivery fee depends on the size of your order and the delivery time that you choose. The fee for each delivery will be displayed when selecting a delivery window during checkout, before you place your order. All orders must be $10 or more. With Instacart Express, you will have no delivery fee on all orders over $35.  Service fees may still apply. Busy Pricing-When we experience high demand for a delivery time, a Busy Pricing delivery fee may apply. Order online.\"','925045348119313','https://shop.fairwaymarket.com/',NULL,NULL,NULL,'576332581803815',NULL,NULL,NULL,NULL,NULL,'808824491098820',NULL,NULL,NULL,'1198876725681383',NULL,NULL,NULL),(317,1018304386123440,'Home Sharing Program',NULL,1307648044870350,'From their website: \"The Foundation’s free Home Sharing Program helps link adult “hosts” with extra private spaces in their homes or apartments with appropriate adult “guests” (18+) to share their space. One of the \"matchmates\" must be age 60 or older. The program also serves adult “hosts” age 55 or older, who are interested in sharing with developmentally disabled adult “guests” capable of independent living; They require the following information from the person looking for housing:\n-a copy of their ID\n-proof of income\n-three professional references\nAfter they receive the items above, they will schedule an in-office \"guest assessment\" interview.\"','1257554801869010','http://www.nyfsc.org/home-sharing',NULL,NULL,NULL,'958412510535349',NULL,NULL,NULL,NULL,NULL,'601033511673332',NULL,NULL,NULL,'1278869071563581',NULL,NULL,NULL),(318,1023269865456427,'Music and Memory at The Library',NULL,995490616087586,'A personalized music playlist can increase participation in the activities of daily living and positively impact the lives of people living with Alzheimer\'s or Dementia. Westchester Library System offers a free music workshop explaining the program, which reviews the impact of music on those with dementia or Alzheimer’s, explains the key principles for music selection, provides a hands-on with the recommended equipment (Apple Shuffle and over the ear headphones), and offers a tutorial on how to import music into the music player through iTunes and Freegal. \n\nPosted 10/19',NULL,'https://www.westchesterlibraries.org/services-programs/music-and-memory/',NULL,'musicandmemory@wlsmail.org',NULL,'919422912164535',NULL,NULL,NULL,NULL,NULL,'912638954636468',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(319,1030622078351947,'COHME Home Care ',NULL,NULL,'COHME is a non-profit licensed home care agency. They provide a social work case manager at no additional cost. COHME offers both short-term and longer-term home care. Their home care aides are certified by the New York State Department of Health and insured with both liability insurance and worker’s compensation. After an initial free consultation assessment, a contract with costs will be provided. They accept most long-term insurance policies. Services are available throughout the five boroughs and in facilities. There is a minimum of 12 hours per week.','1304242157916147','http://cohme.org',NULL,'referrals@cohme.org',NULL,'687567198750084',NULL,NULL,NULL,NULL,NULL,'1343620072066533',NULL,NULL,'817495263043617','1087857000507783',NULL,NULL,NULL),(320,1027708035218368,'Moravian Open Door',NULL,NULL,'Transitional housing for people 50+. Fee of $355 a month. Provides cooked meals, breakfast, and a community kitchen if residents want to cook for themselves.','652846980119110','www.moravianhouse.org',NULL,'info@moravianhouse.org',NULL,'958412510535349',NULL,NULL,NULL,NULL,NULL,'840861869098190',NULL,NULL,NULL,'1154833038190907',NULL,NULL,NULL),(321,1034714837064169,'Positive Approach to Care',NULL,NULL,'Making use of the skills retained while providing support, and substituting our skill, for what is no longer available.',NULL,'www.teepasnow.com',NULL,NULL,NULL,'919422912164535',NULL,NULL,NULL,NULL,NULL,'845667724048469',NULL,'893607935258324',NULL,NULL,NULL,NULL,NULL),(322,1048073097826454,'Medical Car Service-Staten Island',NULL,1080455316194634,'Medical car service for transportation to medical appointments with car or passenger van, free of charge, although it is recommended that the driver is tipped. Monday-Friday, 9 am-4 pm. Senior must be ambulatory, no assistance needed to get in and out of the car, not eligible if they have Access-A-Ride or Medicaid. For appointments on Staten Island only.','1257258200052106','www.nyconnects.ny.gov/providers/community-agency-for-senior-citizens-sofanya438775',NULL,NULL,NULL,'977021400698839',NULL,NULL,NULL,NULL,NULL,'1298787850072910',NULL,NULL,NULL,'1252749671502531',NULL,NULL,NULL),(323,1048854514088248,'Community Advisory Program for the Elderly',NULL,972206871064772,'\"Outpatient Mental Health Clinic for persons aged 50 and over and their families. CAPE offers individual, group and family therapy, psychiatric evaluations and medication monitoring for both clinic and homebound older adults. Children of elderly parents, and family members or caregivers of persons with dementia may attend family treatment and caregiver support groups in Western Queens, also has satellite clinics throughout Queens.\"','1187832497139645','http://www.sfy.org/community-mental-health-services/',NULL,'cape@sfy.org ',NULL,'1112870426305700,953560938102102',NULL,NULL,NULL,NULL,NULL,'608470356007064',NULL,NULL,NULL,'847202526157524',NULL,NULL,NULL),(324,1055519380545303,'Legal Services of Hudson Valley Elder Law',NULL,NULL,'Attorneys assist low-to-moderate income seniors with limited resources who are age 60 and older with housing preservation/advocacy, government benefits, advance directives, elder abuse, consumer rights, and family law.\n\nPosted 11/19',NULL,'www.lshv.org',NULL,'info@lshv.org',NULL,'1113969124035608,1108954480265575',NULL,NULL,NULL,NULL,NULL,'873456857737136',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(325,1062153066405804,'West 74th Street Residence',NULL,NULL,'From their website: \"Supportive residential community that offers furnished private rooms with either private or shared baths at all-inclusive monthly fee includes full meal service, housekeeping, laundry service, personal care, medication supervision, recreation activities, in-room emergency response system, 24-hour security and supportive social services.\"','576841584988669','http://www.w74street.org/',NULL,'istulbaum@wsfssh.org',NULL,'924951065612317,973172406940749',NULL,NULL,NULL,NULL,NULL,'866347305381033',NULL,NULL,NULL,'1227943396386455',NULL,NULL,NULL),(326,1059132691483980,'NCJWNY Hunger Program-Food Pantry & Community Kitchen',NULL,1072206441861633,'Food Pantry: Three-day emergency supply of fresh produce and shelf-stable groceries. Open Mondays, 10 am-2 pm. Participants must live in Manhattan and can utilize the pantry once a month. Bring a form of ID. Community Kitchen: available twice a week and provides a hot, delicious meal to all who need it. Patrons of the Community Kitchen sit down to a hot meal or, alternatively, may take away a brown-bag meal.  Meals are served on Wednesdays at 4:30 pm and on Sundays at 11:30 am. All are welcome at the Community Kitchen, and guests can come as often as they like. Call Rita at 212-687-5030 x 463 for more information. ','1215220468003380','https://www.ncjwny.org/programs/#hunger',NULL,NULL,NULL,'886323941641619',NULL,NULL,NULL,NULL,NULL,'1232830346900935',NULL,NULL,NULL,'610198700266791',NULL,NULL,NULL),(327,1064416562781796,'Senior Employment Services',NULL,888043339536150,'From their website: \"SESU has decades of experience placing older adults in jobs in data processing, administrative work, customer service, security services, airport services, home care, and other fields. Participants must be 55+, unemployed, Have a family income of no more than 125 percent of the federal poverty level, and be willing to learn new skills. SESU prepares trainees for employment through classes on computers, customer service, job-search techniques, resume-writing, and interviewing. SESU also offers on-the-job training and the opportunity to earn at least the minimum wage through placements at government agencies and nonprofits throughout the City. Trainees meet regularly with career counselors to discuss their goals, progress, and concerns. Job fairs, employer referrals, and placement assistance help trainees find permanent employment. When calling 311, ask for senior employment services.\"','958723662532876','http://www1.nyc.gov/site/dfta/services/senior-employment.page',NULL,NULL,NULL,'910325259072395',NULL,NULL,NULL,NULL,NULL,'1147137912993809,1037912257872015',NULL,NULL,NULL,'1070330298015311',NULL,NULL,NULL),(328,1068891505670696,'LawHelp/NY',NULL,NULL,'From their website: \"LawHelp.org/NY is an online resource for low-income New Yorkers seeking pro-bono legal assistance. Find help on issues such as housing, immigration, family & juvenile, identity theft, taxes, consumer, public benefits, health and more! Featuring thousands of resources in over 39 languages, an instructional video and a mirror site in Spanish. Free trainings available.\"','782149586652509','www.LawHelp.org/NY',NULL,NULL,NULL,'1107228321502442,1113969124035608',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1014326083250530',NULL,NULL,NULL),(329,1069306229646938,'Homes & Community Renewal',NULL,681001153698761,'Opportunities to apply for affordable rental units (housing lotteries).','616409853051315','www.nyshcr.org/Topics/Home/Renters/OpportunitiestoApplyforAffordableRentalUnits.htm',NULL,NULL,NULL,'958412510535349',NULL,NULL,NULL,NULL,NULL,'697045803232147',NULL,NULL,NULL,'1014326083250530',NULL,NULL,NULL),(330,1083613518301428,'Bereavement Services',NULL,885037917812884,'Free of charge support services for bereaved individuals living in Westchester and Putnam counties. Includes individual and family counseling, support groups, workshops, community outreach, and annual memorial services. \n\nPosted 11/19','1166207938511913','www.vnahv.org',NULL,NULL,NULL,'1328687994347219',NULL,NULL,NULL,NULL,NULL,'1241503625460855',NULL,NULL,NULL,'1240025787417203',NULL,NULL,NULL),(331,1086299176715817,'Resources and Services',NULL,1273704954905898,'Posted 10/19',NULL,'https://seniorcitizens.westchestergov.com',NULL,NULL,NULL,'919422912164535',NULL,NULL,NULL,NULL,NULL,'859380000095306',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(332,1099000146341750,'BJCC Transportation Program',NULL,1012799890178120,'\"Funded through the Department for the Aging, provides services for seniors primarily in Community Board 11. This program brings seniors to doctor’s appointments, local senior centers, shopping and other neighborhood activities.\"','974394276299688','https://www.bjcconline.org/',NULL,'info@bjcconline.org',NULL,'977021400698839,652340976007902',NULL,NULL,NULL,NULL,NULL,'815184353903610',NULL,NULL,NULL,'1001571259127620',NULL,NULL,NULL),(333,1097076809752655,'University Without Walls',NULL,1155578608136431,'Offers hundreds of classes each year that appeal to a wide range of interests including the arts, history, current events, games, holidays, and more. To Your Health classes enable seniors to learn more about their health concerns from professionals in the health care field. It also connects seniors with their peers, who can provide emotional support and the benefit of experience with similar conditions. \nClasses in Russian also available. Call (877) 819-9147 to register.','1216774939834028','http://www.dorotusa.org/site/PageServer?pagename=seniors_programs_on_phone_D#.XAbt1ttKiUl',NULL,NULL,NULL,'972558970458700,1291763496785325,673898301722674,1047568246255855,633482549261197',NULL,NULL,NULL,NULL,NULL,'1250724514805056,617362673503677',NULL,NULL,'942885369302412','967252529008278',NULL,NULL,NULL),(334,1038354218312226,'Family & Children\'s Association',NULL,NULL,'Case management, senior center, friendly visiting, benefits assistance (in multiple locations); Serves community districts 1-6.','619979607803595','https://fcali.org/',NULL,NULL,NULL,'681957604814502,1177309407177568,629629464544122,819444632829102',NULL,NULL,NULL,NULL,NULL,'1192005357978080',NULL,NULL,NULL,'1321756612040863',NULL,NULL,NULL),(335,1099979209402445,'Select Care',NULL,NULL,'Serving Manhattan, Brooklyn, the Bronx and Queens since 1985.','817142703291724','https://www.selectcarenyc.com/',NULL,'info@selectcarenyc.com        ',NULL,'687567198750084',NULL,NULL,NULL,NULL,NULL,'1092096342069390',NULL,NULL,NULL,'619276585957009',NULL,NULL,NULL),(336,1102538740846775,'Foster Grandparent Program',NULL,888043339536150,'\"The Foster Grandparent Program is part of the National Senior Corps program, which offers low-income older Americans opportunities to give back to their communities. Foster grandparents are 55 or older, can give 20 hours of their time each week, volunteer at hospitals, day cares, elementary schools, after-school programs, Head Start, mentor and encourage children, help children with math, reading, and other subjects, understand that the volunteer program pays a modest stipend.\"','1134647500629924','https://www1.nyc.gov/site/dfta/volunteering/foster-grandparents.page',NULL,NULL,NULL,'910325259072395',NULL,NULL,NULL,NULL,NULL,'1037912257872015',NULL,NULL,NULL,'1014326083250530',NULL,NULL,NULL),(337,1105835732955405,'Alzheimer\'s Foundation of America-Bereavement Support Group',NULL,875087617643548,'In-person support group for those who have experienced the death of someone with Alzheimer\'s or related dementias. Group is free and open to all. Call to register. ','645252881647646','https://alzfdn.org/',NULL,NULL,NULL,'1285075174713673,1253061813300180,929538948830045,1106914314143204',NULL,NULL,NULL,NULL,NULL,'1182095960005145',NULL,NULL,NULL,'1140897431336658',NULL,NULL,NULL),(338,1102779752490307,'ClearCaptions',NULL,NULL,'Phone captioning service',NULL,'www.clearcaptions.com',NULL,NULL,NULL,'673030812970350',NULL,NULL,NULL,NULL,NULL,'863298848386112',NULL,'831044059250361',NULL,NULL,NULL,NULL,NULL),(339,1106415107832704,'The Knolls',NULL,1111398164518548,'Non-profit retirement community in Valhalla, NY. Amenities include: 30 acres of property, apartment-style living, health/wellness resources including regular doctor visits, special educational/recreational events.\n\nPosted 11/19 ','836099159017680','theknolls.org',NULL,NULL,NULL,'584503804670909',NULL,NULL,NULL,NULL,NULL,'1051160962515243',NULL,NULL,NULL,'648737750447402',NULL,NULL,NULL),(340,1111766756511196,'Search & Care Pets and Elders Together',NULL,1072887075663062,'From their website: \"For low-income, frail, pet-owning clients with animal-upkeep and hygiene, dog-walking, cat litter clean-up, light grooming, pet-play, as well as visits from friendly dogs to provide companionship to the isolated and homebound. During the holidays, volunteers deliver a signature Holiday Pet Stocking filled with goodies that clients may not be able to afford. The agency has a Veterinary Assistance Program which helps to cover expenses of emergency vet care, a Pet Fund for emergency supplies (e.g. pet food), while a Companion Animal Advocate identifies emergency contacts (family, friends, neighbors) who can care for pets in the event that the client is in distress.\" For clients of case management program, serving seniors residing in Manhattan’s Yorkville, Carnegie Hill, and East Harlem communities (catchment area is E. 86th to E.138th Streets, East River to 5th Avenue). (212) 289-5300','928811788301846','https://www.searchandcare.org/pets-and-elders-together/',NULL,'SandC@searchandcare.org',NULL,'998681432266511',NULL,NULL,NULL,NULL,NULL,'880934289187573',NULL,NULL,NULL,'841739048661639',NULL,NULL,NULL),(341,1061051775398501,'Encore Residence Housing',NULL,667859365781949,'\"These housing facilities provide safe, decent and affordable housing for low-income seniors, and contribute to the revitalization and stability of the Times Square and Clinton communities in midtown Manhattan.\"','1114084783135534','http://www.encorecommunityservices.org/',NULL,NULL,NULL,'958412510535349',NULL,NULL,NULL,NULL,NULL,'575445459932449',NULL,NULL,NULL,'971484030543087',NULL,NULL,NULL),(342,1080522328971952,'Onsite & Special Programs',NULL,1155578608136431,'Join peers for a variety of discussion groups, wellness classes, music performances and creative aging workshops. Programs take place in DOROT’s main office. Suggested Donation: $5 per class (cash or check). A doctor\'s note is required indicating it is safe for you to participate in the exercise classes.   ','1216774939834028','www.dorotusa.org',NULL,NULL,NULL,'972558970458700,1269324491810499,1288967124858351,1129506065918594',NULL,NULL,NULL,NULL,NULL,'1250724514805056',NULL,NULL,'942885369302412','967252529008278',NULL,NULL,NULL),(343,1101143968430892,'Daily Money Management',NULL,927555477423975,'From their website: The Daily Money Management (DMM) program at Greenwich House assists seniors capable of making financial decisions, yet who need help with day-to-day fiscal tasks, such as:\n-Writing checks and balancing check books\n-Going to the bank\n-Organizing bills and important paperwork\n-Monitoring monthly income and expenses to remain on a budget\n\nAssistance from the DMM Coordinator is designed to help organize finances and preserve self-sufficiency. The DMM Coordinator does not replace accountants or investment professionals. Clients make all financial decisions independently. This program is free. The coordinator is a professional with expertise in accounting, makes home visits or meets with clients at Greenwich House offices, and works with individuals to determine their needs and form an agreement outlining those terms. Eligibility: 60 or older, have the cognitive capacity to participate, live between Canal and 24th Streets in Manhattan.','729690724025147','http://www.greenwichhouse.org/cc_senior_centers/daily-money-management',NULL,'kkramer@greenwichhouse.org',NULL,'787387982275890',NULL,NULL,NULL,NULL,NULL,'1192806861685995',NULL,NULL,NULL,'799349203133143',NULL,NULL,NULL),(344,1097016824207832,'Caregiver Teleconnection',NULL,963665659669531,'Free telephone education and support program for caregivers held weekly.','914005426635301','https://caregiversos.org/caregiver-teleconnection/',NULL,NULL,NULL,'673898301722674',NULL,NULL,NULL,NULL,NULL,'616867299989130',NULL,NULL,NULL,'852404009677000',NULL,NULL,NULL),(345,1114054322349030,'Lenox Hill Neighborhood House Legal Hotline',NULL,631176636895026,'Intake hotline for assistance with the following: \n\nFind out if you are eligible for DRIE and get help applying or recertifying, find out if you are eligible for SNAP benefits and get help applying, assistance with health care access such as Medicaid (including Home Care and Medicaid spend-down), Medicare, EPIC and, insurance information and enrollment through the NY State of Health Marketplace, and End-of-Life Planning/Advance Directives (counseling and individualized drafting of Health Care Proxies, Living Wills, Powers of Attorney, and simple Wills).\nAll cases will be screened through an intake process and will be accepted on an individual case-by-case basis.  If they cannot assist you directly, they will do their best to make an appropriate referral. ','763644124277369','http://www.lenoxhill.org/legaladvocacy/',NULL,NULL,NULL,'1107228321502442,1267306776036445',NULL,NULL,NULL,NULL,NULL,'828026822414873',NULL,NULL,NULL,'885741754788620',NULL,NULL,NULL),(346,1120134405579501,'Caregiver Resource Center',NULL,934656532740108,'From their website: \"Staffed with specialists in dementia and long-term care issues. The Center offers free counseling, referrals, and can connect you with support groups.\"','895777164845887','https://www1.nyc.gov/site/dfta/caregivers/caring-for-adults.page',NULL,NULL,NULL,'673898301722674',NULL,NULL,NULL,NULL,NULL,'1037912257872015,829692174093401',NULL,NULL,NULL,'1014326083250530',NULL,NULL,NULL),(347,1059594236789378,'AUDIENT',NULL,1189561595287201,'Helps low income people nationwide access quality hearing aids and related care at a significantly lower cost. AUDIENT income qualifies families to be eligible for a discount on brand name hearing aids available through the AUDIENT Alliance\'s national network of dedicated hearing care providers. Brand selection includes Oticon, Phonak, Siemens, Widex, & Unitron hearing aids. If the person qualifies based on income, they will receive a notice of approval and will be referred to an audiologist in their area. Application can be found on their website at www.audientalliance.org/downloads/patients/AUDIENT_application.pdf and should be faxed or mailed.','1145004429168134','http://www.audientalliance.org/',NULL,NULL,NULL,'673030812970350',NULL,NULL,NULL,NULL,NULL,'985982047663574',NULL,NULL,NULL,'880683347691640',NULL,NULL,NULL),(348,1058015197057396,'Medicare Physician Compare',NULL,879592219599431,'Through Medicare.gov. Physician Compare helps you find doctors who accept Medicare, so you can make an informed decision for your health care needs. It’s an easy way to see up-to-date information about clinicians anytime you need it. Search by location and specialty. ',NULL,'https://www.medicare.gov/physiciancompare/?utm_campaign=20190619_gmd_cpt_gal&utm_content=english&utm_medium=email&utm_source=govdelivery',NULL,NULL,NULL,'1216469255274749,1231611168158959',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(349,1064100568825431,'Eye Doctors-SUNY College of Optometry',NULL,1080761199281965,'Eye exams, cataracts, contacts, diabetic eye care, glaucoma, low-vision, vision therapy.','1310899173122651','www.universityeyecenter.org/services/adults/',NULL,NULL,NULL,'1231611168158959,1216469255274749',NULL,NULL,NULL,NULL,NULL,'850141884176028',NULL,NULL,NULL,'778098386108808',NULL,NULL,NULL),(350,1062479646535600,'Henry Street Settlement Out-Patient Mental Health Services',NULL,1304379056037082,'Psychiatrist on staff, takes referrals from the community. In an emergency, they will see someone immediately. No catchment area restrictions, individual must be able to travel to their offices. Hours are Monday, Tuesday and Friday 1-5 p.m. and Wednesday 9-5 p.m. Medicaid, Medicare and other third-party insurance providers are accepted. A sliding-scale fee is available for those ineligible for health insurance.','1184820804458141','https://www.henrystreet.org/programs/primary-behaviorial-health/mental-health-services/out-patient-mental-health-services/?_ga=1.62102444.1291672894.1487193629',NULL,NULL,NULL,'1112870426305700',NULL,NULL,NULL,NULL,NULL,'816791472047270',NULL,NULL,NULL,'1207063895757738',NULL,NULL,NULL),(351,1079325127716892,'Edie Windsor Sage Center',NULL,976650048750374,'\"Sage Centers offer a number of social activities and programs for LGBT older people. These include cultural programs such as acting, creative writing, and art classes, and programs focused on health and well-being, such as nutrition classes, tai chi, meditation, bilingual discussion groups and more. The following is a select listing of regular programs and services.\"','1316417580209628','www.sageusa.org/nyc/centers/midtown.cfm',NULL,NULL,NULL,'1047568246255855,843777382088472',NULL,NULL,NULL,NULL,NULL,'1269984178440478,1060305790084908',NULL,NULL,NULL,'817545979807110',NULL,NULL,NULL),(352,1095775450222695,'Masbia Soup Kitchen',NULL,NULL,'Masbia is a network of community supported kitchens where clients can eat for free. Masbia also operates a free food pantry. Masbia has a certificate of Kashrut from the Orthodox Union. You do not need to be Kosher or Jewish to eat there. Masbia is open for dinner service at Masbia of Flatbush from 6:00 pm until 8:00 pm Sunday - Thursday. Masbia of Queens dinner service is from 2:00pm - 6:00pm Sunday - Thursday and Masbia of Boro Park serves dinner from 6:30pm - 8:00pm Sunday - Thursday. Flatbush, Brooklyn #: 718-972-4446 x208, 718-534-7410, Boro Park, Brooklyn  #: 718-972-4446 x205, 718-289-0635, Queens #: 718-972-4446 x207, 718-534-7321','784316566717791,617979301268346,1289479886325064','https://www.masbia.org/dinnerguidelines',NULL,'info@masbiaboropark.org',NULL,'886323941641619,953560938102102,822552305363624',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1097884883741066,1115408490940377,617155606786519',NULL,NULL,NULL),(353,1112396378413545,'Atria Assisted Living',NULL,1239412320737696,'Assisted living facility with studio, one bedroom, and two bedroom units. Multiple dining venues, including formal and casual restaurants serving gourmet cuisine (not Kosher) with full table service and a café offering lighter fare, 24-hour doorman, concierge services, city and river views, rooftop terrace and fitness center, penthouse salon and spa, library, physical therapy available on-site, pet-friendly (allowed with a fee). Alzheimer’s Unit at a different location, personal care available (different levels of care), medication management also available.','1132429607914760','https://www.atriaseniorliving.com/retirement-communities/atria-west-86/',NULL,NULL,NULL,'924951065612317,973172406940749',NULL,NULL,NULL,NULL,NULL,'1252752996229882',NULL,NULL,NULL,'935506622140725',NULL,NULL,NULL),(354,1116354864043357,'Donated Dental Services',NULL,929652227578001,'\"DDS volunteers provide comprehensive treatment to eligible patients, volunteers do not provide emergency services, Eligibility: applicants must lack adequate income to pay for dental care and: have a permanent disability, or are elderly: age 65 or older, or qualify as medically fragile. Download application on website or call to request application by mail.\"','678228609412430','https://dentallifeline.org/new-york/',NULL,'mlebron@DentalLifeline.org',NULL,'580054623534909,1216469255274749',NULL,NULL,NULL,NULL,NULL,'1292921220698157',NULL,NULL,NULL,'814078270034232',NULL,NULL,NULL),(355,1127212114957227,'Church of the Holy Apostles Soup Kitchen',NULL,1245121450184997,'From their website: \"Food donations can be dropped off between 9 a.m. and 2 p.m. Please come to the building next to the church, ring the kitchen buzzer, and the kitchen staff will retrieve the food. Clothing can be dropped off between 9 a.m. and 5 p.m. Before 1 p.m., please come to the building next to the church, enter at the volunteer entrance and take items to the counseling room. After 1 p.m., please come to the building next to the church, ring the 3rd floor buzzer, and the administrative staff will retrieve the items. Monday-Friday from 10:30-12:30, limited supply of free Metro Cards. Bring proof of an appointment or proof of employment. Holy Apostles can also write a letter of financial difficulty that can be shown at subway stops, and sometimes the clerk will then allow the person to ride for free.\" ','1244313383082735','https://holyapostlessoupkitchen.org/contact-us/',NULL,'rtrifiro@holyapostlesnyc.org',NULL,'1084050103649570,977021400698839',NULL,NULL,NULL,NULL,NULL,'1083472209133737',NULL,NULL,NULL,'851200565250996',NULL,NULL,NULL),(356,1131732896159637,'HCC Legal Consultation Services',NULL,765242994231339,'Fifteen minute consultations in their housing legal clinic for NYC residents who do not meet eligibility requirements (who are outside of their catchment area of 34th to 100th Street, west of 5th Avenue to the Hudson River, or do not meet income eligibility criteria), Monday nights from 7:00 pm – 9:00 pm. Call to confirm times and days.','1177945331425669','http://hcc-nyc.org/',NULL,'info@hcc-ny.org',NULL,'958412510535349,1107228321502442',NULL,NULL,NULL,NULL,NULL,'1108274882668509',NULL,NULL,NULL,'1251607012182176',NULL,NULL,NULL),(357,1066127710643855,'PSS Home Care',NULL,NULL,' Caregivers, companions, Certified Nursing Assistants, home health aides, RN, LPN\'s, and housekeepers','831068100487590','http://psshomecare.com',NULL,'info@psshomecare.com',NULL,'687567198750084,796847632116140',NULL,NULL,NULL,NULL,NULL,'750939168587534',NULL,NULL,NULL,'1295073271022385',NULL,NULL,NULL),(358,1078317350604130,'Court Square Law Project',NULL,1309723320781128,'\"Court Square Law Project thinks everyone should be able to afford justice, so we offer sliding scale rates based on what you earn to ensure all New Yorkers have access to quality legal representation. Created by the New York City Bar Association and the City University of New York School of Law to provide high-quality civil legal services to moderate-income clients.\"','578522606692195','http://www.courtsquarelaw.org',NULL,NULL,NULL,'1107228321502442',NULL,NULL,NULL,NULL,NULL,'854604598040546',NULL,NULL,NULL,'1150669991870840',NULL,NULL,NULL),(359,1084340237979840,'Senior Health and Consultation Center',NULL,927555477423975,'Provides adults over 60 with affordable primary care and mental health services with a team of psychiatrists, psychiatric social workers, medical doctors and home health aids. Services are provided at the Center. When needed, staff makes home visits. Fees are on a sliding scale. Accept Medicare, Medicaid, and supplemental insurance. Call for eligibility. ','1213673789871430','http://www.greenwichhouse.org/senior_health/index',NULL,'lgiuliano@greenwichhouse.org',NULL,'1112870426305700,1216469255274749',NULL,NULL,NULL,NULL,NULL,'658986714019326',NULL,NULL,NULL,'790101753911088',NULL,NULL,NULL),(360,1085743000768146,'PAWS NY-Housecall Program',NULL,NULL,'Provides volunteers for dog walking, cat litter cleaning, feeding/water, and medication administration to pets for seniors who are 60 and up or for those who have an illness or disability.  The program is for in-home care for clients who are living at home and are in need of on-going assistance. “PAWS NY services are designed to help our clients overcome the physical and financial limitations they face caring for their animal companions.  If you are a senior or someone with an illness or disability, and you are struggling with the day to day care of your pet, then PAWS NY might be able to assist.” In order to qualify for services, individuals must meet each of the following criteria: Be in need of on-going Housecall Services as outlined above, be a New York City resident, be a senior citizen (60+), or individual suffering from a temporary or permanent disability or illness, have an impaired ability to provide day-to-day care for your pet(s), have a maximum gross monthly income of no more than $1,850, limit of 4 pets per household.\nThey DO NOT Provide: Assistance when individuals are hospitalized if they are not existing Housecall clients, adoption/placement services, spay/neuter services, temporary boarding for pets not in our Housecall Program (foster only provided in cases where an on-going client is facing a medical emergency), veterinary care for pets not in our Housecall Program, financial assistance. ','1299471674451871','https://pawsny.org/services',NULL,'referrals@pawsny.org',NULL,'998681432266511',NULL,NULL,NULL,NULL,NULL,'1128362242994969',NULL,NULL,NULL,'649943772439921',NULL,NULL,NULL),(361,1105880615768786,'Complementary Care in the Home',NULL,1259842440192512,'Pain management and palliative care--also entails treatment of psychological, social, and spiritual issues. Services include hospital or home-based evaluation, treatment by trained team of nurses, HHAs for personal care, physical and occupational therapy, mental health resources, social workers for psychosocial support, collaboration with a physician, and referral. \n\nPosted 11/19',NULL,'www.vns.org/physician-services-program/pain-management-and-palliative-care',NULL,'PainCare@vns.org',NULL,'1203572911800812',NULL,NULL,NULL,NULL,NULL,'1064118121691527',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(362,1121803510385871,'Lifetime Connections Without Walls',NULL,1265619630877168,'From their website: A telephone-based program that provides opportunities for socially or physically isolated older adults to connect with others in their community and across the country. We offer social and educational classes, support groups, and friendly conversation – all over the telephone – all from the comfort of home. Classes are facilitated by volunteers, community partners, and contracted professionals. \nFor people aged 55 or older who have the ability to have a conversation over the telephone with a group of people, and have access to a telephone. \nFour sessions per year (winter, spring, summer, fall). Each quarterly session is about 13 weeks long with breaks for holidays.\nEach quarterly session costs $10 which allows you to register for unlimited classes. Participation is open to U.S. residents. \nLCWW connects you to the classes you register for via a telephone conference call system. All you have to do is answer your phone to join the call. If you miss the call or prefer to call into the class on your own, this is an option, too. We would just provide you with the call-in telephone number.','1239624839498223','https://www.familyeldercare.org/programs/lifetime-connections-without-walls/',NULL,'LCWW@familyeldercare.org ',NULL,'972558970458700,1275784767796871,1177309407177568,633482549261197',NULL,NULL,NULL,NULL,NULL,'668697413725843',NULL,NULL,NULL,'1334250486828450',NULL,NULL,NULL),(363,1122742987352862,'Visions-Selis Manor Technology Training',NULL,NULL,'An adapted center that offers an array of services for blind youth and adults. They also offer technology training onsite. There is an in-person intake that takes about 45 minutes. The iPhone and technology training is free of charge. Call to make an appointment for the intake. Selis Manor is open Monday 9am to 7pm, Tuesday 9am to 7:30pm, Wednesday 9am to 7pm, Thursday 9am to 7pm and Friday 9am to 5pm. ','1191271525410215','https://www.visionsvcb.org/locations-2/visions-at-selis-manor/',NULL,NULL,NULL,'1291763496785325',NULL,NULL,NULL,NULL,NULL,'569317112509719',NULL,NULL,NULL,'866467698576838',NULL,NULL,NULL),(364,1126743012681201,'Circle of Care',NULL,622962685703588,'Support services for caregivers of seniors who are frail, chronically ill, or have memory loss. Support groups are available on the phone and in-person. ','1281630851960649','https://pssusa.org/',NULL,'careinfo@pssusa.org',NULL,'1253061813300180,673898301722674,1106914314143204,1285075174713673',NULL,NULL,NULL,NULL,NULL,'1004190229516624',NULL,NULL,NULL,'1215718634831660',NULL,NULL,NULL),(365,1127894920710927,'Clearview Senior Center Medical Transportation Program',NULL,911077302205989,'For seniors residing in Queens: Seniors interested in making an appointment can call the Selfhelp Clearview Senior Center at 718-224-7888 between 9:00 am and noon to schedule next-day rides. Service users are required to fill out an application with demographic information, emergency contact and destination. When they are ready for pick up, seniors must call Selfhelp again to schedule a return trip. Four Twos and Central Car Service will provide rides for seniors. ','764896781271384','https://www.selfhelp.net/community-based-programs.php',NULL,NULL,NULL,'977021400698839,953560938102102',NULL,NULL,NULL,NULL,NULL,'959249420766849',NULL,NULL,NULL,'572057097465334',NULL,NULL,NULL),(366,1132886715574084,'79th Street Pharmacy',NULL,NULL,'Pharmacy with medicine, health products, canes, walkers, wheelchairs, and surgical and medical supplies. Delivery.','841546300162126','https://stores.healthmart.com/79thstreetpharmacy',NULL,NULL,NULL,'890627628532068,650194788641739',NULL,NULL,NULL,NULL,NULL,'1127619789543143',NULL,NULL,NULL,'1311776591718798',NULL,NULL,NULL),(367,1136731352692743,'My Second Home: An Intergenerational Adult Day Program',NULL,633723995622015,'My Second Home (MSH), established in 1998, offers a refreshing and innovative intergenerational approach to adult day services, and is an affordable alternative to assisted living or nursing home care. Our award-winning intergenerational day program — the only one of its kind in Westchester County and a model for the nation — offers older adults a safe, supervised, home-like day care environment.\n\nPosted 10/19','1025460225711426','https://www.fsw.org/our-programs/my-second-home',NULL,NULL,NULL,'919422912164535,1235050525416771',NULL,NULL,NULL,NULL,NULL,'1259078763621131',NULL,'559489933696347',NULL,'1146912504954649',NULL,NULL,NULL),(368,1075438822445949,'IAM International Aphasia Movement',NULL,941274233839123,'From their website: \"IAM assists people with speech and learning problems due to the disability of aphasia caused by a stroke or other brain injury. Groups are held in several locations. Our sessions at Mount Sinai Downtown and The Church of St. Luke in the Fields are conducted by licensed Speech-Language Pathologists. Groups at Hunter College, Teachers College, Columbia University, and Brooklyn College are conducted by Graduate Student Clinicians under the supervision of Senior Supervisors. All programs are free of charge.\"','735984512579351,922989103714281','http://aphasianyc.org/',NULL,'carlotaschoolman@gmail.com',NULL,'1344484206302625',NULL,NULL,NULL,NULL,NULL,'950188968858266',NULL,NULL,NULL,'1213654819400648,1213654819400648',NULL,NULL,NULL),(369,1081760944478246,'Learning in Retirement at Iona College',NULL,1218024219977664,'From Website: Serves the intellectual and social needs of a community of lifelong learners. One fee entitles members to attend all courses, with the exception of Tai Chi. Courses are taught by our own members and by experts from the larger community. Each session’s offerings cover a broad range of academic and cultural topics as well as the occasional practical (legal, medical or financial) matter. \n\nPosted 11/19','1272607030091691','www.iona.edu/liric',NULL,'spage@iona.edu',NULL,'1304627313120388',NULL,NULL,'$175/year',NULL,NULL,'972008614217389',NULL,NULL,NULL,'1149339678732283',NULL,NULL,NULL),(370,1079289603793627,'Memory Café',NULL,577622941794896,'From their website: \"Program with curriculum and staff support run by the Alzheimer’s Association, Hudson valley Chapter, in collaboration with Westchester Jewish Community Services. The Memory Cafe is a dementia-friendly social experience – a \'day on the town\' for people with dementia and their caregivers. The Memory Café helps to reinforce much needed social connections and provides a supportive environment for people with dementia and their care companions.\"','1121803768506081','https://beyondmemory.org/memory-cafe/',NULL,NULL,NULL,'1253061813300180,1106914314143204,1285075174713673,919422912164535',NULL,NULL,NULL,NULL,NULL,'1235801167970102',NULL,NULL,NULL,'837398020781190',NULL,NULL,NULL),(371,1093504327085034,'Boxwood Alliance',NULL,NULL,'Resources for aging in place in Northern Westchester. Offers lectures and community events for older adults.\n\nPosted 10/19','1270368988247560','https://theboxwood.org/',NULL,'info@theboxwood.org',NULL,'772331273438770,1186683016797740',NULL,NULL,NULL,NULL,NULL,'642989916328449',NULL,NULL,NULL,'637604907393833',NULL,NULL,NULL),(372,1101228014613607,'Inclusionary Housing Program',NULL,1298940682519485,'Supportive housing for low-income seniors, 62+.','828460940429935','https://www.metcouncil.org',NULL,'housing@metcouncil.org',NULL,'958412510535349',NULL,NULL,NULL,NULL,NULL,'1308840864047279',NULL,NULL,NULL,'787498608599908',NULL,NULL,NULL),(373,1100160407487239,'Therapy Dog International',NULL,NULL,'Referrals are made through a social worker or case manager. TDI will provide them with paperwork that needs to be filled out by senior and their doctor. TDI will reach out to volunteers who live near the senior and will get in touch with the social worker or case manager if someone is interested in visiting the senior with their dog.','666258498467611','www.tdi-dog.org/OurPrograms.aspx?Page=Home+Visits',NULL,'tdi@gti.net',NULL,'998681432266511',NULL,NULL,NULL,NULL,NULL,'975004686154029',NULL,NULL,NULL,'977416532700913',NULL,NULL,NULL),(374,1105421397052219,'Westchester County Adult Protective Services',NULL,1246973128987993,'From Website: ...System of services provided without regard to income under the New York State Office of Children and Family Services for persons 18 or older, who, because of a mental and/or physical impairment, are at risk of harm or are unable to meet their own needs and have no one to assist them responsibly. In New York State, local social services departments have the primary responsibility to provide services to impaired adults who may be abused, neglected or exploited and are living in the community.\n\nPosted 11/19',NULL,'https://socialservices.westchestergov.com/adult-protective-services',NULL,NULL,NULL,'1108954480265575',NULL,NULL,NULL,NULL,NULL,'1270311161962473',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(375,1138115505853007,'Adult Protective Services (APS) New York City',NULL,1203580898818274,'Provides services for physically and/or mentally impaired adults. APS works to help at-risk clients live safely in their homes.  APS clients can be referred by anyone. If an individual is eligible, a home visit will be made in three business days or in 24 hours if the situation is life-threatening','813205239134542','https://www1.nyc.gov/site/hra/help/adult-protective-services.page',NULL,NULL,NULL,'1197693117142860',NULL,NULL,NULL,NULL,NULL,'563203777365962',NULL,NULL,NULL,'845857230997975',NULL,NULL,NULL),(376,1092883228056681,'Sage-GRIOT Innovative Senior Center',NULL,662038774277415,'From their website: \"Both organizations to expand and work together to provide emotional support, social connections, and a wide variety of programs and services for older adults.\"','1081195125031947','https://sagenyc.org/nyc/centers/brooklyn.cfm',NULL,NULL,NULL,'1047568246255855',NULL,NULL,NULL,NULL,NULL,'926495709450687',NULL,NULL,NULL,'1096524754673372',NULL,NULL,NULL),(377,1106634672009720,'HCC Legal Clinic for Legal Representation',NULL,765242994231339,'From their website: \"Free legal services to eligible low- and moderate-income tenants, tenant associations, HDFC shareholders and other community organizations located in the Hell’s Kitchen/Clinton and Upper West Side neighborhoods (34th to 100th Street, west of 5th Avenue to the Hudson River) who meet our meet our income eligibility requirements. HCC provides legal services in the following matters: Housing, Domestic Violence, Public Benefits issues, Immigration issues, Consumer Law, Elder law, End of life directive.\" Monday: 4:00 pm - 6:30 pm, Thursday: 10:00 am - 12:30 pm. Call to confirm hours and days. If outside of catchment area, see HCC Legal Consultation Services.','1177945331425669','http://hcc-nyc.org/',NULL,'info@hcc-ny.org',NULL,'958412510535349,1107228321502442',NULL,NULL,NULL,NULL,NULL,'1108274882668509',NULL,NULL,NULL,'1251607012182176',NULL,NULL,NULL),(378,1111412202688911,'TechConnect Classes',NULL,723174585810467,'From their website: \"Free one on one computer help sessions on browsing the internet, creating an email account, shopping, banking or applying for jobs online, and more.\" At most NYPL locations, call to confirm.','923433027659524,1087291274277449','https://www.nypl.org/tech-connect',NULL,NULL,NULL,'960167769062265',NULL,NULL,NULL,NULL,NULL,'1224334219910454',NULL,NULL,NULL,'891137758334382,1168320802898381',NULL,NULL,NULL),(379,1118318410950178,'Westchester Independent Living Center',NULL,NULL,'Not-for-profit, community based, consumer-directed advocacy and resource center that services people of all ages with all types of disabilities. It is part of a national network of Independent Living Centers that provide a wide spectrum of non-residential and non-medical services. \n-Benefits and entitlements advisement\n-Information and referral\n-Community outreach\n-Independent living skills\n-Peer advisement\n-Individual and systems advocacy\n-Deaf services\n-Equal access consultation\n\nSpecialized Programs:\n-Client Assistance Program\n-Minority Outreach Program\n-Mental Health Advocacy Program\n-Traumatic Brain Injury Regional Resource Development Center\n-Nursing Home and Transition Diversion Waiver\n-Partners for Success Program\n-Disability Program Navigator\n-Educational Advocacy Program\n\nPosted 11/19','1342279942025195','www.wilc.org',NULL,NULL,NULL,'772331273438770',NULL,NULL,NULL,NULL,NULL,'865870564298862',NULL,NULL,NULL,'1241568007359576',NULL,NULL,NULL),(380,1129819371682604,'Visiting Neighbors-Shop & Escort',NULL,1230302767883482,'From their website: \"For a frail senior, crossing New York City\'s busy streets can be an overwhelming challenge. Our volunteers help seniors make trips to the grocery store or pharmacy. When the weather is bad, or the senior is not up to a trip outside, volunteers can go shopping for them. We escort seniors to medical appointments to provide them with both a steady arm to lean on and emotional support. On nice days, our volunteers may walk outside with seniors for exercise, fresh air and companionship.\" Catchment area: Manhattan, 30th Street and below, river to river.','1096140273343586','http://www.visitingneighbors.org/shop---escort-services.html',NULL,NULL,NULL,'1119801442928622',NULL,NULL,NULL,NULL,NULL,'1346910610541068',NULL,NULL,NULL,'587679286714670',NULL,NULL,NULL),(381,1136467034410759,'A-HOME',NULL,NULL,'Strengthening northern Westchester neighborhoods with safe and affordable housing. Clients are often low-income individuals with disabilities, and single-parent families who, because of age, disability or family status, cannot afford market-rate rents. Often people are homeless or living in sub-standard housing. \n\nPosted 11/19','949247102681705','www.a-homehousing.org',NULL,'info@a-homehousing.org',NULL,'916066334101408','Applying for housing at A-HOME involves a number of steps, beginning with the submission of a preliminary application. After the application is received by A-HOME, a staff member will contact the applicant by telephone to describe the next steps which may include a more detailed application, an in-person interview, a visit to an A-HOME residence, and the submission of additional documents including a medical history, income verification and personal references. The application process is intended to ensure that potential residents will be a good match for A-HOME’s housing and the kinds of services that A-HOME provides.',NULL,NULL,NULL,NULL,'822308397193034',NULL,NULL,NULL,'910181355756249',NULL,NULL,NULL),(382,1136788332479791,'CareTogether',NULL,560058140954374,'Web-based community that offers family caregivers the ability to connect with each other and share vital information such as scheduling, messaging, tasks, and resources as a means to ensure they will have the support they need to provide the best care possible for their loved ones. \n\nPosted 10/19',NULL,'www.care-together.com',NULL,NULL,NULL,'1124686729166068',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(383,1143770048865256,'Andrus on Hudson',NULL,NULL,'Andrus on Hudson provides rehabilitative services, long-term nursing care, memory care, and hospice and palliative care. Staff includes physical, occupational, and speech therapists as well as physician and nurse practitioner coverage seven days per week. Care team meetings are used for collaboration between medical specialists and families.\n\nPosted 11/19','1237550919730117','andrusonhudson.org',NULL,'info@andrusonhudson.org',NULL,'1132943173487126,628102384928895,919422912164535,1310065103612125,1203572911800812',NULL,NULL,NULL,NULL,NULL,'1175011001614302',NULL,NULL,NULL,'1114506552824983',NULL,NULL,NULL),(384,1152610947377648,'Selfhelp Senior Housing',NULL,893776550816855,'From their website: \"Selfhelp owns and operates 10 affordable senior apartment buildings in Queens, the Bronx, and Nassau County, with two more under development in Brooklyn. Our buildings offer seniors the opportunity to lead independent lives in affordable and appropriate apartments, with access to on-site services if and when needed, including health and wellness, social work, skilled nursing and home care. There are also computer and Skype rooms, large community rooms and libraries, as well as exercise equipment and telehealth monitoring, Each unit is equipped with emergency pull cords, there is closed-circuit TV surveillance in each lobby, and the buildings are near to public transportation. Seven of our residences are also in close proximity to one of Selfhelp’s senior centers, where residents can participate in stimulating programs and enjoy a nutritious lunch.\"','837099011829572','https://selfhelp.net/community-based-programs.php',NULL,NULL,NULL,'958412510535349',NULL,NULL,NULL,NULL,NULL,'631280390692284',NULL,NULL,NULL,'758370601759800',NULL,NULL,NULL),(385,1149836920305012,'Vintage Thrift ',NULL,1146332029502995,'From their website: \"Benefits the UJC. Accepts donations of resalable men\'s and women\'s clothing, accessories, shoes, jewelry, furniture, lamps, mirrors, artwork, pottery, decorative items, housewares, china, crystal, serving items, kitchenware, pots & pans, flatware, glassware, housewares, table linens, CDs, DVDs, cameras, and collectibles. Old or new, vintage or contemporary. We take just about everything! In fact, it\'s easier to tell you what we don\'t accept than to list the multitude of items we accept. In general, we do NOT accept the following items: laminated particle board furniture, Ikea furniture, furniture in poor condition, major appliances, air conditioners, medical equipment, exercise equipment, home and office electronics (computers, monitors, printers, fax machines), children\'s and infants\' items, books (with the exception of art books, or collectible books), magazines (with the exception of vintage magazines-- 25 years or older) bed frames, mattresses or futons. However, we do make exceptions to these general rules—from old manual typewriters, to old fashion magazines, to antique toys. For donation inquiries and pick-up requests for large donations call or FILL OUT OUR ONLINE REQUEST FORM. Drop-off donations are welcome at our Gramercy Park location during all business hours. All donations are tax deductible & donors are given blank donation receipts to fill out at the time of drop-off or pick-up.\"','1320059444435785','www.vintagethriftshop.org/donate/',NULL,NULL,NULL,'1084050103649570',NULL,NULL,NULL,NULL,NULL,'809655169312005',NULL,NULL,NULL,'1130607261227042',NULL,NULL,NULL),(386,1159723997685126,'Response Link',NULL,NULL,'Personal emergency response and safety systems.','1215789641963512','https://www.responselink.com',NULL,NULL,NULL,'1293277534665673,650194788641739',NULL,NULL,NULL,NULL,NULL,'827156964970852',NULL,NULL,NULL,'1266006155108503',NULL,NULL,NULL),(387,1094182181917047,'Upper East Side Thrift Shop',NULL,921537895769274,'From their website: \"Accepts clothing, shoes, books, furniture, and household items: Furniture in excellent condition, Clean apparel (in plastic garbage bags only), Accessories / shoes (boxed or bagged), Antiques, Art, Decorative items, Clean housewares (properly packed in boxes only), Jewelry, Lighting, Unusual finds, Clean rugs (up to 6\' x 9\' with occasional exceptions), Up to 4 boxes of books (24\" x 24\" box max), pick-up available for furniture, drop-off other items.\"','1201437144501985','https://www.housingworks.org/locations/upper-east-side-thrift-shop-lex',NULL,NULL,NULL,'1084050103649570',NULL,NULL,NULL,NULL,NULL,'624864345691699',NULL,NULL,NULL,'754813651716259',NULL,NULL,NULL),(388,1095995702526879,'Integra Managed Long Term Care',NULL,NULL,'Integra\'s mission is to help frail older adults and those with long-term disabilities to age comfortably in their own homes. Care team of nurses and social workers adjust care plans to meet clients\' long-term medical needs. \n\nPosted 11/19',NULL,'www.integraplan.org',NULL,NULL,NULL,'922137071025167,1186683016797740',NULL,NULL,NULL,NULL,NULL,'1087012208856744',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(389,1116888388546263,'Bergen County Division of Senior Services-Area Agency on Aging',NULL,NULL,'Aging and disability resource connection for Bergen county. Can provide information on the following:\nAdult Day Care, Age-Friendly Community Initiatives (AFCI), Benefits Eligibility, Care Management, Food Pantries, Home Care Programs, Home Modifications, Housing, Long Term Care Facilities, Meals on Wheels, Medicaid / Other Insurance, Medicare, Mental Health, Pharmaceutical Assistance, Reverse Mortgage Counseling, SAVVERS Discount Program, Senior Activity Centers, Senior Lunch Program, Tax Relief, Transportation, Wellness Check Program, etc.','835764311371710','https://www.co.bergen.nj.us/division-of-senior-services',NULL,NULL,NULL,'1050752555762937',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1169300179299470',NULL,NULL,NULL),(390,1139635123913814,'Community Health Advocates',NULL,929616229953100,'From their website: \nWe help New Yorkers understand how to use their health insurance, resolve medical billing and debt issues, dispute coverage denials and eligibility determinations, get the most from their coverage (get prior authorizations, access specialists, and out-of-network services when needed), access affordable health care services and hospital and prescription financial assistance programs, understand how small business owners can offer health insurance and get health insurance tax credits, understand the health insurance tax credit reconciliation process.','671749238369587','http://www.communityhealthadvocates.org/',NULL,'cha@cssny.org',NULL,'629629464544122,580054623534909,1231611168158959,1267306776036445',NULL,NULL,NULL,NULL,NULL,'628307772460600',NULL,NULL,NULL,'874421223459795',NULL,NULL,NULL),(391,1166159878681691,'Retired & Senior Volunteer Program',NULL,929616229953100,'From their website: \"Matches the skills and interests of adults 55+ with volunteer opportunities at New York City nonprofit organizations and licensed health care facilities. With nearly 3,000 volunteers, RSVP in New York City is one of the largest senior volunteer programs in the nation.\"','1277139960865376','www.cssny.org/pages/FAQ-for-volunteers',NULL,NULL,NULL,'910325259072395',NULL,NULL,NULL,NULL,NULL,'937481797410672',NULL,NULL,NULL,'1014326083250530',NULL,NULL,NULL),(392,1170811066146268,'Alzheimer\'s Foundation of America-Education & Resource Center',NULL,875087617643548,'The Alzheimer’s Foundation of America hosts programs for senior with Alzheimer’s and their caregivers on music, art, yoga, and more. Call for specific dates and times. ','645252881647646','https://alzfdn.org/events/',NULL,NULL,NULL,'1285075174713673,1253061813300180,1106914314143204,673898301722674',NULL,NULL,NULL,NULL,NULL,'1182095960005145',NULL,NULL,NULL,'1140897431336658',NULL,NULL,NULL),(393,1174269939217094,'Fran Pantaleo, Esq. ',NULL,616916911644580,'Founded in 1937, Bleakley Platt & Schmidt is a firm of legal professionals. With offices in White Plains, New York and Greenwich, Connecticut, Bleakley Platt & Schmidt represents national clients as well as clients from the New York metropolitan region, ranging from the five boroughs of New York City to Westchester and the Hudson Valley as well as southern Connecticut.','857862822897265','https://www.bpslaw.com/',NULL,'fpantaleo@bpslaw.com',NULL,'1113969124035608',NULL,NULL,NULL,NULL,NULL,'968804631362674',NULL,NULL,NULL,'577989079245013',NULL,NULL,NULL),(394,1116416715620906,'Expanded in-home Services for the Elderly Program',NULL,1273704954905898,'For ages 60+ who need help with activities of daily living and instrumental activities of daily living. Includes case management as well as non-medical in-home services such as housekeeping, respite car, homemaking, and ancillary services (safety and health equipment). \n\nPosted 10/19',NULL,'https://seniorcitizens.westchestergov.com/eisep-services',NULL,NULL,NULL,'1201096778076050,1186683016797740',NULL,NULL,'Sliding Scale',NULL,NULL,'647974287086550',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(395,1136487190647830,'Arc XVI Fort Washington Transportation & Escorting',NULL,NULL,'For Manhattan residents: there are 9 buses in Manhattan, which provide free curb-to curb transportation services for seniors from West 220th Street to West 110th Street, North to South, and from the Hudson River to Harlem River, West to East. In Manhattan, we have a new program that allows disabled individuals with mobility, visual or audio impairments over 50 yrs of age and seniors citizens 60 years of age or older to become more independent and age in place, with the support of Mobility Facilitators. We will pick you up at your front door, escort you to your desired location and return you back to your front door, giving qualifying disabled and community seniors increased mobility and access to more community-based resources.\nFor the Bronx: there are 5 buses in the Bronx from Crotona Park to Hunts Point and from the Sheridan Expressway West to Webster Avenue and Port Morris, comprising Bronx Community Boards 1, 2, and 3. Seniors receive transportation to and from the Senior Centers, and to and from medical and other appointments. Seniors also are advised on how to apply for Access-A-Ride.','1297774351454380','http://arcseniors.org/transport.html',NULL,'info@arcseniors.org',NULL,'652340976007902,977021400698839,1119801442928622',NULL,NULL,NULL,NULL,NULL,'757666140998432,961307231384629',NULL,NULL,'716577135735480','778543992783567',NULL,NULL,NULL),(396,1138765647796032,'Riverwalk Jenny and John Paulson Residences',NULL,937797454062332,'From their website: \"Independent living facility that offers luxury, residential-style living with concierge services, cultural activities, meals, laundry, and housekeeping services. Residents can attend college lectures, enjoy live entertainment, exercise in state-of-the-art fitness center, participate in yoga, tai chi, and so much more. 146 full apartments (kitchenette, living room, bedroom, bathroom). Housekeeping staff, maintenance, activities available. Two glatt kosher, restaurant-style meals (breakfast and dinner). Shuttle to town. Trips to Manhattan (museums, etc.).\" ','816184557679981','https://www.riverspringhealth.org/independent-living/',NULL,NULL,NULL,'924951065612317,973172406940749',NULL,NULL,NULL,NULL,NULL,'1216549015585177',NULL,NULL,NULL,'1207812081410168',NULL,NULL,NULL),(397,1140044270894215,'CarePatrol',NULL,NULL,'Free senior placement service for families considering Assisted Living, Memory Care Communities, and Nursing homes. \n\nFrom Website: We are local professionals that schedule tours and accompany you throughout care facilities to ensure that you are finding the best place for your friend or family member. Our services are free to families as we are compensated by our network of providers.\n\nPosted 11/19',NULL,NULL,NULL,NULL,NULL,'916066334101408',NULL,NULL,NULL,NULL,NULL,'934844113524747',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(398,1166408615738556,'OATS-Computer Basics Class at Lehman Village Senior Center',NULL,954473100289340,'Weekly computer classes.','1235823397465003','http://www.carterburdennetwork.org/',NULL,'contactus@carterburdennetwork.org',NULL,'960167769062265',NULL,NULL,NULL,NULL,NULL,'1127827276242029',NULL,NULL,NULL,'1084427625969473',NULL,NULL,NULL),(399,1178964799491276,'JASA-One Stop',NULL,853324273796035,'Case assistance, case management, benefits and entitlements assistance, counseling, and home care for a drop-in senior population as well as home-bound seniors. Drop-in services available Monday to Friday, 9:00 am to 1:30 pm in Manhattan. Case management services (for those with an income of $25,000 and below) also available in Bronx, Brooklyn, Queens, and Long Island.  ','939211492742480','www.jasa.org/community/one-stop-at-jasa',NULL,NULL,NULL,'822552305363624,819444632829102,652340976007902,953560938102102,681957604814502,629629464544122',NULL,NULL,NULL,NULL,NULL,'1240040159844520',NULL,NULL,NULL,'1224597133180875',NULL,NULL,NULL),(400,1178804371007212,'Leave No Footprint',NULL,NULL,'At this time we are not accepting large furniture for donation. Small pickups of clothing, household items, books, etc. start at $20, depending on the size of the load.  If there is a particular charity a customer would like their donations to go we would gladly deliver there. Donation receipts are provided as well. To book an appointment just send an email with your preferred dates/times and a general list of donations and we’ll proceed with an estimate. Serves all 5 boroughs of NYC, Westchester, and parts of NJ.','1139219143417938','http://leavenofootprintnyc.com/',NULL,'christine@leavenofootprintnyc.com',NULL,'1084050103649570',NULL,NULL,NULL,NULL,NULL,'1260302583647635',NULL,NULL,NULL,'1014326083250530',NULL,NULL,NULL),(401,1125677187813287,'Truly Inspired ',NULL,1172759491336656,'Specialized home care for clients with memory impairment (early or late-stage). An initial in-home assessment called \"Strengths and Rhythm Assessment\" is performed for a fee. This home visit allows their staff to learn what each client is interested in engaging with. Staff re-introduce passions that clients used to have and modify them. Helpful for people who are beginning to withdraw, need more stimuli, and want to remain in their home. The home care emphasizes engagement and keeping the client as independent as possible. Minimum of 4 hours per visit, at an hourly rate (no weekly minimum).','776764909638111','www.truecareny.com/trulyinspired',NULL,NULL,NULL,'687567198750084,1253061813300180,1106914314143204,1285075174713673',NULL,NULL,NULL,NULL,NULL,'807810927641510',NULL,NULL,NULL,'869235562773696',NULL,NULL,NULL),(402,1133907407576761,'EAC Network',NULL,NULL,'Expanded In-home Services for the Elderly Program (EISEP) serving seniors on Long Island. Home delivered meals for Nassau county residents.','1093777232789267','https://eac-network.org/',NULL,NULL,NULL,'819444632829102,629629464544122,935600275247423,681957604814502',NULL,NULL,NULL,NULL,NULL,'1089823923891511',NULL,NULL,NULL,'928594077116902',NULL,NULL,NULL),(403,1139732933657230,'Chefs for Seniors',NULL,NULL,'A professional chef visits a senior\'s home and prepares 10-12 fresh meals for the week during a two hour session. Custom meals that incorporate dietary restrictions available for an additional fee. \n\nPosted 11/19',NULL,'chefsforseniors.com/westchester-county-ny',NULL,NULL,NULL,'1340645838393358',NULL,NULL,'$99/Standard Package',NULL,NULL,'1273529014298772',NULL,'1000660531277604',NULL,NULL,NULL,NULL,NULL),(404,1149857064897176,'Sundays at JASA',NULL,932368348148295,'\"College level continuing education program for adults 55+. Offers 20 courses and 10 unique lunchtime lectures on a wide range of topics. Our instructors include luminaries from the worlds of politics, the arts, media, and more. Pre-registration is strongly recommended as seating is limited, $225/semester.\"','1073337727994961','https://www.jasa.org/community/nextact/sundays-at-JASA#.W-C4mtVKiUk',NULL,'nextact@jasa.org',NULL,'972558970458700',NULL,NULL,NULL,NULL,NULL,'1092630126611665',NULL,NULL,NULL,'757838746053676',NULL,NULL,NULL),(405,1151098831263784,'Elder Justice Unit',NULL,974099224469495,'Provides free civil legal services and education to Westchester residents, male or female, aged 60+, who have experienced some form of elder abuse or mistreatment. We also assist clients with referrals for appropriate agencies and professionals. \n\nPosted 11/19','558839346559240','www.law.pace.edu/wjc',NULL,NULL,NULL,'1108954480265575',NULL,NULL,NULL,NULL,NULL,'1139094655321410,1174341586815516',NULL,'1267017343977836',NULL,'926618727822556',NULL,NULL,NULL),(406,1157307259463840,'Center for Lifelong Growth-Leonie Nowitz',NULL,NULL,'A professional service organization providing comprehensive care management services for the elderly, the disabled, and their families. Provides individualized care to enhance the quality of life for clients and family members. Available 24-hours; conducts assessment of health, medical, safety, social, and housing needs, provides referrals to specialists, coordinates long or short-term care, and more. Director, Leonie Nowitz LCSW, C-ASWCM has four decades of experience. As of 2019, rates are $200/hour. ','769463750198803',NULL,NULL,'nowitzloenie@gmail.com',NULL,'867375223184816',NULL,NULL,NULL,NULL,NULL,'545374757029278',NULL,NULL,NULL,'592056824998704',NULL,NULL,NULL),(407,1158024429127063,'Burke Rehabilitation at United Hebrew of New Rochelle',NULL,896564608375316,'Burke is a short-term rehabilitation facility. Therapy is available uop to 7 days a week, with physical, speech, and occupational therapy. Custom splints and devices are prepared as needed for patients. Multi-disciplinary treatment teams include an attending physician; licensed, registered nurses; licensed therapists, a dietitian, and social worker—all overseen by our board-certified medical director.\n\nPosted 11/19',NULL,'www.uhgc.org',NULL,' mhood@uhgc.org',NULL,'628102384928895',NULL,NULL,NULL,NULL,NULL,'819701532854097',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(408,1172606544057116,'JCCCGI Case Management',NULL,1164758644753658,'JCCGCI offers case management assistance in many languages to seniors, many of whom are Holocaust survivors. Services include short-term case assistance, information and referrals for seniors to help them gain access to needed services, benefits and entitlements they would otherwise be unable to obtain. These include, but are not limited to, Medicaid, Food Stamps, Elderly Pharmaceutical Insurance Coverage Program and Section 8 Housing Assistance. Case managers and case workers communicate in English, Spanish, Russian, Hungarian, Hebrew and Yiddish.\nWe provide case assistance to seniors at our our main office, at our five senior center locations, and at our Urban Neighborhood Services Multi Service Center in Coney Island. Case assistance to Holocaust survivors is offered at our central site and at other partner sites throughout Brooklyn including Shorefront Jewish Community Council (in Brighton Beach), Boro Park Jewish Community Council and Nachas Health and Family Network (serving Borough Park and Flatbush).','589764166882320','https://www.jccgci.org/our-services/senior-support-systems/senior-case-management/',NULL,NULL,NULL,'822552305363624,819444632829102',NULL,NULL,NULL,NULL,NULL,'845594640130019',NULL,NULL,NULL,'1209500452547068',NULL,NULL,NULL),(409,1172493889761003,'Cabrini Eldercare',NULL,NULL,'Cabrini Eldercare offers respite care, residence at St. Cabrini Nursing Home, short-term rehabilitation, home health services, and affordable senior living. \n\nPosted 11/19','789445116937009','www.cabrini-eldercare.org/',NULL,NULL,NULL,'1310065103612125,1132943173487126,628102384928895,1201096778076050,916066334101408',NULL,NULL,NULL,NULL,NULL,'928869996714344',NULL,NULL,NULL,'987643690838560',NULL,NULL,NULL),(410,1180397244334194,'The Buddy Program-NYU',NULL,1318784554858971,'**As of June 25, 2019: registration for September 2019 is starting now** A small program consisting of 16 seniors per year that matches nursing students and medical students from NYU with seniors who have early-stage memory loss. Two programs: one during academic year, October through April (visits are paused during holiday breaks) and the Service Learning Program with NYU undergraduate students who visit every week from September – December, 2019. The caregiver should contact the program directly and staff will perform a brief intake over the phone. They will add senior to the interest list and then will contact the caregiver at a later date for a full intake (screening for appropriateness). Then an assessment will be done either in their office or in the senior\'s home if they cannot get to their office. Criteria for Participation-MENTOR (Person with Dementia): have a documented diagnosis of an early stage dementia, OR signs of memory loss and thinking disorders that suggest an early stage dementia that has not been formerly diagnosed; demonstrate an understanding of the program and an expressed interest in participating; have no significant behavioral problems that would make it difficult to engage in an activity with a student; have the ability to converse adequately to convey and comprehend a verbal message; be independent in the activities of daily living (ADLs)*. live within the five boroughs of New York City; live with a family member or friend who can be involved in the program and contacted in case of emergency.                                                                                                                                            \nCAREGIVER – Criteria for Program Participation: live with the Mentor;\nrecognize that the program is an intergenerational learning experience for the student, an opportunity for social engagement and purpose for the Mentor and a chance for the caregiver to have some respite time;\nrecognize that the Buddy Program is not a companion service; while it may be an entry point, it is not a substitute for a paid home care companion or aide; be accessible by phone and e-mail; be willing to coordinate and schedule meetings of the Mentor and Buddy as needed, and generally be present for the first and last few minutes of the visit; participate in periodic telephone conversations with Program Coordinators to evaluate the Program. To make professional referrals, contact Thea Micoli – thea.micoli@nyulangone.org – 646-754-2282 or\nAnn Burgunder – ann.burgunder@nyulangone.org – 646-754-2283.\n*They may make case-by-case exceptions to this rule, so check first if you are unsure about them accepting a client who receives some assistance. ','1267598442651469','https://nyulangone.org/locations/alzheimers-disease-related-dementias-family-support-program',NULL,'BuddyProgram@nyulangone.org',NULL,'1253061813300180,1106914314143204,1285075174713673',NULL,NULL,NULL,NULL,NULL,'1178957636471174',NULL,NULL,NULL,'1081495612796712',NULL,NULL,NULL),(411,1177733096560551,'Willow Towers',NULL,896564608375316,'Licensed not-for-profit assisted living with a separate Memory Support Program. Qualifies for long-term care insurance reimbursement. \n\nPosted 11/19','1044208181065318','willowtowers.com/',NULL,NULL,NULL,'924951065612317,919422912164535',NULL,NULL,NULL,NULL,NULL,'1267089376141950',NULL,NULL,NULL,'823508061036452',NULL,NULL,NULL),(412,1185220170890408,'Karen Rosenberg Caccavo, MBA',NULL,NULL,'Personal money manager--no charge for phone consultation.\n\nPosted 11/19',NULL,'www.personalmoneymanager.net',NULL,'Karen@personalmoneymanager.net',NULL,'1029101752143135',NULL,NULL,NULL,NULL,NULL,'767960233873722',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(413,1189111249428760,'Integrity Senior Services Case Management',NULL,NULL,'From their website: \"Provides case managers for geriatric and disabled clients. Case managers are health and human service specialists that assist the elderly and disabled in attaining their maximum functional potential. Assessing the needs of their clients, case managers plan for and facilitate the coordination of health and human services to optimize quality of life and overall health outcomes. Case managers plan and manage the everyday, long-term care of their clients by working in collaboration with family members, guardians, and other health care professionals. In addition to facilitating care services, case management also includes but is not limited to advocacy, education, resource management, and communication on their client’s behalf. Case managers assess problems and provide solutions that enhance the quality of life for their clients.\" Also provides cleaning and de-cluttering services for clients through Supportive Cleaning Services. Serves the 5 boroughs and Nassau, Suffolk and Westchester counties.','1013220570111211,890414756577419','http://www.integrityseniorservices.com/Services.html#casemgt',NULL,NULL,NULL,'796847632116140,941628219469820,819444632829102',NULL,NULL,NULL,NULL,NULL,'1293703815001584',NULL,NULL,NULL,'1071300229733977,849507068539821',NULL,NULL,NULL),(414,1129589759585279,'SAGE-Pride Center of Staten Island',NULL,976650048750374,'From their website: \"Offers LGBT older adults a place to gather, socialize, learn, and connect with community members from Staten Island and across the City. Its location in the Center provides great opportunities for inter-generational programs and celebrations, including picnics at the beach, Staten Island PrideFest and monthly art shows and exhibits.\"','1177842660251604','https://sagenyc.org/nyc/centers/statenisland.cfm',NULL,NULL,NULL,'1047568246255855',NULL,NULL,NULL,NULL,NULL,'1143498278774262',NULL,NULL,NULL,'961856798576902',NULL,NULL,NULL),(415,1132245225816646,'Family Caregiver Network',NULL,1272098259280185,'Provides support to caregivers of older adults (60+) and creates programs tailored to meet the needs of synagogues, JCCs, and hospitals located in the Rivertowns and northern Westchester.\n\nPosted 10/19','833718283035993','http://www.wjcs.com/family-caregiver-network/',NULL,'jslevin@wjcs.com',NULL,'1124686729166068',NULL,NULL,NULL,NULL,NULL,'934246209753454',NULL,NULL,NULL,'1300165556123162',NULL,NULL,NULL),(416,1148065647775124,'The Hallmark of Battery Park City',NULL,1181103787730838,'Independent living facility with spacious apartments that offer amenities, which may include full kitchens, ceiling fans, blinds, emergency pull cords, walk-in closets.','885304367985116','https://www.brookdale.com/en/communities/brookdale-battery-park.html',NULL,NULL,NULL,'924951065612317,973172406940749',NULL,NULL,NULL,NULL,NULL,'1221023895177037',NULL,NULL,NULL,'821191487660593',NULL,NULL,NULL),(417,1155063349294017,'The Bristal Assisted Living',NULL,NULL,'Independent and assisted living with protected memory care unit and Alzheimer\'s day program. \n\nPosted 11/19','981596441474018','thebristal.com',NULL,NULL,NULL,'1320205185937576,584503804670909,919422912164535,1235050525416771',NULL,NULL,NULL,NULL,NULL,'1126565962966979',NULL,NULL,NULL,'1229069894695285',NULL,NULL,NULL),(418,1168938188872849,