ese services include minor plumbing, gutter-cleaning, masonry, electrical, carpentry, caulking, weather-stripping, home readiness for winter and summer, and installing smoke detectors, crime prevention devices, grab bars, as well as some emergency services. Also offers free home safety audits for seniors by the home repair staff who check for, identify and correct safety hazards in their homes.\"','1257554801869010','http://www.nyfsc.org/support-services/repair-safety-services/',NULL,NULL,NULL,'1123433776824532',NULL,NULL,NULL,NULL,NULL,'1264384604498988',NULL,NULL,NULL,'1278869071563581',NULL,NULL,NULL),(422,1193014984703523,'Affordable Housing',NULL,645906192644407,'Provide social services to help residents effectively age in place. They provide an apartment-based lifestyle for well, frail and handicapped seniors – complete with the specialized services that many require. ','810722302115785','http://www.nyfsc.org/housing-services/affordable-housing/',NULL,NULL,NULL,'958412510535349',NULL,NULL,NULL,NULL,NULL,'759362541543765',NULL,NULL,NULL,'880683347691640',NULL,NULL,NULL),(423,1196543998642409,'Jewish Board Mental Health Clinics',NULL,732679688850212,'15 mental health clinics in all 5 boroughs of New York City. Provide individual, couples, family and group therapy, as well as evaluation, assessment and medication management.','942646370393141','https://jewishboard.org/about-us/programs-services/mental-health-clinics/',NULL,NULL,NULL,'1112870426305700',NULL,NULL,NULL,NULL,NULL,'1249880844968233',NULL,NULL,NULL,'873818423822151',NULL,NULL,NULL),(424,1140273547837687,'Coming of Age NYC-Men\'s Morning',NULL,771810472955589,'\"Are you missing those informal men’s conversations that you had at work? Would you like to meet other men who want to talk about life in general and life after retirement? Join a new, casual conversation group for New York City men age 50+ at Coming of Age NYC.\"','1067822849784281','http://comingofagenyc.org/',NULL,'pramsden@pssusa.org',NULL,'1275784767796871',NULL,NULL,NULL,NULL,NULL,'1203082927278292',NULL,NULL,NULL,'1215718634831660',NULL,NULL,NULL),(425,1145353126922931,'JCC Confidential Mental Health Counseling',NULL,1146700479099819,'Licensed, experienced clinical social workers offer individual counseling for depression, anxiety, family issues, illness, bereavement, loneliness, and other topics. Most health insurance plans are accepted. Sliding-scale for self-payers. Evenings and Sunday hours are available. Call Irma Kingsley, LCSW (646) 505-4488 to make an appointment. Provided by The Jewish Board at the JCC Manhattan. ','1177679790414542','https://jccmanhattan.org/support-groups-jcc',NULL,'info@jccmanhattan.org',NULL,'1112870426305700',NULL,NULL,NULL,NULL,NULL,'960405153545149',NULL,NULL,NULL,'1243406984924490',NULL,NULL,NULL),(426,1149948935810256,'Adriane Geiger',NULL,1162245122142435,'From Website: A Dignified Life develops and navigates care plans with elders and family members. We assess safety, living conditions/situation, cultural influences, and family dynamics to identify\na comprehensive care plan that addresses specific needs. We do not give lists, but vet, reference and locate specific services based on health, medical, financial, legal and psychosocial status, initially and on an ongoing basis. \n\nPosted 10/19',NULL,'www.adignifiedlife.com',NULL,'ag@adignifiedlife.com',NULL,'922137071025167,1201096778076050',NULL,NULL,NULL,NULL,NULL,'618555432654806',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(427,1159879706949998,'Hamilton Senior Center',NULL,1016766891399541,'Serves lunch and dinner, events, and activities, Monday though Friday, 9:00 am to 7:00 pm. Sunday, 9:00 am to 4:00 pm.','1314245507271763','http://www.projectfind.org/hamilton_center',NULL,NULL,NULL,'843777382088472',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1129502689307004',NULL,NULL,NULL),(428,1174438604011136,'Weill Cornell Community Clinic',NULL,746413696580983,'Dental referrals for low-cost/sliding scale dental services.',