ls, gatekeepers, and community members.\"','1287964721864544,582294416089195,902086089597975','www.jasa.org/community/legal-assistance',NULL,NULL,NULL,'1197693117142860,1107228321502442',NULL,NULL,NULL,NULL,NULL,'916715616855309',NULL,NULL,NULL,'878007159541482,1097459772056084,1043735547400861',NULL,NULL,NULL),(437,1154266262043219,'Friendly Visiting NY',NULL,1164758644753658,'From their website: \"A dynamic and diverse group of volunteers who visit homebound individuals each week. Our visitors come from all ages and are available to provide companionship, reading assistance (reading mail or a favorite news / magazine article), light grocery shopping, support and more.\" Serves Brooklyn and Queens.\nBrooklyn: Bay Ridge, Bensonhurst, Boro Park, Brighton Beach, \nCanarsie, Carol Gardens, Coney Island, Flatbush, Madison, Manhattan Beach, Marine Park, Midwood; Queens: Forest Hills, Kew Gardens, Kew Gardens Hills, Rego Park.','589764166882320','https://www.friendlyvisitingny.org',NULL,NULL,NULL,'1177309407177568,822552305363624,953560938102102',NULL,NULL,NULL,NULL,NULL,'976609030577007',NULL,NULL,NULL,'1209500452547068',NULL,NULL,NULL),(438,1164588453846618,'Encore Neighborhood Senior Center',NULL,667859365781949,'Arts, education, exercise, congregate lunch.','1114084783135534','http://www.encorecommunityservices.org/',NULL,NULL,NULL,'843777382088472',NULL,NULL,NULL,NULL,NULL,'922810387920681',NULL,NULL,NULL,'971484030543087',NULL,NULL,NULL),(439,1165519214801583,'SNAP Transportation',NULL,1140859089015411,'From their website: \"8:00 AM to 4:00 PM for travel to: Medical appointments, food shopping, SNAP of Eastern Queens Innovative Senior Center, community services, cultural trips. SNAP will have an escort available to accompany you on your van trips to medical appointments or wherever independent travel is difficult for you. If you need assistance because of limitations of vision, difficulty walking unassisted, or other concerns, please speak with Marci to arrange for an escort when you use the SNAP van. Please call  to discuss and schedule your requests today.\"','777521721080188','https://snapqueens.org/servicesprograms/transportation',NULL,NULL,NULL,'977021400698839,953560938102102',NULL,NULL,NULL,NULL,NULL,'741622339557367',NULL,NULL,NULL,'1149907731551853',NULL,NULL,NULL),(440,1176659093477619,'Lang Hand Therapy',NULL,NULL,'From their website: \"Certified hand therapists, treat Repetitive Strain Injury, Upper Extremity Trauma, post-surgery, and naturally occurring conditions. Accepts most insurance plans as well as Worker’s Compensation, No Fault and participates in Medicare.\"','896821909691085','http://www.annlangassociates.com/',NULL,NULL,NULL,'1231611168158959,1216469255274749',NULL,NULL,NULL,NULL,NULL,'987854755412976',NULL,NULL,NULL,'997834982320538',NULL,NULL,NULL),(441,1197477436413839,'Helping Hands for the Disabled of NYC',NULL,NULL,'Provides escorting to appointments within the five boroughs of NYC to seniors who are disabled. One week\'s noticed is required in order to find an available volunteer. An application form can be found on their website at https://hhdnyc.org/members. Must provide proof of disability. Membership is $20 per year. Occasionally, seniors without a disability can utilize the service for $10/hour but it depends on their volunteer availability. Director: Alice Crespo. ','811781609291948','www.hhdnyc.org/services-offered',NULL,'hhdfornyc@aol.com',NULL,'1119801442928622',NULL,NULL,NULL,NULL,NULL,'968906653184189',NULL,NULL,NULL,'849902599709404',NULL,NULL,NULL),(442,1197089632949875,'Parkinson\'s: Dance for PD',NULL,1327437375590289,'From their website: \"Dance for Parkinson’s offers specialized dance classes to people with Parkinson’s, their families, friends and care partners in eight locations around New York City and through our network affiliates in more than 100 communities in 20 countries around the world. Dance for PD classes allow people with Parkinson’s to experience the joys and benefits of dance while creatively addressing symptom specific concerns relating to balance, cognition, motor skill, depression and physical confidence.\" ','1342428806583833','www.danceforparkinsons.org/',NULL,NULL,NULL,'1231611168158959,1269324491810499,1288967124858351',NULL,NULL,NULL,NULL,NULL,'951061989560419',NULL,NULL,NULL,'1131835473675431',NULL,NULL,NULL),(443,1207810260759611,'JASA-Case Management',NULL,932368348148295,'Case management for seniors 60 and over and those who are disabled and under 60. Their catchment area covers West 76th Street and below and East 81st Street – East 144th Street.','939211492742480','www.jasa.org',NULL,'help@jasa.org',NULL,'819444632829102',NULL,NULL,NULL,NULL,NULL,'1240040159844520',NULL,NULL,NULL,'1224597133180875',NULL,NULL,NULL),(444,1210402655073552,'Savage Organizing',NULL,NULL,'Professional organizer, two hour minimum. Everything is 100% confidential, as the handling of personal and financial documents is taken very seriously. ','954599725946116','http://savageorganizing.com',NULL,'elizabeth@savageorganizing.com  ',NULL,'796847632116140,941628219469820,933400397911972',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1014326083250530',NULL,NULL,NULL),(445,1160316008602671,'Sparking Wellness & Creativity through Art',NULL,631176636895026,'Mild to moderate memory impairments, including dementia, 5 sessions are $150. Enroll on website or call. ','763644124277369','https://www.lenoxhill.org/sparkingwellness',NULL,NULL,NULL,'1253061813300180,1106914314143204,1285075174713673,1269324491810499',NULL,NULL,NULL,NULL,NULL,'955399961851436',NULL,NULL,NULL,'885741754788620',NULL,NULL,NULL),(446,1176147741239125,'Awaken Seniors',NULL,NULL,'Sensory programs for individuals, senior groups, and memory care. \n\nFrom Website: In the Awaken Seniors program the senses of taste, smell, sight, hearing and touch are used as a means of connecting the participants to other people, their surroundings, and themselves. The memories and discussions that are activated through interaction with natural materials and sensory rich objects such as herbs, flowers, textiles, and hand held musical instruments, help promote and maintain current cognitive abilities. The program consists of a series of one hour sessions.\n\nPosted 11/19',NULL,'www.awakenseniors.com',NULL,'info@awakenseniors.com',NULL,'1304627313120388',NULL,NULL,NULL,NULL,NULL,'1099894660553287',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(447,1185129408106796,'Sparkle and Shine Up Your Life-Support Group',NULL,853324273796035,'Home organizing solutions support group for seniors held at JASA\'s Club 76. Thursdays, 11:00 am to 12:00 pm. $1.00 fee and application for first time attending. Group lead by Kathleen Fiorito.','750408677228991','https://www.jasa.org/Default.aspx?PageID=15526392&A=SearchResult&SearchID=8538153&ObjectID=15526392&ObjectType=1#senior-centers-manhattan',NULL,'help@jasa.org',NULL,'941628219469820,1275784767796871',NULL,NULL,NULL,NULL,NULL,'1280860605181152',NULL,NULL,NULL,'677112248303806',NULL,NULL,NULL),(448,1181269584478999,'Friendship Line-Hotline ',NULL,918027048761188,'National 24-hour support for lonely, isolated, depressed, frail and/or suicidal seniors. Also does grief support through assistance and reassurance. They also make on-going outreach calls to lonely older adults. From their website: Institute on Aging’s 24-hour toll-free Friendship Line is the only accredited crisis line in the country for people aged 60 years and older, and adults living with disabilities. The Friendship Line is both a crisis intervention hotline and a warmline for non-emergency emotional support calls. Friendship Line provides round-the-clock crisis support services including: providing emotional support, elder abuse reporting, well-being checks, grief support through assistance and reassurance, active suicide intervention, information and referrals for isolated older adults, and adults living with disabilities. In addition to receiving incoming calls, Friendship Line also offers outreach to eligible callers. We connect with people on a regular basis, and help monitor their physical and mental health concerns. The call-out services act as an intervention to prevent suicide in the long term by improving the quality of life and connected-ness of isolated callers. Any aging adult or person living with disabilities, who suffers from depression, loneliness, isolation, anxiousness, or may be thinking about death or suicide, can benefit from completely confidential phone calls with Friendship Line volunteers. ','618782630836884','https://www.ioaging.org/services/all-inclusive-health-care/friendship-line',NULL,NULL,NULL,'1112870426305700,1275784767796871,633482549261197',NULL,NULL,NULL,NULL,NULL,'1079607385449927',NULL,NULL,NULL,'1101927784408269',NULL,NULL,NULL),(449,1195943525758008,'Louise’s Pantry',NULL,617927249573600,'From their website: Supplies food, clothing, toiletries, and urgent needs assistance to low-income families and seniors as well as homeless individuals living in the Lower East Side and the Bronx. Serving over 500 individuals per month, Louise’s Pantry meets the nutritional demand of our local communities and provides access to services such as: Housing counseling, urgent needs assistance, nutritional workshops, financial literacy workshops, job readiness workshops. Lower East Side and Bronx locations. Call to confirm hours. ','807799135491682,1229304767384962',' http://nazarethhousingnyc.org/urgent-needs/',NULL,'nnelson@nazarethhousingnyc.org',NULL,'886323941641619,1084050103649570',NULL,NULL,NULL,NULL,NULL,'653776535977214,734859948741175',NULL,NULL,NULL,'995658589839124,919430183128785',NULL,NULL,NULL),(450,1210351428778130,'R.A.I.N. Transportation Program',NULL,560304497188344,'Provides transportation services within Bronx Community Districts 9, 10 and 11 to medical appointments, other appointments or to/from a senior center. Several R.A.I.N. senior centers also provide neighborhood-based transportation services by taxi.  There is a $2 suggested donation for each trip, no one is turned away. Schedule appointment in advance. If you are in need of transportation.','618531427956277','www.raininc.org',NULL,'info@raininc.org',NULL,'977021400698839,652340976007902',NULL,NULL,NULL,NULL,NULL,'1086288440536851,761540767007877',NULL,NULL,NULL,'1297321865616246',NULL,NULL,NULL),(451,1218637398017325,'Solutions at Home',NULL,902596524131974,'Solutions at Home provides dignified care that meets the evolving needs of people as they age; we serve those who need just a little extra help managing chronic conditions at home to the frailest older adults. It is an integrated program that provides geriatric care managers and home health aides that help you receive the right home care services as your needs evolve.\n\nPosted 10/19',NULL,'https://jewishhome.org/our-care-services/homecare/solutions-at-home/',NULL,'ezenker@jewishhome.org',NULL,'922137071025167',NULL,NULL,NULL,NULL,NULL,'1200931893268525',NULL,'945815033667215',NULL,NULL,NULL,NULL,NULL),(452,1224756358117094,'Motzkin Blum Architects',NULL,NULL,'Helping individuals and families set up their home so that it is safe for the elderly.\n\nPosted 10/19',NULL,NULL,NULL,'bud@motzkinblum.com',NULL,'772331273438770',NULL,NULL,NULL,NULL,NULL,'975552303926120',NULL,'609695443483238',NULL,NULL,NULL,NULL,NULL),(453,1170040559078932,'Bill Payer Program',NULL,934656532740108,'From their website: Participants must be 60 or older, receive $60,000 or less in annual income, have a DFTA-affiliated case manager, and have a bank account with sufficient funds to cover their bills. A Bill Payer representative will visit eligible older adults, organize their bills, create a budget, and enroll them in the program, which can be tailored to personal preferences. SilverBills is now a partner of the Bill Payer program, which helps more New Yorkers pay their bills on time without writing and mailing checks, helping avoid the termination of utilities and other disruptions. ','1264937934261227','https://www1.nyc.gov/site/dfta/services/bill-payer-program.page',NULL,NULL,NULL,'787387982275890,933400397911972',NULL,NULL,NULL,NULL,NULL,'1037912257872015',NULL,NULL,NULL,'1014326083250530',NULL,NULL,NULL),(454,1176364336881238,'ElderCare Program',NULL,620372134881678,'\"Drug and alcohol rehab program designed for the special needs of people 55 years old and above with individualized treatment plans. In East Harlem, the East Village, and the Bronx.\"','877554724629020','https://odysseyhousenyc.org/treatment-programs/for-seniors/',NULL,'admissions@odysseyhousenyc.org',NULL,'1112870426305700',NULL,NULL,NULL,NULL,NULL,'871784949661459',NULL,NULL,NULL,'1014326083250530',NULL,NULL,NULL),(455,1177056122238188,'Nicolle Brunale, LMSW: Elder Abuse Prevention Program',NULL,1241915161188721,'FSW’s Elder Abuse Prevention Program is designed to improve the safety and well-being of older adults living in Westchester County who are at risk of abuse by family members.\n\nPosted 10/19',NULL,'https://www.fsw.org/our-programs/older-adults/elder-abuse-prevention-program',NULL,'nbrunale@fsw.org',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'727981592855768,795422610242804',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(456,1188323460627669,'Health Advocates for Older People Healthy Aging Program',NULL,1213503048122805,'Home safety initiative, wellness classes, educational presentations, and social activities. ','1175449155735773','http://www.hafop.org/healthyagingactivities.htm',NULL,NULL,NULL,'843777382088472',NULL,NULL,NULL,NULL,NULL,'1230242548959294',NULL,NULL,NULL,'1184688610639908',NULL,NULL,NULL),(457,1190737484770705,'Sage Eldercare',NULL,NULL,'Information and referrals, shopping help, home delivered meals, classes, home care, adult day program, advocacy.','1188736338044637','http://www.sageeldercare.org/',NULL,'contactus@sageeldercare.org',NULL,'1050752555762937',NULL,NULL,NULL,NULL,NULL,'627664114493723',NULL,NULL,NULL,'1189980434370266',NULL,NULL,NULL),(458,1197778925043296,'Atria Short-Term Respite Stay',NULL,1239412320737696,'In order to stay short-term, a nurse will go to the rehab facility or wherever the client is to do an initial assessment. Short-term stay is generally 30-days, but sometimes it can be shorter. The client needs to be able to ambulate on their own or with a walker. They also need to transfer on their own and take care of oxygen, colostomy bags, etc. on their own. Included in Short-Term Respite Stay: private fully furnished apartment, emergency call system, cable TV, phone and internet, 24-hour medication assistance, 24-hour care staff, 24-hour licensed nurse, daily meals served in dining room, daily fitness opportunities, daily bed making, weekly housekeeping, daily trash removal, weekly personal laundry washed and towels washed twice a week, over 200 on-site and off-site activities per month. ','1132429607914760','www.333w86.com',NULL,NULL,NULL,'924951065612317,973172406940749',NULL,NULL,NULL,NULL,NULL,'1113109181480657',NULL,NULL,NULL,'935506622140725',NULL,NULL,NULL),(459,1202394359751835,'Memory Care at Phelps Hospital',NULL,1053455385946658,'This program centers seniors who are cognitively in-tact but would like to stimulate their brains with education, information, mental exercises, and stimulating activities. \n\nPosted 11/19','596075530439107',NULL,NULL,'vitality@northwell.edu',NULL,'919422912164535',NULL,NULL,'No fees',NULL,NULL,'1270052087147971',NULL,NULL,NULL,'812166387412984',NULL,NULL,NULL),(460,1205866508854219,'University Without Walls: Caregivers\' Connection',NULL,1155578608136431,'Weekly telephone-based support groups and workshops give caregivers the opportunity to speak with experts, learn about resources, and meet other caregivers.\n\nPosted 10/19',NULL,'http://www.dorotusa.org/site/PageServer?pagename=seniors_programs_on_phone_D#.XbHIkJpKiUk',NULL,NULL,NULL,'919422912164535',NULL,NULL,NULL,NULL,NULL,'961421422503173',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(461,1209499812811096,'Safe Horizon 24-Hour Hotline',NULL,858157926955650,'If you need immediate help from a counselor please call one of our 24 hour Hotlines:\nFor domestic violence victims: 800-621-HOPE (4673)\nFor victims of crime and their families: 866-689-HELP (4357)\nFor rape & sexual assault victims: 212-227-3000\nFor domestic violence victims: 800-621-HOPE (4673)\nFor victims of crime and their families: 866-689-HELP (4357)\nFor rape & sexual assault victims: 212-227-3000','787177743234920','https://www.safehorizon.org/',NULL,NULL,NULL,'1197693117142860',NULL,NULL,NULL,NULL,NULL,'1059832769841884',NULL,NULL,NULL,'1070330298015311',NULL,NULL,NULL),(462,1229237902937436,'Sage Center Harlem',NULL,976650048750374,'From their website: \"Serves LGBT older adults from across the borough and throughout the City with a diverse array of social events and support groups, daily hot nutritional lunches, a cyber center, health and wellness programs, arts and cultural events.\"','1314471330928586','https://sagenyc.org/nyc/centers/harlem.cfm',NULL,'scruz@sageusa.org ',NULL,'1047568246255855',NULL,NULL,NULL,NULL,NULL,'948839307360380',NULL,NULL,NULL,'668792055652728',NULL,NULL,NULL),(463,1236026148313985,'Key Food',NULL,NULL,'$50 delivery minimum, under $50 there is a $5 delivery fee, $5 additional fee for ordering over the phone, no fee if you can get to the store and shop yourself. ','805949699206139','https://www.keyfood.com/',NULL,NULL,NULL,'576332581803815',NULL,NULL,NULL,NULL,NULL,'616353237605980',NULL,NULL,NULL,'606423371040196',NULL,NULL,NULL),(464,1177017775479492,'Customize Care',NULL,NULL,'\"Companion, certified Home Health Aide, non-medical care; caregivers have background checks and are licensed. Manhattan, Queens, Bronx, Parts of Westchester, Limited on Staten Island and Rockland County.\nLive-in available (No minimum of hours), $24/hour, 2-4 hours is best, (they are flexible and work with the client), can make referrals 24 hours/7 days. They will make home visit to assess situation. Last minute arrangement can be made at times. Client can request to interview potential caregiver. Agency makes home visits after placement to ensure quality service.\" Jeff Morris, Owner.','1147363227452750','http://www.customizecare.com',NULL,NULL,NULL,'687567198750084',NULL,NULL,NULL,NULL,NULL,'947093922242222',NULL,NULL,NULL,'929586846891734',NULL,NULL,NULL),(465,1207017818560567,'Search & Care Case Management',NULL,1072887075663062,'Serves seniors residing in Manhattan’s Yorkville, Carnegie Hill, and East Harlem communities (catchment area is E. 86th to E.138th Streets, East River to 5th Avenue). Services: case managers make home visits, providing information and counseling, evaluating needs and making referrals.  ','928811788301846','https://www.searchandcare.org/',NULL,'SandC@searchandcare.org',NULL,'819444632829102',NULL,NULL,NULL,NULL,NULL,'880934289187573',NULL,NULL,NULL,'841739048661639',NULL,NULL,NULL),(466,1216660685796724,'Premier Home Health Care',NULL,NULL,'Home care with a holistic approach. Services range from homemaker/companion to 24-hour live-in. Offers home health aides and escorting services. Also offers a Comprehensive Care Management Program (clients are assigned a RN as their primary care manager who oversees all care needs). Private pay and MLTC. Home health aide rates are $26/hour with a required minimum of 3 days, 4 hours. Companion/escort $26/hour with a required minimum of 4 hours. Live-in rates are $338-$386 daily, LPN (licensed practical nurse) $65/hour (4 hour minimum), RN (registered nurse) $85/hour (4 hour minimum). Rates as of 2019. Serves New York, New Jersey, Connecticut, Massachusetts, Florida, Illinois, and North Carolina. Nancy Depowski, RN-Manager of Business Development (Private Pay Division).','992287952648753','http://www.premierhomehealthcare.com/',NULL,'ndepowski@phhc.com',NULL,'687567198750084,1119801442928622',NULL,NULL,NULL,NULL,NULL,'1157840024526127',NULL,NULL,NULL,'595035344889862',NULL,NULL,NULL),(467,1220235381125004,'Senior Services',NULL,549012609186850,'Health, medical, and social services for seniors. \n-Outpatient services\n-VoiceCare Response System: two-way emergency response device installed in a patient\'s home\n-medSmart medication management: automated system that organizes, reminds, and dispenses\n-Alternative Living Arrangements\n-HealthAccess: Special membership program for older adults. Promotes wellness, links seniors to vital health services. Membership benefits include I&R, health information in hospital publications, health lectures, seminars, and screenings, discounts on hospital parking, cafeteria, and local shops. MallWalkers exercise program.\n\nPosted 11/19','1189917318871768',NULL,NULL,NULL,NULL,'772331273438770',NULL,NULL,NULL,NULL,NULL,'1177506699911670',NULL,NULL,NULL,'606470732447830',NULL,NULL,NULL),(468,1236090707883067,'Penn South Program for Seniors',NULL,944066288204652,'Monday-Friday, 9 am-5 pm and two Wednesday evenings per month, health, educational, recreational, and cultural programs for NYC residents 55 years and older. ','616950932131541','https://psss.org/',NULL,NULL,NULL,'843777382088472',NULL,NULL,NULL,NULL,NULL,'1118630237134725',NULL,NULL,NULL,'908887889715535',NULL,NULL,NULL),(469,1234586145288621,'New York Legal Assistance Group (NYLAG)',NULL,NULL,'From their website: \"Direct legal services, class action and other impact litigation, legal case consultation, community education, volunteer programs, Swiss Bank Settlements, German Slave and Forced Labor Fund.\" Serves all 5 boroughs and Long Island.\"','1111363156492390','http://www.nylag.org/',NULL,NULL,NULL,'1107228321502442',NULL,NULL,NULL,NULL,NULL,'855994602259755',NULL,NULL,NULL,'1051327225532970',NULL,NULL,NULL),(470,1240501756689884,'Dumont Center for Rehabilitation & Nursing Care',NULL,NULL,'The Dumont Center is a 196 bed facility that offers short-term rehab, long-term skilled nursing care, and a secure memory care unit. Rehabilitation is based on a holistic, individualized care approach and includes palliative care. Long-term care is assisted by 24/7 nursing staff and hosts therapeutic recreation programs, events, and activities. \n\nPosted 11/19','918457661004383','dumontcenter.com',NULL,'info@dumontcenter.com',NULL,'919422912164535,628102384928895,1132943173487126,1203572911800812',NULL,NULL,NULL,NULL,NULL,'1281779655773394',NULL,NULL,NULL,'588121571225917',NULL,NULL,NULL),(471,1240411803900901,'Housing Court Answers',NULL,NULL,'Hotline open Tuesday to Thursday 9:00 am-5:00 pm, They also have an information table, available Monday to Friday, 9:00 am to 4:00 pm (may be closed for lunch). Both help with: Housing Court and Housing Court procedures, landlord & tenant rules and regulations, enforcement of housing code violations, referrals for free legal help, referrals to community organizations that help with housing problems. They do not provide direct financial help for paying back rent — they will refer you to a charitable organization or provide you with information about the Human Resources Administration’s rules for assistance with back rent; screening by phone: If you qualify*, they will tell you which charities have funds, what requirements they have, and how to contact them. They can also explain how to apply for a one shot deal. *To qualify for rent arrears assistance from charities, you must meet four criteria: you must have a case in housing court or a rent demand from your landlord, explain how you fell behind, the ability to pay the current rent going forward, and back rent that is not too high.','1095635757943100','www.housingcourtanswers.org',NULL,NULL,NULL,'958412510535349',NULL,NULL,NULL,NULL,NULL,'878980778779978',NULL,NULL,NULL,'867597028808901',NULL,NULL,NULL),(472,1188870419050533,'Harrison Community Services',NULL,1140426797583146,'The Town / Village of Harrison Department of Community Service programs include the Senior Safety Check, Senior Medical Transportation, Senior Taxi Vouchers and the Harrison Food Pantry. ln addition, Community Services provides information and referrals to other local services and government assistance agencies. You must be a Harrison resident to participate in Community Services Programs.\n\nPosted 10/19',NULL,'https://www.harrison-ny.gov/community-services',NULL,NULL,NULL,'1233481324906768',NULL,NULL,NULL,NULL,NULL,'815151528724802',NULL,'1141757559922126',NULL,NULL,NULL,NULL,NULL),(473,1194700075014095,'Westchester County Livable Communities',NULL,1273704954905898,'Livable communities encourages seniors to come together to think, make choices, and take action in ways that will improve their quality of life for people of all ages through affordable, accessible housing options, recreational/social/cultural activities, public transportation and walkable streets, preservation of positive features for the future. Allows seniors to live in their homes or in appropriate and affordable housing. \n\nPosted 11/19',NULL,'seniorcitizens.westchestergov.com/livable-communities',NULL,'cap2@westchestergov.com',NULL,'916066334101408,772331273438770',NULL,NULL,NULL,NULL,NULL,'1232511819157441',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(474,1212568794587059,'Care Buddies',NULL,577622941794896,'From their website: \"A volunteer companionship program for people with dementia. Our Care Buddies are trained based on a Seivah-created curriculum. Our unique program is based on an active dialogue  between Seivah, our volunteers, people with dementia and their caregivers.\"','1121803768506081','https://beyondmemory.org/care-buddies/',NULL,NULL,NULL,'1253061813300180,1106914314143204,1285075174713673,919422912164535',NULL,NULL,NULL,NULL,NULL,'1235801167970102',NULL,NULL,NULL,'837398020781190',NULL,NULL,NULL),(475,1213181216253090,'A Place for Mom-Senior Living Advisors',NULL,NULL,'Senior living advisers are available to guide you through finding an assisted living facility. Compare costs, see photos, and read reviews. There is no charge for their services (they are paid by their partner communities if you choose to move in). Jacqueline Cocklin is the NYC-area Healthcare Account Representative for A Place for Mom. Their website includes an online resource for information about assisted living communities. ','811115030361220','https://www.aplaceformom.com/assisted-living',NULL,'Jackie.Cocklin@aplaceformom.com',NULL,'924951065612317,973172406940749,958412510535349',NULL,NULL,NULL,NULL,NULL,'850221687837576',NULL,NULL,NULL,'1014326083250530',NULL,NULL,NULL),(476,1213660362836314,'Caregivers Service',NULL,813404076587588,'Offers two support groups: one specifically for caregivers of people with Alzheimer\'s and other cognitive impairments, and the other is for caregivers of people over 60: workshops, support groups, consultation with social worker.','1338205487562050','www.nyp.org/clinical-services/geriatrics/healthoutreach',NULL,NULL,NULL,'673898301722674,1253061813300180,1106914314143204,1285075174713673',NULL,NULL,NULL,NULL,NULL,'638413316648707',NULL,NULL,NULL,'814141927898958',NULL,NULL,NULL),(477,1219015907043538,'BronxWorks-Living Room Drop-in & Safe Havens Shelters',NULL,906521277291901,'The Living Room is the only 24-hour drop-in center in the Bronx for street homeless adults. Clients are welcome to spend time off the street, use the laundry and showers, eat a hot meal, and get other essential help. Safe Havens are temporary shelters for homeless adults.\nThe Barretto Street Safe Haven (in the same building as the Living Room) has 50 beds for homeless adults. The Pyramid Safe Haven has 125 beds for single adult males. The Living Room and Safe Havens offer: housing placement and benefits assistance, medical and psychiatric care, nutritional assistance, medication monitoring, substance abuse counseling, and drug and alcohol treatment referrals. For more information, please contact Noel Concepcion, Director.','1253176125780690','http://www.bronxworks.org/living-room-safe-havens',NULL,'nconcepcion@bronxworks.org',NULL,'958412510535349',NULL,NULL,NULL,NULL,NULL,'1165211000002058',NULL,NULL,NULL,'1289865550774816',NULL,NULL,NULL),(478,1223138915418142,'Caregivers to the Elderly Support Group',NULL,1189021173628308,'\"A Self-help group which provides support, resources, and an opportunity to connect with other caregivers of the elderly on the first and third Wednesday of each month. Meetings are held from 5:30 p.m. to 7:30 p.m. and are free for all attendees.\"','1199704775068360','http://westviewnews.org/2018/03/update-caregiver-support-program/',NULL,NULL,NULL,'673898301722674',NULL,NULL,NULL,NULL,NULL,'1154783122096922',NULL,NULL,NULL,'728549338926528',NULL,NULL,NULL),(479,1239506980854547,'Search & Care Money Matters Program',NULL,1072887075663062,'From their website: \"Assist economically at-risk seniors with the following: Organize documents and bank statements, help with paying bills on time, offer assistance with creating monthly budgeting, identify and eliminate unnecessary expenses, and maximize income, advise about debt control, reduction, and/or consolidation, advocate with creditors, collection agencies, and banks, educate clients about avoiding financial risks, elder exploitation, and much more.\" For case management clients residing in Manhattan’s Yorkville, Carnegie Hill, and East Harlem communities (catchment area is E. 86th to E.138th Streets, East River to 5th Avenue). ',NULL,'https://www.searchandcare.org/money-matters/',NULL,' SandC@searchandcare.org',NULL,'787387982275890',NULL,NULL,NULL,NULL,NULL,'880934289187573',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(480,1241397474935978,'Neighbor to Neighbor',NULL,829089648824054,'Neighbor-to-Neighbor program (or N2N), offers the help of our carefully selected neighborhood volunteers. N2N is our outreach to neighbors who may need assistance with errands or wish to have company for a walk in the park or a game of Scrabble. Our N2N volunteers are also able to serve as an escort for a trip to the doctor or the grocery store. Must be a member to use services. Become a member by calling or filling out registration form online. Catchment area is W. 96th to W. 110th Street, between Riverside Drive and Central Park West.','615744816908233','https://www.bloominplace.org/neighbor-to-neighbor.html',NULL,NULL,NULL,'1119801442928622',NULL,NULL,NULL,NULL,NULL,'635847540506838',NULL,NULL,NULL,'777680203932503',NULL,NULL,NULL),(481,1253367569891678,'City Harvest Mobile Food Pantries',NULL,NULL,'Available in 5 boroughs of NYC. Through our Mobile Markets, City Harvest delivers fresh fruits and vegetables, free of charge, to thousands of New Yorkers each month.\nCommunity members gather in farmers’ market settings, where they receive fresh produce and participate in cooking demonstrations to learn how to make healthy meals. Our community health partners also offer free wellness programs, such as blood pressure screenings. We also partner with other non-profit organizations, including Brighter Bites, Harlem Children’s Zone, and the YWCA in Queens to create bi-monthly food distributions at sites that are fully operated by members of the community they serve. See website for specific times and locations. ','732672739823207','https://www.cityharvest.org/programs/mobile-markets/',NULL,NULL,NULL,'886323941641619,822552305363624,953560938102102,652340976007902',NULL,NULL,NULL,NULL,NULL,'624332088773277',NULL,NULL,NULL,'655678559189627',NULL,NULL,NULL),(482,1256028243213094,'55 Kip Centerhira',NULL,NULL,'Older adult center, also sponsors a Caregiver\'s Support Group','761837644580970','http://www.55kipcenter.org/',NULL,NULL,NULL,'1050752555762937,843777382088472',NULL,NULL,NULL,NULL,NULL,'860615400265787',NULL,NULL,NULL,'1276721498543351',NULL,NULL,NULL),(483,1199659418150564,'Happy Donations',NULL,NULL,'You pack and ship donations (clothing) via UPS for free--donated to US Veterans (print free shipping label & bring to UPS).','753864000884116','www.happydonations.org/',NULL,NULL,NULL,'1084050103649570',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1014326083250530',NULL,NULL,NULL),(484,1216327547957434,'Sirovich Center for Balanced Living',NULL,1207997185642827,'From their website: \"An innovative center for older adults, 60+, arts, trips to museums, gardens, opera appreciation, short story discussion, writers and storytellers, public safety workshops, open tech lab, singing groups and concerts, meals onsite, free registration required (bring ID).\" ','1265389122657589','www.edalliance.org',NULL,NULL,NULL,'843777382088472',NULL,NULL,NULL,NULL,NULL,'846251232422980',NULL,NULL,NULL,'939002774280924',NULL,NULL,NULL),(485,1219655743671609,'College at 60',NULL,767486610584983,'\"The program offers noncredit courses in areas such as creative writing, U.S. history, philosophy and literature. The name College at 60 refers to its location at Fordham’s Lincoln Center campus on West 60th Street and also to its students—most of whom are over the age of 60.\"',NULL,'https://www.fordham.edu/downloads/file/7226/college_at_60_courses',NULL,NULL,NULL,'972558970458700',NULL,NULL,NULL,NULL,NULL,'635890582774014',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(486,1216907435761775,'Laurie Racanelli, MPA',NULL,1126471110627273,'Home Care Consultant\n\nPosted 10/19',NULL,'https://caringpeopleinc.com/',NULL,'laurie.racanelli@caringpeopleinc.com',NULL,'1201096778076050',NULL,NULL,NULL,NULL,NULL,'922727698476973,1252610465323730',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(487,1240912681971230,'Visiting Nurse Service Hospice Care',NULL,830940502172759,'VNSNY Hospice and Palliative Care provides care wherever you call home—a private residence, a nursing home or assisted living facility, an inpatient facility, or VNSNY’s hospice residence. Special Hospice Services and Programs are: Hospice Care Program for Veterans, Grief Support, Hospice Outreach Support, LGBT Cultural Competency Training. Service areas include the Bronx, Brooklyn, Manhattan, Queens, and Staten Island.                ','1040597194330657','https://www.vnsny.org/how-we-can-help/hospice-palliative-care/',NULL,NULL,NULL,'1273907163486188,895685198543031',NULL,NULL,NULL,NULL,NULL,'1101462622238581',NULL,NULL,NULL,'1014326083250530',NULL,NULL,NULL),(488,1264542371473949,'Leonard Covello Senior Program',NULL,954473100289340,'Offers social, recreational and educational activities for any individual over the age of 60. Art workshops, health workshops and a caregiver resource program.','977489294940237','http://www.carterburdennetwork.org/covello',NULL,NULL,NULL,'843777382088472',NULL,NULL,NULL,NULL,NULL,'632830671024006',NULL,NULL,NULL,'966212639405674',NULL,NULL,NULL),(489,1267032764859038,'Judie Kaplan: Personal Concierge',NULL,NULL,'Judie provides lifestyle management services including bills, shopping, medical advocacy, and geriatric care management. She has 35 years of experience in healthcare administration. She does not provide cooking or care-giving services.\n\nPosted 10/19',NULL,'http://judiekaplan.com/',NULL,'jkaplan@judiekaplan.com',NULL,'772331273438770,922137071025167',NULL,NULL,NULL,NULL,NULL,'759123208878280',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(490,1268406867716696,'Luncheon Club & Senior Program',NULL,954473100289340,'From their website: \"provides socialization, recreation, education, congregate luncheon meals, activities, day trips, computer training and holiday parties. The program also delivers daily meals to homebound individuals. Case assistance is offered to members/participants who need help in applying for government benefit programs, addressing landlord/tenant disputes, or accessing medical care. Open to anyone age 60 or over, regardless of where s/he lives.\" ','950949096637794','http://www.carterburdennetwork.org/cblc',NULL,'watkinsj@carterburdennetwork.org',NULL,'843777382088472',NULL,NULL,NULL,NULL,NULL,'1119434710363925',NULL,NULL,NULL,'925514079827533',NULL,NULL,NULL),(491,1215662972819878,'Soul Ryeders',NULL,NULL,'SOUL RYEDERS is a volunteer-driven charitable organization, based in Westchester County, NY, committed to empowering those in our community who are affected by all types of cancer. From diagnosis through treatment, recovery and survivorship, they offer practical resources and support.\n\nPosted 10/19',NULL,'www.soulryeders.org',NULL,NULL,NULL,'1137936067119622',NULL,NULL,NULL,NULL,NULL,'1204206691608265',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(492,1211996608514384,'The Doula Program to Accompany and Comfort',NULL,NULL,'From their website: \"Our Doula Volunteers provide an ongoing relationship as illness progresses. Activities vary depending upon each individual / and safety and can include: talking, reading, listening to music, watching TV or a movie, special projects, walking outside, or sitting quietly. Doula Volunteers visit weekly with one individual until he or she dies. These meaningful relationships last weeks, months and years. The Doula Volunteer will continue to visit if the location changes, services change or the person is admitted into the hospital.\" For people with a life threatening illness or advanced illness, limited support from family and friends; or could benefit from a relationship with a Doula Volunteer, a professional is monitoring the needs of this person as their illness progresses. Memory impairment is individually assessed.','993164442437340','www.doulaprogram.org/',NULL,' alevine@doulaprogram.org',NULL,'1177309407177568,809388330706262',NULL,NULL,NULL,NULL,NULL,'1065107219966799',NULL,NULL,NULL,'1196715923709819',NULL,NULL,NULL),(493,1223656019023368,'Karpoff Affiliates, Inc.-Senior Move Manager & Real Estate Broker',NULL,NULL,'Senior move manager and real estate broker, Marilyn Karpoff (founder and CEO). A full-service real estate company that specializes in both residential and commercial sales & leasing, as well as senior transition services. Their signature service, Moving On NYC is New York’s only comprehensive real estate brokerage service offering elder / senior downsizing, relocation, and transition services. They handle every aspect of your move from start to finish, and you only deal with one person throughout the entire transition.','800473553887862','http://karpoffaffiliates.com/senior-move-manager/senior-move-managers/',NULL,'mkarpoff@karpoffaffiliates.com',NULL,'788089004816800',NULL,NULL,NULL,NULL,NULL,'1327034407213809',NULL,NULL,NULL,'761072000557025',NULL,NULL,NULL),(494,1229494557540093,'Q-Center Older Adult Mingle',NULL,627548540763316,'Older adult mingle, 2nd and 4th Thursday of each month at 6 pm - 8 pm. Call to confirm details.','770586706885860','https://lgbtnetwork.org/content/q-center-older-adult-mingle-0',NULL,'qcenter@lgbtnetwork.org',NULL,'1047568246255855,953560938102102',NULL,NULL,NULL,NULL,NULL,'1086710377751935',NULL,NULL,NULL,'1118552265807821',NULL,NULL,NULL),(495,1244522332284339,'Home Health Services',NULL,1272098259280185,' Founded in 1947, Home Health Services of WJCS is a NY State-licensed home care service agency (LHCSA) and a leader in setting the standards for trusted and compassionate home care. WJCS Home Health Services accept clients on a fee for services basis only. \n\nUpdated 11/19',NULL,'http://www.wjcs.com/home-health-services-of-wjcs/',NULL,'scottrell@wjcs.com',NULL,'1201096778076050',NULL,NULL,NULL,NULL,NULL,'1210604233829508',NULL,'1120163497064489',NULL,NULL,NULL,NULL,NULL),(496,1241720802411823,'SelfHelp-Safety Net',NULL,911077302205989,'Social workers can help individuals who qualify to access financial assistance. This program is funded by New York Times Neediest and other private grants and donations. They have a catchment area of West 70th and above and East 80th Street and below. They will serve seniors 60 and over for short-term or long-term case management and also those who are disabled and under 60. ','1065629603438429','www.selfhelp.net',NULL,NULL,NULL,'787387982275890',NULL,NULL,NULL,NULL,NULL,'802120394391231',NULL,NULL,NULL,'1194048928419700',NULL,NULL,NULL),(497,1258967985893536,'Westfair Rides',NULL,NULL,'We