rance and you will receive reimbursement directly from insurance, depending on your allowable coverage. Reimbursement can take up to 4 weeks.\" Serves the 5 boroughs, Westchester, and Long Island.','1295214123190904','https://housecalldentists.com/',NULL,'info@housecalldentists.com',NULL,'580054623534909,1216469255274749,1180772910179038',NULL,NULL,NULL,NULL,NULL,'805231948388075',NULL,NULL,NULL,'943427671265737',NULL,NULL,NULL),(532,1239655867823447,'Starkey Hearing Foundation',NULL,NULL,'From their website: \"Free hearing aides, Starkey Hearing Foundation has provided more hearing help to people in the United States than to any other country. Hear Now is our application-based program that provides hearing help to low-income Americans. Each person we help is fit with new, top-of-the-line digital hearing aids that are customized to their hearing loss.\"','1271141840363100','https://www.starkeyhearingfoundation.org/Hear-Now',NULL,'hearnow@starkeyfoundation.org ',NULL,'673030812970350,1293277534665673',NULL,NULL,NULL,NULL,NULL,'686894087730383',NULL,NULL,NULL,'1227774060333570',NULL,NULL,NULL),(533,1240719709350857,'Medicare Rights Center',NULL,NULL,'From their website: \"Counselors are available Monday through Friday, and are happy to answer your questions about insurance choices, Medicare rights and protections, payment denials and appeals, complaints about care or treatment, and Medicare bills.\"','872485557741218','www.medicarerights.org/',NULL,NULL,NULL,'629629464544122',NULL,NULL,NULL,NULL,NULL,'879719795454457',NULL,NULL,NULL,'1189605365378293',NULL,NULL,NULL),(534,1243877911908717,'Wartburg Independent Senior Living',NULL,NULL,'Independent living with a choice of luxury town-homes or affordable apartments. \n\nPosted 11/19','765699205410965','wartburg.org',NULL,NULL,NULL,'584503804670909',NULL,NULL,NULL,NULL,NULL,'828012618075669',NULL,NULL,NULL,'910614665412633',NULL,NULL,NULL),(535,1256776989031477,'We Can Do It!',NULL,NULL,'Home cleaning service, price esti