afop.org/',NULL,NULL,NULL,'1119801442928622',NULL,NULL,NULL,NULL,NULL,'778191663879777',NULL,NULL,NULL,'1184688610639908',NULL,NULL,NULL),(539,1270995080192311,'Stein Neighborhood Senior Center',NULL,868849662691362,'8:00 am – 4:00 pm, programs, services, activities and classes that promote health, safety, socialization and independence for adults age 60+','629220063394155','http://steinseniorcenter.org/',NULL,NULL,NULL,'843777382088472',NULL,NULL,NULL,NULL,NULL,'1316719436207448',NULL,NULL,NULL,'1232334608351647',NULL,NULL,NULL),(540,1284827843518404,'Lifeforce in Later Years',NULL,NULL,'Morningside Village volunteers & West Harlem volunteers escort seniors to and from medical appointments and shopping help (catchment area: W.105th Street, Riverside Drive, W. 122nd Street, & Morningside Drive OR between Riverside Drive and Convent Avenue, from W. 123rd Street to W. 135th Street).','1247557576220419','http://lifeforce-in-later-years.org',NULL,NULL,NULL,'1119801442928622',NULL,NULL,NULL,NULL,NULL,'1230097972711663',NULL,NULL,NULL,'945101274565721',NULL,NULL,NULL),(541,1298257758234839,'Doctors on Call',NULL,NULL,'Home visits are available 7 days a week, 8:00 am – 7:00 pm. Serves five boroughs of New York City, Long Island, and Lower Westchester. Upon scheduling your first appointment, Doctors on Call customer service will inform you of any deductible and/or co-payment which may apply. Medicare may require you to pay a co-payment/deductible. A medical provider will then visit your home at the scheduled day and time. Prepare all your medications, vitamins, home remedies, and prescriptions; copies of medical logs and test results; any hospital discharge papers and patient summaries. During the initial visit, a comprehensive physical examination and include any necessary diagnostic and medical testing including blood work, EKGs, x-rays, ultrasounds, and ECHOs will be performed. A customer service representative is available Monday to Friday, 8:00 am to 6:00 pm.','1160679253719720','https://doctorsoncallnyc.com/',NULL,NULL,NULL,'1216469255274749,1180772910179038',NULL,NULL,NULL,NULL,NULL,'750619344892568',NULL,NULL,NULL,'803561372958386',NULL,NULL,NULL),(542,1304960846961830,'Interim Healthcare',NULL,NULL,'Home Care Services are cost-effective and designed to meet the individual needs of each patient. Interim HealthCare of White Plains is here for you and your family whether you need home care for a short time when you return from a hospital stay or non-medical senior care to help with some of the tasks of daily living.\n\nPosted 10/19','1272153314075053','https://www.interimhealthcare.com/whiteplainsnewyork/home/',NULL,NULL,NULL,'1201096778076050',NULL,NULL,NULL,NULL,NULL,'843660103147840',NULL,NULL,NULL,'639095262315610',NULL,NULL,NULL),(543,1312005327748564,'Meet Me at MoMA',NULL,1158350093285794,'Education programs for individuals with Alzheimer\'s disease and their care partners, free of charge.','1274213140699678','www.moma.org/visit/accessibility/dementia',NULL,'accessprograms@moma.org',NULL,'1253061813300180,1106914314143204,1285075174713673,1269324491810499',NULL,NULL,NULL,NULL,NULL,'871908324935758',NULL,NULL,NULL,'940971606891404',NULL,NULL,NULL),(544,1312828607605887,'Garito Manor at Union Square',NULL,NULL,'Affordable independent senior living--two daily meals, 24 hour security, weekly housekeeping, and transportation to medical appointments within 10 miles available. Utilities are complementary. \n\nPosted 11/19','933566078964537','www.garitomanor.com',NULL,'jtrifono@garitomanor.com',NULL,'584503804670909',NULL,NULL,NULL,NULL,NULL,'627393396325750',NULL,NULL,NULL,'979349518562869',NULL,NULL,NULL),(545,1256346402285537,'Manhattan House Calls-Denis Tarrant, NP',NULL,NULL,'Primary care home visits in Manhattan (serving SoHo, lower Manhattan, and the east and west side up to 120th street). If you are unable to leave your home without the help of another individual or assistive device (walker, wheelchair, etc.), or if leaving your home is physically taxing, you are an ideal candidate for this unique home visiting program. Services include: physical examination, prescriptions, in-home radiology (X-ray, sonograms, etc.), laboratory referrals, electrocardiogram (EKG) testing/interpretation, immunization/vaccination, medical equipment ordering, referrals for home health agencies, referrals for other house call specialists (podiatry, gastroenterology, orthopedics, etc.). Traditional Medicare policies will cover 80% of services rendered, and the remaining 20% can be covered by secondary insurance contracts (including Medicaid), personal checks, or money order. Call with any questions regarding payment options or eligibility.','760050395146570','http://www.medhousecalls.com',NULL,'info@medhousecalls.com',NULL,'1216469255274749,1180772910179038',NULL,NULL,NULL,NULL,NULL,'887007035012577',NULL,NULL,NULL,'1014326083250530',NULL,NULL,NULL),(546,1262325576299114,'Whole Foods-Delivery',NULL,NULL,'Groceries Delivered in 1 Hour, or 2 hours, delivery fee $3.99-$5.99. Order online. See website for details.','936899435398785','https://delivery.wholefoodsmarket.com/',NULL,NULL,NULL,'576332581803815',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1014326083250530',NULL,NULL,NULL),(547,1275023560464330,'Income Support Services',NULL,929616229953100,'From their website: \"Income Support Services provides cash assistance to help individuals achieve education and employment goals. Income Support Services provides grants to pay for tools, clothing/uniforms, test fees and transportation, thus allowing people to take vital steps toward employment and economic stability. This Initiative is funded by The New York Times Neediest Cases Campaign.\"','671749238369587','www.cssny.org/programs/entry/income-support-services',NULL,'info@cssny.org    ',NULL,'787387982275890',NULL,NULL,NULL,NULL,NULL,'920587458407020',NULL,NULL,NULL,'874421223459795',NULL,NULL,NULL),(548,1276461924662255,'Legal Services for the Elderly in Queens',NULL,853324273796035,'From their website: \"Provides free legal services for adults, age 60+, who live in the borough of Queens. Our legal advocacy professionals are experienced in matters affecting senior clients and are trained to assist with issues pertaining to civil law including: Eviction prevention and housing rights, foreclosure prevention and real property fraud, social security, SSI, Medicare and Medicaid eligibility, and other assistance programs. Also offers free estate planning to low-income seniors in cooperation with an estate planning law firm and works with area social service agencies, senior centers, and professionals on issues affecting older adults.\"','1108475787187537','https://www.jasa.org/community/legal-assistance#.W1DRedVKiUk',NULL,'help@jasa.org',NULL,'1107228321502442,953560938102102,1267306776036445',NULL,NULL,NULL,NULL,NULL,'826288137435130',NULL,NULL,NULL,'1043735547400861',NULL,NULL,NULL),(549,1281076529761256,'Riverstone Senior Life Services Memory Center (Washington Heights)',NULL,NULL,'Cognitive exercises, brain games/puzzles, arts & crafts, dance, exercise, discussion groups, music therapy (transportation provided if within catchment area), program operates Mon.-Sat. 10 am-3 pm, (flexible Saturday hours – participants can attend from 1-5 hrs); Fees may be covered by Medicaid Long Term Care (MLTC), Private Long Term Care or private pay. Also offer caregiver support. Catchment area:Washington Heights & Bronx for transportation. Call to confirm dates and times.','1296950242097677','www.riverstonenyc.org/riverstone-memory-center/',NULL,NULL,NULL,'1253061813300180,1106914314143204,1285075174713673,673898301722674',NULL,NULL,NULL,NULL,NULL,'797773876283401',NULL,NULL,NULL,'1237516259617157',NULL,NULL,NULL),(550,1284278357229205,'The Legal Aid Society',NULL,NULL,'From their helpline: \"Helpline with general intake; Through our Civil, Criminal Defense, and Juvenile Rights Practices, we offer an unmatched depth and breadth of legal expertise to vulnerable New Yorkers in over 300,000 legal matters each and every year. Also assist with obtaining health care proxy and Power of Attorney.\" Multiple locations throughout the 5 boroughs.','685644308217789','http://www.legal-aid.org',NULL,NULL,NULL,'1107228321502442',NULL,NULL,NULL,NULL,NULL,'979706913643219',NULL,NULL,NULL,'1014326083250530',NULL,NULL,NULL),(551,1291294318091950,'Senior Helpers',NULL,NULL,'Serving Mount Kisco, Armonk, Bedford, Bedford Hills, Chappaqua, Elmsford, Harrison, Hartsdale, Hawthrone, Katonah, Mamaroneck, Pleasantville, Rye Brook, Purchase, Rye, Larchmont, Scarsdale, Thornwood, Valhalla, White Plains, W. Harrison.\n\nPosted 10/19',NULL,'https://www.seniorhelpers.com/westchestercounty-ny/',NULL,'SHWestchesterinfo@seniorhelpers.com',NULL,'1201096778076050',NULL,NULL,NULL,NULL,NULL,'667168843746217,859243806108076',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(552,1293120242108497,'Union County Paratransit System',NULL,NULL,'Provides curb to curb, non-emergency transportation for older adults, ages 60 and older, veterans, those who are temporarily disabled, and low income individuals. The unit can provide transportation for any of the following requests:\nMedical appointments, education, employment, nutrition, shopping, recreation, bus & rail. Services are available on a first come first serve basis. Riders are asked to call 5 to 7 days in advance to request transportation services (chemo treatment and dialysis appointments get priority), $2 each way, billed at the end of the month.','1280089179968999','http://ucnj.org/departments/human-services/paratransit-system/',NULL,'kcarmello@ucnj.org',NULL,'1050752555762937,977021400698839,895685198543031',NULL,NULL,NULL,NULL,NULL,'1251630110625947',NULL,NULL,NULL,'840738615590122',NULL,NULL,NULL),(553,1316003479156299,'Alzheimer\'s Foundation of America-Caregiver Support Groups',NULL,875087617643548,'Support groups to help individuals living with Alzheimer’s disease, their caregivers and families.','645252881647646','https://alzfdn.org/caregiving-resources/2860-2/',NULL,NULL,NULL,'1253061813300180,673898301722674,1106914314143204,1285075174713673',NULL,NULL,NULL,NULL,NULL,'1182095960005145',NULL,NULL,NULL,'1140897431336658',NULL,NULL,NULL),(554,1322393522858790,'Renewal Care-“Beginnings” Program',NULL,NULL,'From their website: \"Social gathering for older adults with early or mid­stage Alzheimer’s disease, dementia, and other neurocognitive disorders. Each meeting offers social, intellectual, and physical engagement in an uplifting and safe environment. Eligibility: Living with early or mid-stage Alzheimer\'s disease, dementia, or a related neurocognitive disorder, independent in activities of daily living, 60 years of age or older. Meet with staff before admission to the \"Beginnings\" program. During initial meeting, potential members and their families have the opportunity to discuss \"Beginnings\" with group leaders to ensure the program will be a mutual fit. 11 am-2 pm Tuesdays and Thursdays.\" Call to confirm dates and times.  ','1134223710115425','http://renewalcare.org/services/social-programs/',NULL,NULL,NULL,'1253061813300180,1106914314143204,1285075174713673',NULL,NULL,NULL,NULL,NULL,'878893770449504',NULL,NULL,NULL,'1212148398612908',NULL,NULL,NULL),(555,1323032649532712,'NJ EASE',NULL,1101629059097358,'From their website \"provide easy, local access to a coordinated system of consumer responsive services. By using the State telephone number, individuals or caregivers can receive information on a variety of services designed to foster the independence and dignity of New Jersey citizens in need of assistance.\"','1115651800063848','https://seniorsresourceguide.com/directories/National/NJEASE/index.html',NULL,NULL,NULL,'1050752555762937',NULL,NULL,NULL,NULL,NULL,'934056038093735',NULL,NULL,NULL,'1014326083250530',NULL,NULL,NULL),(556,1332578153820786,'Financial Empowerment Center',NULL,611430825435869,'\"Free one-on-one financial counseling: help you take control of your debt, deal with debt collectors, improve your credit, create a budget, open a bank account, start an emergency fund, save and plan for your future.\"','1250804642337187','https://www.nycservice.org/initiatives/index.php?bitinitiative_id=6',NULL,NULL,NULL,'787387982275890',NULL,NULL,NULL,NULL,NULL,'1037912257872015',NULL,NULL,NULL,'1014326083250530',NULL,NULL,NULL),(557,1263972816227961,'The Teal Room-Memory Café ',NULL,875087617643548,'Co-sponsored by 305 West End Assisted Living and the Alzheimer’s Foundation of America. \"The Teal Room is a unique, comfortable, and socially engaging space. It’s a café for individuals with Alzheimer’s disease and other related cognitive disorders, and their caregivers to enjoy an afternoon of activity in a dementia-friendly environment. 2:30-4:00 on select Wednesdays. Light refreshments will be served, no cost, space is limited (call to RSVP and to confirm times and dates). ','1174681486621078','https://305westendassistedliving.com/memory-care/',NULL,NULL,NULL,'1253061813300180,1106914314143204,1285075174713673',NULL,NULL,NULL,NULL,NULL,'1182095960005145',NULL,NULL,NULL,'1040500967870649',NULL,NULL,NULL),(558,1272477138964542,'Queens Community House Case Management',NULL,964490714809680,'Provides case management services, home delivered meals, and Friendly Visiting for seniors in Queens. ','1047231025633139','https://www.qchnyc.org/',NULL,NULL,NULL,'819444632829102,1177309407177568,935600275247423,953560938102102',NULL,NULL,NULL,NULL,NULL,'940860260750639',NULL,NULL,NULL,'972153985339436',NULL,NULL,NULL),(559,1268800755789099,'Senior Companion Program',NULL,1304379056037082,'Medical escorting, light errands, Friendly Visiting, companionship, meal planning, medication reminders, caregiver respite, senior volunteers (55+) escort and assist other seniors. It is a free service that mostly serves the Lower East Side and mid-town Manhattan. Call for availability. ','1123891610331428','www.henrystreet.org/programs/senior-services/senior-companion-program',NULL,'sscott@henrystreet.org',NULL,'1119801442928622,1177309407177568,673898301722674',NULL,NULL,NULL,NULL,NULL,'950927843601742',NULL,NULL,NULL,'1281053011320920',NULL,NULL,NULL),(560,1277526841493881,'Samantha Fox Care Consulting',NULL,NULL,'A staff of private geriatric care managers. A bio-psychosocial and spiritual assessment will be completed during an initial home visit, which takes about an hour and fifteen minutes. It is often most beneficial if the client and a family member — or reliable source of information — can be present for a portion of the visit.\nAfter which, a Care Plan is completed with solutions to all of the identified challenges. Your Geriatric Care Manager then reviews the Care Plan with the client, their family and support systems.','826444310586459','http://samanthafoxcare.com/',NULL,'Samantha@SamanthaFoxCare.com',NULL,'867375223184816',NULL,NULL,NULL,NULL,NULL,'766383076599420',NULL,NULL,NULL,'682840051213442',NULL,NULL,NULL),(561,1274565924160344,'Housing-Anti-Eviction',NULL,1304259208669277,'From their website: \"Empowers communities to advocate for tenant rights by providing information and trainings on tenants’ rights and partnering with neighborhood-based organizations that work to assist low-income residents and organize tenants in building-wide actions.\" MANHATTAN AND BROOKLYN TENANTS, CALL OUR INTAKE LINE FOR HELP: 212-417-3888, WEDNESDAY & FRIDAY, 2 pm – 4:30 pm. BRONX TENANTS, CALL OUR INTAKE LINE FOR HELP: 212-417-3889, THURSDAY, 2 pm – 5 pm.','570605317719517,1192286713750359','http://mobilizationforjustice.org/projects/neighborhood-preservation-project/',NULL,NULL,NULL,'958412510535349',NULL,NULL,NULL,NULL,NULL,'826422009097833,959692609175336',NULL,NULL,NULL,'1014759213496591,1014759213496591',NULL,NULL,NULL),(562,1284264129545270,'Heights and Hills',NULL,NULL,'From their website: \"Our services are provided free of charge to those over the age of 60 and their family caregivers without regard to race, religion, national origin, gender, disability, marital status, sexual orientation, or economic status. Overall, we serve 19 different neighborhoods – providing case management and caregiver services as well as volunteer and inter-generational programs in 18 of those neighborhoods, and caregiver services in one additional neighborhood.*\"','567755293483811','www.heightsandhills.org',NULL,NULL,NULL,'822552305363624,843777382088472',NULL,NULL,NULL,NULL,NULL,'695970036704263',NULL,NULL,NULL,'681067203306557',NULL,NULL,NULL),(563,1291638890600154,'Medicare & Medicaid Advisory Group',NULL,NULL,'Client assistance and advocacy in obtaining Medicare & Medicaid eligibility. Call for a free consultation. ','923209935394939','https://mmag.org/',NULL,NULL,NULL,'629629464544122,1107228321502442,1267306776036445',NULL,NULL,NULL,NULL,NULL,'623549801998897',NULL,NULL,NULL,'1224237544664276',NULL,NULL,NULL),(564,1293918307707410,'Atria Senior Living',NULL,NULL,'Luxury independent and assisted living, as well as memory care in select locations. 24/7 staff assistance with personal care, medications, and incontinence management. Apartment accommodations, concierge service, maintenance staff, recreation, and scheduled transportation available. \n\nPosted 11/19','873667375247581','www.atriaseniorliving.com/clusters/westchester-county/',NULL,NULL,NULL,'1320205185937576,919422912164535,584503804670909,1310065103612125',NULL,NULL,NULL,NULL,NULL,'1266899755994071',NULL,NULL,NULL,'967118179188980',NULL,NULL,NULL),(565,1303983731167920,'Wright Center EGL House Call Program',NULL,746413696580983,' The EGL House Call Program at New York Presbyterian Hospital- Weill Cornell Medical Center is comprised of physicians and a geriatric nurse practitioner that provide home-based primary (and occasionally consultative) care for homebound older adults living in Manhattan.  The service areas are primarily from 40th Street to 100th Street on the East and West sides of Manhattan. Provides on-going geriatric care at home (not for emergency situations). Seniors may refer themselves to the program (expect to hear back from a nurse practitioner or doctor in two weeks). Afterwards, an in-home evaluation is scheduled (average wait for visit is 6-8 weeks). Speak with Jasmine Lucena, Administrative Assistant. ','897656728307711','https://geriatrics-palliative.weill.cornell.edu/clinical-care/geriatric-medicine',NULL,'jal9088@med.cornell.edu',NULL,'1216469255274749,1180772910179038',NULL,NULL,NULL,NULL,NULL,'633127916291731',NULL,NULL,NULL,'1033123094970911',NULL,NULL,NULL),(566,1308492678118167,'Road to Recovery',NULL,746670598739098,'Provides cancer patients with ground transportation to and from cancer-related medical appointments at no charge. Rides are dependent on volunteer availability. Patients must be able to walk unassisted to and from the vehicle, or have an accompanying caregiver to assist. \n\nPosted 10/19',NULL,'https://www.cancer.org/treatment/support-programs-and-services/road-to-recovery',NULL,NULL,NULL,'1233481324906768,1137936067119622',NULL,NULL,NULL,NULL,NULL,'1085051943132408',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(567,1316467405314016,'Paul Feiner, Town Supervisor',NULL,617986422260890,'Greenburgh Residents--Assistance with snowblowing for elderly or disabled individuals. \n\nPosted 10/19',NULL,NULL,NULL,'pfeiner@greenburghny.com',NULL,'772331273438770',NULL,NULL,NULL,NULL,NULL,'859077573416523',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(568,1322300181569802,'RiverSpring Assisted Living',NULL,937797454062332,'Assisted living facility that provides independence along with extra support and personal care services, with many amenities.','965388838643147','https://www.riverspringhealth.org/assisted-living/',NULL,NULL,NULL,'924951065612317,973172406940749',NULL,NULL,NULL,NULL,NULL,'1321023562534446',NULL,NULL,NULL,'756690322602699',NULL,NULL,NULL),(569,1322038973082917,'Engaging Alzheimer\'s: Fostering Hope in a Time of Despair',NULL,1237487918486103,'Whether you’re a Professional Caregiver or a Family Member caring for a loved one, using best-practices in dementia care typically reduces stress for the caregiver and increases the well-being of the person with dementia.\n\nEngaging Alzheimer\'s proven strategies and distinctive approach have helped hundreds of families, as well as healthcare organizations to successfully navigate the many challenges in caring for someone with Alzheimer’s or a related dementia.',NULL,'http://www.engagingalzheimers.com/',NULL,NULL,NULL,'919422912164535',NULL,NULL,NULL,NULL,NULL,'760959707769290',NULL,'806733602897738',NULL,NULL,NULL,NULL,NULL),(570,1324235246176285,'Day for Night: The Evening Meal Program',NULL,1016766891399541,'\"For homeless and frail elders, or those who simply may not have access to kitchen facilities, Project FIND provides takeaway meals four days a week at the Coffeehouse Senior Center. From 2:00 to 2:30 p.m. on Mondays, Tuesdays, Wednesdays, and Fridays, Project FIND distributes a takeaway meal in a bag. And on Thursday evenings at 5:00 p.m., seniors can enjoy a hot meal in a communal setting, with social activities such as dancing and bingo. Takeaway dinners are free and there is a small fee for dinner on Thursdays.\"','1102526623232593','http://www.projectfind.org/services_for_the_homeless',NULL,NULL,NULL,'958412510535349',NULL,NULL,NULL,NULL,NULL,'1111101890017237',NULL,NULL,NULL,'778098386108808',NULL,NULL,NULL),(571,1326591925458082,'Senior Helpers',NULL,NULL,'Home care, including concierge care for multiple tasks.','1126104339717151','www.seniorhelpers.com/',NULL,NULL,NULL,'687567198750084',NULL,NULL,NULL,NULL,NULL,'799605729692607',NULL,NULL,NULL,'747349028687216',NULL,NULL,NULL),(572,1334037545232698,'Lenox Hill Neighborhood House Legal Advocacy Clinics',NULL,631176636895026,'On-going drop-in programs and clinics that offer assistance with SNAP, tenants\' rights, and NYC rent freezer (DRIE/SCRIE). Call for times and locations.   ','763644124277369','https://www.lenoxhill.org/legaladvocacy',NULL,NULL,NULL,'1107228321502442,629629464544122,1267306776036445',NULL,NULL,NULL,NULL,NULL,'1236564916232831',NULL,NULL,NULL,'885741754788620',NULL,NULL,NULL),(573,1333777208514447,'Alzheimer\'s Disease Resource Center Toll-Free Hotline Service',NULL,NULL,'Provides information, programs, education, services, and support for families affected by Alzheimer\'s disease including a toll-free hotline service 24 hrs/7 days a week. Serves the greater New York Metropolitan area, which includes Nassau County, Suffolk County, Brooklyn, Queens and Manhattan. ','1168618673273805','http://www.adrcinc.org/',NULL,'Info@ADRCinc.org',NULL,'1253061813300180,1106914314143204,1285075174713673,681957604814502,822552305363624,953560938102102',NULL,NULL,NULL,NULL,NULL,'547831214102988',NULL,NULL,NULL,'1183863488381401',NULL,NULL,NULL),(574,1334744755839365,'Social Services at West Side Campaign Against Hunger',NULL,1106726852579981,'From February through April, a free walk-in tax preparation help service (call for days/times). Can help with Public Assistance, HASA, Social Security benefits, rent increase and exemption programs.','916106617005458','https://www.wscah.org/social-services/',NULL,'info@wscah.org',NULL,'681847053958180',NULL,NULL,NULL,NULL,NULL,'1182396692994200',NULL,NULL,NULL,'1170806548578938',NULL,NULL,NULL),(575,1281290033041778,'Robbin E. Sweeney, Esq. ',NULL,831930425738202,'Posted 10/19','965295398027061',NULL,NULL,'Robbin@RoseMarkLaw.com',NULL,'1113969124035608',NULL,NULL,NULL,NULL,NULL,'821193706147886',NULL,NULL,NULL,'1162978222193727',NULL,NULL,NULL),(576,1283729822306253,'Loren Gilberg',NULL,1117057865091140,'Elder care consultant and geriatric care manager.\n\nPosted 10/19','629818742533521',NULL,NULL,'eldercarecorp@aol.com',NULL,'922137071025167',NULL,NULL,NULL,NULL,NULL,'904897456632260',NULL,NULL,NULL,'934422561169823',NULL,NULL,NULL),(577,1305646623740174,'CityMeals Friendly Visiting ',NULL,1107730117300308,'From their website: \"Must have case management through a DFTA agency to use the program; Matches volunteers with homebound seniors in need of companionship. Volunteers visit for one hour on a weekly basis, forging friendships and helping to alleviate loneliness.\" Serves all 5 boroughs.','1070671977502200','https://www.citymeals.org/get-involved/friendly-visiting',NULL,NULL,NULL,'1177309407177568',NULL,NULL,NULL,NULL,NULL,'950658606353519',NULL,NULL,NULL,'641740785001896',NULL,NULL,NULL),(578,1308332507590715,'Jewish Family and Children\'s Services of Northern NJ',NULL,NULL,'Services include a Friendly Visiting program, Care Management, Kosher Meals on Wheels, Telephone Reassurance, Monthly Luncheon, programs specific to Holocaust survivors, Telecare Connections Skype calls and Shabbat meals.  Seniors need an intake and home assessment. For Friendly Visiting, meals, and Telephone Reassurance, seniors must be homebound. For seniors residing in Northern New Jersey. ','931786393461343,1293782265548076,831647026939129','https://www.jfcsnnj.org/elder-service-care',NULL,'info@jfsbergen.com',NULL,'1050752555762937,1177309407177568,935600275247423,819444632829102,1296742648227889',NULL,NULL,NULL,NULL,NULL,'1181572654269733',NULL,NULL,NULL,'1099495898060402,787124761743266,1285659757184742',NULL,NULL,NULL),(579,1316321763518783,'The New York Hearing Center',NULL,NULL,'Offer patients a comprehensive array of services specific to the evaluation, rehabilitation, and prevention of hearing impairment and balance disorders.','751057408772611,864883045897761,959037259009899','http://thenewyorkhearingcenter.com',NULL,NULL,NULL,'673030812970350',NULL,NULL,NULL,NULL,NULL,'1122607972128578',NULL,NULL,NULL,'800501523050929,894720176791830,1173049854673164',NULL,NULL,NULL),(580,1331427990943380,'Kosher Meals for the Homebound',NULL,1155578608136431,'Frozen meals delivered to seniors who are homebound and kosher and reside on the upper east side and upper west side of Manhattan. Meals are delivered once a week. Face to face delivery (senior must be home to receive delivery). ','1216774939834028','www.dorotusa.org',NULL,NULL,NULL,'935600275247423',NULL,NULL,NULL,NULL,NULL,'1250724514805056',NULL,NULL,'942885369302412','967252529008278',NULL,NULL,NULL),(581,1337583931030185,'Mavencare Home Care',NULL,NULL,'Serving New York City’s five boroughs and Nassau County. Provide personal care, companionship, and specialty care from home health aid (hourly, live-in, 24/7 active), skilled care from Licensed Practical Nurse. They screen for the most qualified and compassionate home health aides. All hired caregivers are W2 employees, fully licensed, bonded, insured, and well-paid with the option for health insurance. Rates (as of March 2019): Private pay, HHA $28/hour, $325/day live-in; LPN $55/hour. Medicaid (VillageCareMAX MLTC/MAP plan & Integra MLTC plan). They can bill all major Long Term Care Insurance companies. Each client has a designated team of HHA(s) and full-time RN, Social Worker, and Care Coordinator. This level of support allows them to take on clinically and psychosocially complex clients, including those with Alzheimer’s, Dementia, Parkinson’s, and Heart Diseases. They have a Connected Home Care App, so families can stay connected with their loved one’s care and their entire care team, and they also have 24/7 care and support. Client Services Director, John J. Bayeux III\n','861942914179061','https://mavencare.com/',NULL,NULL,NULL,'687567198750084',NULL,NULL,NULL,NULL,NULL,'961295410961873',NULL,NULL,NULL,'1096088525791771',NULL,NULL,NULL),(582,1335709926879904,'The Center for Learning and Living',NULL,612134846360162,'From their website: \"Non-profit lifelong learning organization offering weekday daytime classes on a wide range of subjects. Since its founding at Marymount Manhattan College in 1994, students have enjoyed intellectual stimulation in a lively, informal atmosphere. All teachers are volunteers: retired academics, experts in the business world, the arts and other fields. Classes are year-round — 8 weeks in the fall, winter and spring, and 4 weeks in the summer.\"','1338356572053936','http://www.clandl.org/',NULL,'form@clandl.org',NULL,'972558970458700',NULL,NULL,NULL,NULL,NULL,'970043634799847',NULL,NULL,NULL,'1091243956166314',NULL,NULL,NULL),(583,1338647007542051,'Supportive Housing & Housing Advocacy',NULL,858356057392670,'From their website: \"We provide individualized, recovery-oriented services to 22 residents who have been homeless, have a mental health diagnosis or substance abuse issues. We help them improve their quality of life by providing help establishing financial solvency, consistent and effective medical and psychiatric care, and positive engagement in daily social activities. Gathering around our large dining table to celebrate holidays and other special occasions gives tenants, who are otherwise living by themselves, a sense of belonging to a supportive community.\"','780506072615648','http://ujceastside.org/ujc-social-services',NULL,NULL,NULL,'958412510535349,1267306776036445',NULL,NULL,NULL,NULL,NULL,'816683693419818',NULL,NULL,NULL,'619641711895444',NULL,NULL,NULL),(584,1343296937249612,'305 West End Independent & Assisted Living',NULL,NULL,'Luxury senior living facility with amenities including: housekeeping, weekly linens and laundry, town car service and motor coach transportation to and from outside activities, country club dining room, bistro grill and juice bar (three meals served per day), fitness center, exercise classes, wellness programs, educational and social activities, outdoor terrace, on-site cinema, and a salon. They also have a specialized memory care unit on two private floors, fully dedicated to residents living with Alzheimer’s disease and other memory-related cognitive disorders. The Reflections Memory Care area is staffed with a team of experienced professionals who are trained in proven therapies, strategies and modalities for enhancing the quality of life for these special-needs residents and their families.','1174681486621078','https://305westendassistedliving.com',NULL,NULL,NULL,'924951065612317,973172406940749,1285075174713673,1253061813300180,1106914314143204',NULL,NULL,NULL,NULL,NULL,'678869066523980',NULL,NULL,NULL,'1040500967870649',NULL,NULL,NULL),(585,1344055538134890,'Friendship Houses',NULL,853324273796035,'Locations in Brooklyn and the Bronx. A psycho-social club that helps seniors 55 and older who have a mental health condition, diagnosis, or co-occurring disorders improve and maintain successful community living. Reduces isolation, promotes socialization, living skills, and self-esteem and offers volunteer opportunities. Also promotes health with wellness programs and peer support groups. Members benefit from a hot lunch, programming, and other JASA services.','961138383778754,933208257979463','https://www.jasa.org/community/mental-health-services#.W3W3k85KiUk',NULL,NULL,NULL,'1112870426305700',NULL,NULL,NULL,NULL,NULL,'638065560172751',NULL,NULL,NULL,'1182773979882361,827159434835637',NULL,NULL,NULL);
